(417, 745, 257, 894, 'Qualities of Danseuse=Qualities of Danseuse,Qualities of a Percussionist=nimble with fingers,Qualities of a Dancer=steady and balanced in performance,Qualities of a Nattuvanar=Able to utter accurately each rhythmic sequence,Qualities of a Guru=Humble without the arrogance of knowledge,Qualities of a Singer=learned in the marga and desi styles of music,Villadavu=the body arches like a bow,Mandiadavu=Dancer sits all the way down with knees bent,Marthitha Adavu=Hands and Body make a full swing front and sideways,Kuththa Adavu=Dancer jumps low with toes firmly rooted on the floor', 10, 1, 5),
(418, 745, 263, 894, 'Bharatanatyam a form of classical dance which can also be termed as the traditional and cultural treasure of india, marks its evolution thousands of years back,when sage Bharata wrote the treatise Natyasastra and gave it life, exposing it to his hundred sons. Thus it has travelled far and long to where it stands in the world arena as the most enticing form of art. It takes it roots from Southern India, which is said to be the abode of magnificant temples and magnanimous Kings who hold major roles in providing lustre and has been handled and presented with individual creative backgrounds.So we have the different styles or Banis which mark the individual Master\'s thinking and creativity. Bharatanatyam can project all aspects like religion,sentimental values,yoga, science,myth Philosophy and everyday to day activity of every life form on earth by beautiful patterns and movements.', 5, 1, 4),
(419, 745, 258, 894, 'The epic which explains the fame of kutthu in tamil is Silappadigaram. The kutthars of those days learnt all the 64 arts. The koothu form pertaining to the kings is called \'\'vethiyal\'\' and those belonging to the rest are called \'\'podhuviyal\'\'.Kuthars had training from the age of 5 to 12. After the Arangetrams which took place in kings court, the Kutthi would receive gold and gems as a reward and a title \'\'Thalaikol\'\'. This Thaiakol was of a 7 span length and it was made up of bamboo and was studded with gems there were golden knots inbetween. At the beginning of the Indira Vizha, a festival,puja was done to this. The stick was then given to royal elephant and was taken for a procession along with the king who rode along with other ministers. It was then given to the dance teacher who was standing on the chariot. He would receive it and keep it at the arangam. The lady dancer would received this was called \'\'Thalaikoli\'\'. The Nattuvanar was called \'\'Thailaikol Asan\'\'.', 5, 1, 4),
(420, 745, 260, 894, 'Kuravai is a form of folk dance which is danced by the women to remove bad things created by lord muruga son of lord shiva in kurinjipattu kabilar as mentioned a which is performed while standing on a rope. During festivals Kutthu dance form called \'\'Tunangai\'\' was danced in the streets. The dance which was danced in fornt of the chariot of the king who had won a battle were called Muntherkuravai.  The dance which was danced by the victorious soldiers holding their swords is called \'\'Val Amalai\'\'.', 5, 1, 4),
(421, 745, 261, 894, 'To remove bad things created by lord muruga son of lord shiva, women sang of his fame and danced kuravai , a form of folk dance. In Kuranji pattu, Kabilar has mentioned a dance which is performed while stamding on a rope. During festival a kuthu dance form called Thunangai was danced in the streets. The dance which was danced behind the chariot of the kings who had won a battle were called Pintherkuravai and the victorious soldiers dance by holding their swords called \'val  Amalai\'\'.', 0, 0, 4),
(422, 745, 259, 894, 'At the beginning of indra vizha, a festival, puja was done to thalaikol which was 7 hand span length and made up of bamboo and was studded with gems. There were golden knots inbetween which was received from the king after arangetram which took place in the kings court by the Kutthi. The stick was then given royal elephant and was taken for a procession along with the king who rode along with other ministers. It was then given to the dance teacher who was standing on the chariot. He would receive it and keep it at the arangam. The Lady dancer who received this was called thalaikoli. The nattuvanar was called Thalaikol Asan. The one who sang songs for dance was called thoriya Madanthai.', 0, 1, 4),
(423, 745, 262, 894, 'Abinaya Darpana was written by Nandikesbara Presumably between 3rd and 4th century AD. Abinaya Darprana\'s script is in Telugu and it is generally believed that nandikeswara hailed from Andrapradesh. This book consist of 324 slokas in a single chapter unlike the natyasastra the Abinaya Darpana predominently deals with the gestures of head, eyes, neck, hand gestures representing gods, Dasavtaras, caste,relations etc and the manadalas, utplavanas, bhramaris, caras,gatis employed in dance. All south indian dance forms like kuchipudi and bharatanatyam follow this text extensively. The author of Natyasastra is sage bharata who was initiated by Brahma himself in the art of dancing. This 3000 year old art is still as fresh and facinating as it must have been inspired the sculptures who have left their imagination on stone.', 5, 1, 4),
