(444, 745, 394, 895, 'Shakatam --=The Cart,Chaturam=The square,Vayu=Araalam in right hand and Ardhapathakam in left with left fingers facing the earth,Varuna=Pathakam in right hand and shikaram in left held near the chest sama padam,Murugan=Right hand in Trishoolam and left in shikaram held near the chest. Mandalam position with leg bent inwards,Agni=Tripathakam in right hand and kangulum in left held near the chest,Soorya=Kapitham in right hand and left in alapadmam. Feet in samam position,Chandra=pathakam,Vishnu=Both hands in tripathakam near the shoulders with palms facing outwards,Mahalakshmi=Both hands in kapitham near shoulders , body in asana  position', 9, 1, 5),
(445, 745, 395, 895, 'Nritha in a classical aesthetic terms is pure dance that creates sheer aesthetic deligh in the onlookers. Its basic contituents are thala, and laya.In Nritha emphasis is on clarity of dance movements with accompaniments provided by nrtta hastas. Such movements have no hidden emotive contents that they are dance done for thier on sak, creating patterns in space and time.', 4, 1, 4),
(446, 745, 399, 895, 'Asamyutha hastas means non union.  They are single hand gesturers. They are pathakam, tripathakam, ardhapathakam, kartarimukham, mayuram, ardhachandram, aralam,sukatundam, musti, sikharam, kapittham,katakamukham, suci, candrakala, padmakosam,sarpasirsam,mrgasirsam,simhamukham, kangulam, alapadmam,caturam, bhramaram, hamsasyam, hamsapaksam, sandamsam, mukulam,tamracudam, trisulam. Hence theses are different types in single handed gestures.', 4, 1, 4),
(447, 745, 400, 895, '1. Matsyam;fish\r\n2. Kurmam;turtle\r\n3. Varaham;the swine\r\n4.Narasimham;man lion form\r\n5. Vamana;the devine midget\r\n6.parasurama\r\n7;Rama\r\n8.Balarama\r\n9.Krshna\r\n10.Kalki', 5, 1, 4),
(448, 745, 396, 895, 'Nritya is an integral component using interpretive aspect of bharatanatyam.Conjuring up and attractive world of imganiation. The sanskrit term abhinaya means to educate or to convey ideas to the audience. The sanskrit is text by nandikesvara states that actors educate the audience by stimulating in them the latent possibility of an aesthetics. This interpretation is done by movement of limbs and gestures, by voice and through meaning words by attire and decorations and by physical manifestations', 5, 1, 4),
(449, 745, 397, 895, 'Natya is a combination of Nrtya and Nrtta with a dramatic element to it. It is the dramatization of a theme. The most common themes in the repertoire of bhrathanatyam are stories which sing praises of the deeds of the various hindu gods. Other themes include a number of stories of kings in whose praise many great poets have penned beautiful songs. Natya is thus the visula painting that the dancer draws to get the story across the audience.', 4, 1, 4),
(450, 745, 398, 895, 'Samyutha hastas means double hand gestures. In Sanskrit this word means union. Angali, Kapotam,karkatam,svastiokam,dolam,puspaputam,utsangam, sivalingam,katakabardhanam,kartarisvastikam, sakatam,sankham,cakram,samputam,pasam,kilaka,matsya,kurmam,varaha,garuda,nagabandham,khadva,berundam,abahittham. These are the differnt kinds in samyutha hasthas.', 5, 1, 4),
