(710, 615, 263, 507, 'The south cassical dance is thousands of years old.\r\nWe see it in the sculptures found in south indian temples.\r\nat Chidambaram, Tanjavur, and Mahabalipuram.\r\nPeople started dancing classical dances first in the temples for the devas and whoever came to the temple.\r\n These dancers where called devdasis or servants of the gods. Dance is mentioned in the tamil works sillapadikaram and manimegalai of the sangam age.', 0, 0, 4),
