(734, 615, 396, 514, 'nrithya is used to convey ideas to the audience. This is done through\r\n movment of limbs using angika abhinayam, \r\nby voice and music using vachika abhinayam,\r\nby dress and ornaments using aharya abhinayam,\r\nand through dancers feelings using satvika abhinayam.  ', 4, 1, 4),
(735, 615, 395, 514, 'Nritha means pure dance. It is made up of time and rhythm. Nritha does not have emotions it is based on adavus. It is also done with hands movements or nritha hastas. ', 5, 1, 4),
(736, 615, 399, 514, 'asamyuta hastas are single hand gestures.\r\n There are 28 asamyuta hastas. \r\nSome examples of asamyuta hastas are pataka ( flag ), mayuram ( peacock ), trishula ( trident), and kapittam ( wood apple ).', 4, 1, 4),
(737, 615, 397, 514, 'Natya is a combination of nritya and nritta.  Natya is performed about various hindu gods, kings, and celestial beings.It usually is based on a certain story. the dancer displays this story  to the audience using natya .', 4, 1, 4),
