(810, 530, 257, 517, 'Qualities of Danseuse=steady and balanced in performance,Qualities of a Percussionist=nimble with fingers,Qualities of a Dancer=steady and balanced in performance,Qualities of a Nattuvanar=Able to utter accurately each rhythmic sequence,Qualities of a Guru=Humble without the arrogance of knowledge,Qualities of a Singer=learned in the marga and desi styles of music,Villadavu=the body arches like a bow,Mandiadavu=Dancer sits all the way down with knees bent,Marthitha Adavu=Hands and Body make a full swing front and sideways,Kuththa Adavu=Dancer jumps low with toes firmly rooted on the floor', 10, 1, 5),
(811, 530, 263, 517, 'Bharatanatyam is among the oldest forms of South Indian classical dance being over 1000 years old. It has its routes in religion, sentimental values, and day-to-day activity. Sage Bharata wrote Natyasastra who was initiated by Brahma in the form of dance. Many classical dances are based on rules of Natyasastra. Abhinayadharpana was written by Nandikeshwara which contains several shlokas and deals with hand, neck, eye, and head gestures of dance. In olden times, it was performed by people called devadasis. There are also other classical dance forms such as Kuchipudi and Kathakali. ', 4, 1, 4),
(812, 530, 262, 517, 'Abhinaya Darpana was written by Nandikeswara. It is written in Telegu. It contains several slokas in a single chapter. It is believed to have been written between the 3rd and 4th century AD. Abhinaya Darpana deals with hand, eyes, head, and neck gestures which represent gods, religions, etc. All South Indian dance forms such as Kuchipudi and Bharatanatyam follow this script.', 5, 1, 4),
(813, 530, 260, 517, 'Kuravai is a form of folk dance. The dance which is danced in front of the chariot of the kings who had won in battle is called Muntherkuravai. ', 4, 1, 4),
(814, 530, 259, 517, 'Those who learned the koothu were called kuthars. After the arangetram the kutthi recieved gold and gems as a reward and a title called Thalaikol. Thalaikol was made of bamboo and studded with gems and it would be given to the dance teacher standing at the chariot. He would recieve it and keep it at the performance stage. The lady dancer who recieved was called Thalaikol. The nattuvanar was called Thalaikol asan. The singer was called Thoriya Madanthai. ', 4, 1, 4),
(815, 530, 261, 517, 'Kuravai is a form of folk dance. The dance which was danced behind the chariot of the kings who had won a battle were called Pintherkuuravai. ', 4, 1, 4),
(816, 530, 258, 517, 'Kuthars were famous in koothu [Drama]. After performing their arangetram at the king\'s court, the kutthi would recieve gold and gems and a title thalaikol. Thalaikol was made of babmboo and was studded with gems. This was given to the dance teacher who would keep it near the stage. The lady dancer who received it was called the thalaikoli and the nattuvanar was called the thalaikol asan.', 4, 1, 4),
