(838, 614, 260, 519, 'The Muntherkuravai is the procession which dances in front of the chariot of the king.\r\nUsually done when the King arrives victorious from a war.\r\n', 4, 1, 4),
(839, 614, 258, 519, 'Thalaikol Asan is anybody who is a Nattuvanar and Teacher\r\nHe recieved the Thalaikol or Bamboo Stick \r\nHe would keep the Thalaikol in the Aarangam and then award it to the dancer after her arangetram\r\n', 4, 1, 4),
(840, 614, 259, 519, 'Thoriya Madanthai is the one who sang songs for dance\r\nHe would perform during the dance of the Thalaikoli', 5, 1, 4),
(841, 614, 262, 519, 'Abhinaya Darpana is a text written by Nandikeshwara\r\nIt was written between the third and fourth century AD\r\nThe script of the Abhinaya Darpana is written in Telugu.\r\nIt deals with the gestures of head, eyes, and neck.\r\nIt also deals with hand gestures which represent Gods, Dashavatar, and relationships.\r\n', 4, 1, 4),
(842, 614, 263, 519, 'Classical dance is one of the two main forms of dance\r\nSouth Indian classical dance revolves around the Natyashastra written by Bharata\r\nIn Tamil Nadu the Devadasi system was a main part of dance.  Devadasis performed classical dance in the temples. This was known as Dasi attam\r\nThere are three main aspects to South Indian Classical dance: Bhava, Raga, and Tala.\r\nThe main purpose of South Indian Classical dance is to produce Rasa or essence.\r\nDuring the Maratha rule, kings encourage and contributed to Classical dance.\r\nThe Tanjavur Quartet played a huge role in shaping this art.', 4, 1, 4),
(843, 614, 261, 519, 'The Pitherkuravai is the procession which dances behind the chariot of the King.\r\nUsually occurs when the king returns victorious from a war.\r\nThe procession which dances in front of the chariot is known as the Muntherkuravai', 5, 1, 4),
