(864, 614, 394, 520, 'Shakatam --=The Cart,Chaturam=The square,Vayu=Araalam in right hand and Ardhapathakam in left with left fingers facing the earth,Varuna=Pathakam in right hand and shikaram in left held near the chest sama padam,Murugan=Right hand in Trishoolam and left in shikaram held near the chest. Mandalam position with leg bent inwards,Agni=Tripathakam in right hand and kangulum in left held near the chest,Soorya=Kapitham in right hand and left in alapadmam. Feet in samam position,Chandra=Ardhachandram in right hand and alapadmam in left held near the chest.,Vishnu=Both hands in tripathakam near the shoulders with palms facing outwards,Mahalakshmi=Both hands in kapitham near shoulders , body in asana  position', 10, 1, 5),
(865, 614, 395, 520, 'Nritha is pure dance. \r\nIts basic contents are tala and laya\r\nIt creates aesthetic sensation in the spectators\r\nClarity of dance movements is a significant aspect of Nritha\r\nIt is enhanced by Nritha hastas \r\nNritha is also emotionless as it does not require any facial expression\r\nSome examples of dances with pure Nritha are Alarippu and Jatiswaram\r\n\r\n\r\n', 5, 1, 4),
(866, 614, 399, 520, 'Asamyutha Hastas are single hand gestures\r\nThrough the single hand gestures a dancer can represent clouds, woods, rivers, animals etc.\r\nEach Asamyutha Hasta has its own individual meaning\r\nFor example Pathaka means flag and Kapita means wood apple\r\nHowever these single hand gestures can be used together to create one cohesive meaning.\r\nFor example to portray Bramha we use Hamsasya in the right hand and Chatura in the left hand.\r\nAsamyutha Hastas can also be used to show emotions in dance.\r\n\r\n', 5, 1, 4),
(867, 614, 396, 520, 'Nrithya is dance with pure Abhinaya.\r\nThe Sanskrit word Abhinaya means to educate.\r\nThere are four types of Abhinaya: Angika, Vacika, Aharya, and Sattvika.\r\nIn the Abhinaya Darpana by Nadikeshwara the importance of Abhinaya is stressed.\r\nIn Margam tradition of Bharatanatyam items Alarippu and Jatiswaram show only Nritha and Angika Abhinaya, however in Shabdams and Varnams Abhinaya is included.\r\n\r\n', 5, 1, 4),
(868, 614, 400, 520, 'The Dasavatara are the ten incarnations of Vishnu.\r\nThe ten incarnations include: Matsya, Kurma, Varaha, Narasimha, Vamana, Parashurama, Rama, Balarama, Krishna, and Kalki.\r\nTo show Matsya we use the Matsya hasta\r\nTo show Kurma we use the Kurma hasta\r\nTo show Varaha we use the Varaha hasta \r\nTo show Narasimha we hold the left hand in Simhamukha and the right hand in Thripataka\r\nTo show Vamana we hold the right hand in Musti at shoulder level and the left hand in Musti near waist level.\r\nTo show Parashurama we hold the left hand in Dola and the right hand in Ardhapataaka\r\nTo show Rama we hold the right hand in Kapittha and the left hand in Shikara\r\nTo show Balarama we hold the right hand in Pataka and the left hand in Musti. The right hand is placed above the left hand.\r\nTo show Krishna we hold both hands in Mrigashirsha\r\nTo show Kalki we hold the right hand in Pataka and the left hand in Tripataka.\r\n\r\n', 5, 1, 4),
(869, 614, 397, 520, 'Natya is the combination of Nritha and Nrtya with a dramatic element\r\nNatya is the dramatization of a theme.\r\nThe most common themes in Bharatnatyam are Hindu gods and stories from Mythology.\r\nGreat epics such as the Mahabharata and Ramayana are commonly performed in Natya\r\nOther common themes include various great kings of Mythology.\r\nNatya involves a story, characters, props, and a dramatic experience.\r\n\r\n', 4, 1, 4),
(870, 614, 398, 520, 'Samyutha Hastas are double hand gestures\r\nIn Sanskrit Samyutha means Union.\r\nThere are 24 Samyutha hastas.\r\nThese hastas include: Anjali, Kapota, Karkata, Svastika, Dola, Pushpaputa, Utsanga, Shivalinga, Katakavardana, Kartareesvastika, Shakata, Shanka, Chakra, Samputa, Paasha, Keelaka, Matsya, Kurma, Varaha, Gardua, Nagabandha, Khatva, Bherundaha, Avahita.\r\nThese hastas enhance the beauty of the pure dance.\r\nNot only do these hastas denote inanimate objects but they also depict livings things such as animals, humans, emotions etc.\r\n', 5, 1, 4),
