(891, 530, 394, 521, 'Shakatam --=The Cart,Chaturam=The square,Vayu=Araalam in right hand and Ardhapathakam in left with left fingers facing the earth,Varuna=Pathakam in right hand and shikaram in left held near the chest sama padam,Murugan=Right hand in Trishoolam and left in shikaram held near the chest. Mandalam position with leg bent inwards,Agni=Tripathakam in right hand and kangulum in left held near the chest,Soorya=Kapitham in right hand and left in alapadmam. Feet in samam position,Chandra=Ardhachandram in right hand and alapadmam in left held near the chest.,Vishnu=Both hands in tripathakam near the shoulders with palms facing outwards,Mahalakshmi=Both hands in kapitham near shoulders , body in asana  position', 10, 1, 5),
(892, 530, 396, 521, 'Nrithya means to mime along with rythmic dance. It is considered to be an interpretive aspect of Bharatanatyam. Interpretation is done by movement of limbs, gestures, by voice, by attire, and physical manifestations. ', 5, 1, 4),
(893, 530, 395, 521, 'Nritha is a pure dance that creates sheer aesthetic delight to the audience. The movements have no emotive contents. The emphasis is on clarity on dance movements with accompaniments provided by hand movements. ', 4, 1, 4),
(894, 530, 400, 521, 'Matsya--hands one on top of the other, at shoulder level, denoting fish\r\nKurma--hands held near the face in kurma\r\nVaraha--hands held in varaha near face\r\nNarasimha--right hand tripitaka, left hand simhamuka\r\nVamana--both hands in mushti\r\nParasurama-- ardhapataka in right hand, dola in left\r\nRama--right hand kapitha, left shikaram\r\nBaharama--right pathaka, left mushti\r\nKrisna--both hands mrigasirsam\r\nKalki--right hand pataka, left hand tripataka', 5, 1, 4),
(895, 530, 399, 521, 'Asamyutha hastas are single handed gestures. Asamyutha means non-union. There are 28 single handed gestures. Some of the mudras are used only for enhancing the beauty of the pure dance, these are called Nritta hastas. These mudras are used for communication in dance. ', 5, 1, 4),
(896, 530, 397, 521, 'Natya is a combination of Nrtya, which is abhinaya, and Nritta, which is pure dance. Natya involves a story/epic. Other themes include stories about kings of different eras.', 4, 1, 4),
(897, 530, 398, 521, 'Samytha hastas are two handed gestures. Samyutha means union. There are 24 two handed gestures. Some of them include anjali, to denote salutation, kapothascha (pigeon), dola, the swing, and uthasanga, the embrace. Samyutha Hastas are used as a mode of communication in Bharatanatyam. ', 5, 1, 4),
