(908, 385, 492, 896, 'Uras=Chest,Svastika=Arm is crossed in the chest region,Uru=Thighs,Prasarita=Arm movement stretched,Padmanabha=Lord Vishnu,Vaishaka=Sthana for women,Padmakosha=Asamyutha hastha,Bramari=Dance for women,Ayata=Jumping,Paadachari=Eight types', 10, 1, 5),
(909, 385, 494, 896, 'The movement of the hips is explained in the Natyashastra. These movements are more used in Kuchupudi and Odissi. There are 5 types of this.', 4, 1, 4),
(910, 385, 493, 896, 'There are 7 sthanas for women and involves the the resting of one foot at a time to lightly raise the hip and give lasya. The toes are heavily used in this positions.', 4, 1, 4),
(911, 385, 538, 896, 'As opposed to Sthayi Bahava Drishti, Sanchari Bhava Drishti are the glances of the eyes used to express the transitory states. There are twenty glances of the eyes to express the transitory states.', 4, 1, 4),
(912, 385, 495, 896, 'Samam is straight standing with the feet together. Anjitham stretches either leg out. Kunjitham keeps the heal lifted up and toes bent inwards. Soochi keeps one foot flat on the ground, places only the big toes of the other foot on the ground. Agratalsancharam keeps the heel raised up and toes placed firmly on the ground. Uthkattitham lifts one heel up without lifting the foot up. Thatitham places the foot on the ground and the toes part up. Kadithosedham are in succession. Kattibatham bends the foot towards the little tow. Mardhitham slides the foot towards a side and then lifts up. Akrgam performs the sliding action with the foot. Parshnigam keeps the heel on the ground then makes a movement without the toe part of the foot touching the ground. Parchvagam places the feet turned fully towrds the sides, each at 180 degrees.', 5, 1, 4),
(913, 385, 537, 896, 'Kati bedham is the movement of the hips explaind in the natyasastra. These are used primarily in odissi and kuchupudi. There 5 kinds.', 5, 1, 4),
(914, 385, 497, 896, 'Vigneswara has the left hand showing karikara with pataka extended forawrd and upper arm touches the ear. Bhrama is showin with padmakosha hasta in the left hand and right hand drawn across the bofy.The sthanaka is sama. Vishnu is shown with the tripathaka hastha and then karthari hast in the sama sthanka. Padmanabha is shown with the pasmakosha abovve the chest. Sadashiva is standing Saiva sthanaka and sulu hasha inthe right hand with the mrigasira hastha in theleft. Ardhanadeeswarar shows the padmakosha at the left and trisula in the right with saiva sthanaka. Shanmukha holds the karthai hastha in both hands at the region of the ears with the vaishaka sthanka and left hand holding kataka hastha.', 5, 1, 4),
(915, 385, 496, 896, 'Angika abhinaya is the expression of body movement and gesture. There are three parts. Shaka hasthas: samukta, asamyukta, and nrittahastas. Ankura hasta prayoga: hastas pracara, hasta recaka, hasta karana. Finally, nritta or pure dance movements. The anga is divided in six parts: shiras, hasthas, uras, parswa, kati, and pada. Prtayangas have 6 in number: bahu, skandu, prstha, jathara, uru, jangha. Upangas: eys, brhu, tara, nasika, adhara, kapola, cibuku.', 5, 1, 4),
(916, 385, 536, 896, 'Lasyam is the femal attributes of Shiva and depicted by Parvati. The movements are based from love and is used as sukumara prayogam by Bharatha.', 5, 1, 4),
