(927, 385, 564, 897, 'Rakudi=Ornament for head,Triangular playhouse=Chidambaram,Salangai=Feet ornament,Konarak temple=caves Sun god,Ajanta and Ellora=Buddhist paintings,Mridangam=Percussive accompaniment,Chidambaram=Nataraja,Elephanta=Elephanta caves,Utkshiptam=Trimurthi,Yakshagana=Karnataka', 1, 1, 5),
(928, 385, 559, 897, 'Charis is the moving thus simultanelatous feet, chanks, and hip is chari. THere are rules with the connection of limbs to constitute a ssystem. The movement of a single foot is called chari. Two feet moving together is karana. A combination of three karanas is called khanda. Three or four khandas combine to make up the mandala. These charis are used for release of missiles and fighting. Rules of charis are usin dance and ordinar y movements and fights on stage.', 4, 1, 4),
(929, 385, 562, 897, 'THe orchestra includes a nattuvaunar who conducts the dance recital and says the sollukatus. It is the main component to the orchestra. THe mridangam is the percussion instrument and privedes rhythm. The flute is used for melody and is a solo instrument in a concenrt. The veena privdes good quality of sound. THe violin sets the production of technique within the sound and enhances the voice of the singer. The tampura gives key notes or shruthi (pitch).', 5, 1, 4),
(930, 385, 563, 897, 'Stage lights are used for various dance concerts by limps lit by oil in the 20th century and aviailable in Kerala for kathakali. Now, there are flood lights the evenly spread lghtat a particular spot. Pot light is added at appropriate places to add beauty. Foot lights should be avoided. They distract the audience and cannot view the dancers foot. These lights needs to be used effectively in order to set a stting', 4, 1, 4),
(931, 385, 601, 897, 'Charis are used for moving simiulataneaously with feet, chanks and hip creating a system within the limbs of a dancer. The movement with a single foot is called a chari. Two feet moving gether is karana.A combination of three karanas is called khanda. Three or four khandas make upa mandala. There are earthly charis and aerial charis. They are usually used for fighting and releasing missiles.', 5, 1, 4),
(932, 385, 560, 897, 'Sculpture and dance are the twins of the mother art. They embrace one another in the shadow of religion. The various ancient dance postures engraved in sculpture have been taken as the grammar of dance. THere has been cultureal continuity for 2 000 years and reminaed deeply rooted in origins. Sculpture held a place of distinction fromt he time of the Kushan rule of the second centur through the reign of the Guptas and continued to do so until at least the twelfth cntury.', 4, 1, 4),
(933, 385, 561, 897, 'The teple at THanjavu rised above 15 m. Inthe 11th century the great Chola king intended to engrave 108 karanas. by lord shivain the fist floot of the temple\'s gopura vimanam. However only 81 of the 108 were engraved. At Sathara al 108 karanas are depicted in the shrine called Uthara Chidambaram.', 5, 1, 4),
(934, 385, 602, 897, 'Lights in the 20th sentury were originially lit by lamp lights with oil and primaarily found in Kerala for Kathakali. Today, it enhances choreography significantly. Foot lights should be avoided because it is distracting and obstructs views of footwork. Lights should not fall directly on the creen because it does not allow th dancers figure to look bright. Spot lights should be held wel abov and from the sides. If floodlights are tighedned up avoid it straight ove the head but it should be tighed in one angle in front of the centre spot.', 5, 1, 4),
(935, 385, 603, 897, 'Simachalam is the shrine in Andra Pradesh and built on hills about 800 feet above the sea and gateways are observed enroute to the shrine. THe foundation of the temple is attributed to the Hiranyakushubu. Narasimha went to his rescue and stood by the side of the hill and tilted it up so that the boy could escae. One of the pillars in the muka mangapam is called the tribute pillar and attracts crowds.', 5, 1, 4),
