(956, 256, 257, 909, 'Qualities of Danseuse=steady and balanced in performance,Qualities of a Percussionist=nimble with fingers,Qualities of a Dancer=steady and balanced in performance,Qualities of a Nattuvanar=Able to utter accurately each rhythmic sequence,Qualities of a Guru=Humble without the arrogance of knowledge,Qualities of a Singer=learned in the marga and desi styles of music,Villadavu=the body arches like a bow,Mandiadavu=Dancer sits all the way down with knees bent,Marthitha Adavu=Hands and Body make a full swing front and sideways,Kuththa Adavu=Dancer jumps low with toes firmly rooted on the floor', 10, 1, 5),
(957, 256, 262, 909, 'Abinaya Darpana was written by Nandikeshwara between the 3rd and 4th century AD. The book consists of topics that significantly deals with dance, such as hand movements (hasthas), centering, concepts, posture. Several, if not, all forms of dance in South India refer to the text often. ', 4, 1, 4),
(958, 256, 261, 909, 'Pintherkurvai is type of koothu. It was the dance that was performed in behind the chariot of kings who return from fighting war and won victoriously. ', 5, 1, 4),
(959, 256, 263, 909, 'South Indian classical dance refers constantly to the Abinaya Darpana who models the various types of arts to be unified in a unique and respective manner to temples, to the public and to higher deities. There are several forms of south indian dances such as Bharatanatyam, Kathakali and Kuchipudi. ', 5, 1, 4),
(960, 256, 260, 909, 'muntherkuravai is the same as pintherkuravi but instead of being performed behind, it is performed in front of the king\'s chariot after he returns from a victorious fight at war. ', 4, 1, 4),
