(981, 256, 394, 910, 'Shakatam --=The Cart,Chaturam=The square,Vayu=Araalam in right hand and Ardhapathakam in left with left fingers facing the earth,Varuna=Pathakam in right hand and shikaram in left held near the chest sama padam,Murugan=Right hand in Trishoolam and left in shikaram held near the chest. Mandalam position with leg bent inwards,Agni=Tripathakam in right hand and kangulum in left held near the chest,Soorya=Kapitham in right hand and left in alapadmam. Feet in samam position,Chandra=Ardhachandram in right hand and alapadmam in left held near the chest.,Vishnu=Both hands in tripathakam near the shoulders with palms facing outwards,Mahalakshmi=Both hands in kapitham near shoulders , body in asana  position', 10, 1, 5),
(982, 256, 395, 910, 'Nritha is a component of Bharatanatyam and several other forms of dance which is recognized as pure dance. The fundamentals of this component are tala and laya which are rhythm and speed. This component includes the movements of hands (hasthas) and feet fork (charis). ', 4, 1, 4),
(983, 256, 398, 910, 'Samyutha hasthas are the double handed positions in Bharatantyam. Some include anjali, kapothum and shakatham. ', 5, 1, 4),
(984, 256, 399, 910, 'Asamyutha Hastas are the single-handed position in Bharatanatyam. A few examples of asamyutha hastas are pathakam, thripathakam, and mushti. ', 4, 1, 4),
(985, 256, 400, 910, 'Matsyam: Matsyam\r\nKoormam: Koormam\r\nVaraham: Varaham\r\nNarashimham: Simhamukham in right and simham in left\r\nVamanam: Mushti and mrigaseerrisham\r\nParasurama: tripathakam and skikaram\r\nRama:katakamukham and shikaram\r\nBalarama: mushti\r\nKrishna: mrigaseerisham\r\nKalki: kapittham and mrigasserisham.', 5, 1, 4),
(986, 256, 397, 910, 'Natya is the mixture of both Nrithya and Nritha with a theme to package the whole dance piece. The themes that are represented in Bharatanatyam mostly has to do with the Hindu gods by praising them and showing devotion. ', 4, 1, 4),
(987, 256, 396, 910, 'Nrithya is the expressional aspect to dance. It can also be called Abinaya which means the same thing but expressions are used to use to educate. Nrithya is the way to convey message, understanding of a theme and engage rasa within the audience and in the dancer as well. Through several means such as costume, voice of the singer, gestures and body movements, abinaya or nrithya is able to be projected in a piece. ', 5, 1, 4),
