(1471, 386, 492, 945, 'Uras=Chest,Svastika=Arm is crossed in the chest region,Uru=Thighs,Prasarita=Arm movement stretched,Padmanabha=Lord Vishnu,Vaishaka=Sthana for men,Padmakosha=Asamyutha hastha,Bramari=Seven types,Ayata=Sthana for women,Paadachari=Eight types', 10, 1, 5),
(1472, 386, 497, 945, '1. Vigneshwara, Lord of Obstacles:\r\nThe left hand shows the elephant\'s trunk. It is Karikara. That hand is extended forward with pataka hanging in a dhola motion. The upper arm is near the heart, and then it is placed below the chest holding the Katakam hastha. \r\n\r\n2. Vishnu, Lord of Preservation:\r\nThe hands are in Tripitaka at the chest and Karthari at the shoulders standing in samapada sthanaka.\r\n\r\n3. Padmanabha:\r\nPadmanabha is shown with the Padmokosha hastha above the chest. He is shown reclining with the Sarpasirsha Hastha in the right hand.\r\n\r\n4. Sadashiva:\r\nHe stands in Saiva sthanaka holding Trishula Hastha in the right hand and mrigasirsha in the left.\r\n\r\n5. Shanmukha:\r\nThis is indicated with the Karthari hasta in both hands near the ears, or standing in Vaishaka Sthanaka, holding the Shikara and Trishula Hasthas in the right and left hands respectively.', 5, 1, 4),
(1473, 386, 537, 945, 'Kati Bedhas are the movement of the hips. Natyashastra depicts 5 types of hip movements. They are frequently used in Oddisi and Kuchipudi, but are also used in Bharathanatyam. It is also used in the Karanas as depicted by Dr. Padma Subhramaniam. \r\n\r\nNatyashastra says:\r\n\"chinnaa chaive nivrutacha recita kampita tatha|\r\nudhvahita chetikati natye ntrittecha pancatha||\"\r\n\r\nThe first movement is Chinna. The right hip is pushed out and turned aside. It is used to depict exercise, confusion, looking around, etc.\r\n\r\nThe second movement is Nirvrta. The left hip is pushed out and turned aside. It is used to depict turning away.\r\n\r\nThe third movement is Recita. The hip is moved in all directions in a circular motion. This shows general wandering.\r\n\r\nThe fourth movement is Udvahita. The hip is raised slowly, the weight shifting from each leg. It shows the walk of a stout person or an amorous woman.\r\n\r\nThe last movement is Kampita. The hips are raised on both sides in quick succession. It depicts the movement of hunchbacks.\r\n\r\nThese are the five Kati Bedhas.', 5, 1, 4),
(1474, 386, 493, 945, 'Sthanas are postures. They can be classified by gender (male and female). In Natyashastra, there are seven Sthanas depicted for women. These are as follows:\r\n\r\nAyatham chavahithamcha ashwakrantha mathapicha\r\n\r\nIn Ayatha, the right foot is in sama and the left is in trayasha. The right hip is cocked.\r\n\r\nAvahittham is the opposite of Ayatham.\r\n\r\nAsvakratham is when one foot it raised and the other is resting on its forepart, ready for succhi.\r\n\r\nGatagatam is when the dancer is about to move but hesitates with one foot raised.\r\n\r\nIn Valitham, the body is twisted around with the foot in the direction the body is twisted. One foot touches the ground with its big toe, and the other with its small toe.\r\n\r\nIn Motitham, one foot is in Sama, where as the other in kunchitha with the toes half touching the ground. The two hands move up in karkata.\r\n\r\nVinivritham is Motitham but at the back with the positions of the feet reversed.\r\n', 5, 1, 4);
