(1475, 386, 538, 945, 'Sanchari Bhava Drishti is the classification of eye movements used to express transitory states. There are twenty glances of the eyes to express these transitory states. \r\n\r\nNatyashastra names these as follows:\r\n\r\nsoonyacha malinaachaiva sraantaa lajjaanvita tathaa |\r\nglaanacha sankitaachaiva visannaa mukula tathaa ||\r\nkunchita chaabhitaptaacha jihmaa salalitha tathaa |\r\nvitarkita ardhamukula vibranta vipluta tatha ||\r\nakekara viskosacha trstath madira tatha |\r\nshattrisha drushyo hota namathobhita mayaa ||\r\n\r\nThey are defined as:\r\n\r\nShunya (Vacant), Malina (Impure), Shranta (Drooping), Lajjanvita (Bashful), Glana or Mlana (Languid), Shankita (Doubtful), Vishanna (Depressed), Mukula (Bud-like), Kunchita (Curved), Abhitapta (Scorched with pain), Jimha (Athwart), Lalita (Graceful), Vitarkita (Pondering), Ardhamukula (Half-opened bud), Vibhranta (Distracted), Vipluta (Scattered), Akekara (Squinting), Vikosha (Wide open), Trasta (Timid), and Madira (Intoxicated). \r\n\r\nEach of these eye movements show a unique, temporary emotion.', 4, 1, 4),
(1476, 386, 536, 945, 'Laasyam is the elegant and graceful dance associated with femininity. As Shiva instructs Sage Tandu for the Tandavam, Goddess Parvati asks Usa, daughter of Banasura, to produce Laasyam. Laasyam is the gentler counterpart to Thandavam.\r\n\r\nThere are no distinguished differences in the Adavus between Thandavam and Laasyam. There is simply a different method to performing these Adavus. The same movement can be depicted with Thandavam or Laasyam- it depends on the association of the step and/or the character, whether it is portrayed in a feminine manner or a masculine one. When needed, a woman can dance the Thandavam and a man can dance Laasyam.\r\n\r\nIf analyzed according to the Natya Shastras, the word Thandavam means Nritham, and the word Laasyam means a few songs based on the theme of love. The Thandavam we know is the Uthama Prayogam, as said by Bharatha. For Laasyam, Bharatha uses the word Sukumara Prayogam. Therefore, the dance movements are the same for male and female, but they way they are presented makes us call them Uthama or Sukumara.', 4, 1, 4),
(1477, 386, 496, 945, 'Angika Abhinaya is the first of the four types of Abhinaya in Bharathanatyam. It is the art of expression through body movement and gesture and is used throughout all aspects of Bharathanatyam. Bharata has identified Angika Abhinaya as artistic expression through the dancers usage of body movements. The body is seen as the medium of expression. Angika Abhinaya can be classified based on expressions (Abhinaya) and body parts (Angas).\r\n\r\nAngika Abhinaya is split into three categories of expression: Mukaja, Sarira, and Cethaskritha. Mukaja Abhinaya manifests as expression through the face (with emphasis on the eyes). Sarira Abhinaya deals with expression using various limbs of the body. Cethaskritha Abhinaya is the movement of the entire body. Cethaskritha Abhinaya is further classified into two: gatipracara (expressive body movement) and nritta (pure dance movement). Gatipracara is also divided into two: Stithi (static posture) and Gati (movement leading to or away from a posture)\r\n\r\nIn Angika Abhinaya, the body is divided into three major parts: Anga, Pratyanga and Upanga.* The six Angas are Siras (head), Hasta (hand), Uras (chest), Parsva (sides), Kati (hips), and Pada (feet). Some people consider Greeva (neck) as Anga, too. There are six Pratyangas: Skandha (shoulders), Bahu (arms), Prstha (back), Jathara (stomatch), Uru (thighs), and Jangha (shanks). Some consider Manibandha (wrist), Kurpara (elbows) and Janu (knees) also as Pratyanga. There are seven Upangas or minor parts of the face which are important for facial expression. These are Netra (eyes), Bhru (eye-brows), Tara (pupil), Kapola (cheek), Nasika (nose), Adhara (lipa), and Cibuka (chin).\r\n\r\nAngika Abhinaya involves expressing the meaning of the song or lyrics using 	different body parts and is classified into two categories: expressions and body movement. Angikabhinaya uses the total body to express certain meaning. Hasta Abhinaya also is an important aspect of Angika. In Natyashastra, Angika is a detailed study of all the possible gestures, postures and movements of each and every part of the body. \r\n\r\n*The following Slokams talk about the various categories of Angas, Pratyangas, and Upangas.\r\n\r\nHere are the three main elements of Angika:\r\nTatr?ngiko_anga Pratyangop?ngai? Tredha Prakaita? || \r\n\r\nHere are the categories of Angas:\r\nAng?nyatra iro hastou v?ksha? p?rswou katitatou |\r\n?P?d?viti shadukt?ni griva mapyare jagu? ||?\r\n\r\nThese are the categories of Pratyangas:\r\nPratyang?nyatha ca skandh? b?hu p?sh?ham tathodaram | \r\n?ru_ jangh? sha?ity?hu rapar? ma?ibandhakou ||\r\n?j?nuni k?rpara v?tat traya mapyadhikam jagu? |?\r\n\r\nThe categories of Upangas:\r\nD?sh?i bhr? pu?a t?r?ca kap?lou n?sika hanu || \r\nAdhar? daana jihw? cubukam vadanam tath? |\r\nUp?ngani dwadaaiva irasyangantar?shu ca || \r\nP?rsh?i_gulphou tath?ngulya? karay?? p?day?? tal? | \r\n?tani Purwa?stranus?r?n?kt?ni vai may? ||', 5, 1, 4),
(1478, 386, 495, 945, 'The Pada Bedhas describe expressive ways of walking that a dancer adopts at different times. There are thirteen seperate pada bedhas, classified into Margi and Desi. There are six bedhas in the Margi category, and seven in the Desi. Margi Pada Bedhas are found in the Natyashasra, and the Desi Pada Bhedas are from the Sangeetha Ratnakara. Sangeetha Ratnakara has divided the 13 padabedhas into Margi and Desi. However, only the 6 Margi Padha Bedhas were incribed in the Natyashastra.\r\n\r\nM?rgi P?da Bh?da\r\nSamo Ancith?? Kuncitasca S?ci Agrathala Sancara? \r\nUthka?ithascaitimuni ?utvid?a carane mada? \r\n\r\nDesi P?da Bh?da \r\nD??ith? Ka?ith?scait? Ka?ith? Mardhith? tath? \r\nAgrakaha P?shnika p?da P?rshvakasca Par?? Puraihi \r\nIthi Sapt?h Par? Prokth?? P?dhasca laksha?am bruv?\r\n\r\n\r\nSamam: Stand straight with feet together\r\nAnchita: Stretch one leg with the heel on the ground and the toes pointing skywards\r\nKunchita: The heel is lifted with the toes on the ground, bend inwards\r\nSuci: One big toe touches the ground- all the other parts of the foot are lifted.\r\nAgrathalasancaraha: The toes are placed firmly on the ground with the heels lifted.\r\nUthkatitham: The toes are on the ground while the heel is lifted and strikes the ground repeatedly.\r\n\r\nThattitam: The heels are on the ground while the toes are lifted and strike the ground repeatedly.\r\nKattithothsedham: Agrathalasancharam and utkattitham in succsession.\r\nKattitham: Balance on the outside of the feet.\r\nMardhitham: Slide the foot to the side\r\nAgrakaham: Slide your toes and then your heels.\r\nParshnigam: Balance on your heels and walk backwards, quickly\r\nParsvagam: Keep feet in 180 degrees- do not bend knees.\r\n', 5, 1, 4),
(1479, 386, 494, 945, 'Kati Bedhas are the hip movements. They are generally used in Kuchipudi and Oddisi. These hip movements add beauty to Karanas and Angaharas, also. There are five respective Kati Bedhas in the Natyashastra.\r\n\r\nThe slokam says:\r\n\"chinna chaiva nvrrtacha recita kampitha thatha|\r\nudvahitta cheti kati natye nruttecha panchatha ||\"\r\n\r\nThey are defined as follows:\r\n\r\n1. Chinna: The right hip is cocked front and turned outwards. This can be used to show confusion, looking back, or turning around.\r\n\r\n2. Nvvrta: The left hip is cocked and turned. This shows turning around.\r\n\r\n3. Recita: The hips is swung around in a circular motion (similar to \"hula hooping\"). This can depict a wanderer or a nomad.\r\n\r\n4. Udvahita: The hip is raised slowly, depicting a stout person or an amorous person.\r\n\r\n5. Kampita: The hips are cocked up, one by one in quick succsesion. This depicts a person of lower class.\r\n\r\nThese are the five Kati Bedhas.', 5, 1, 4),
