(1500, 434, 257, 948, 'Qualities of Danseuse=Qualities of Danseuse,Qualities of a Percussionist=nimble with fingers,Qualities of a Dancer=steady and balanced in performance,Qualities of a Nattuvanar=Able to utter accurately each rhythmic sequence,Qualities of a Guru=Humble without the arrogance of knowledge,Qualities of a Singer=learned in the marga and desi styles of music,Villadavu=the body arches like a bow,Mandiadavu=Dancer sits all the way down with knees bent,Marthitha Adavu=Hands and Body make a full swing front and sideways,Kuththa Adavu=Dancer jumps low with toes firmly rooted on the floor', 10, 1, 5),
(1501, 434, 263, 948, 'Bhartha natyam is often referred to as Bharatham, which means India. This term also refers to Bhavam, Ragam, and Thalam. The word Bharatham is composed of the first letters of Bhava, Raga, and Thala and the letters \"am\" are common to all. Bharatnatyam\'s origin can be credited to the Natyasastra written by Sage Bharata. This was representative of the history as in ancient India, music, dance, and drama were integral parts of the culture. The components of the art as well as the name itself are Bhava (expression), Raga (tune), and Tala (rhythm). The art of Bharatanatyam is complementary with the Hindu religion. A lot of the performances depict stories of the Hindu gods, with one of the primary gods being Shiva and his partner Parvati. Three fundamental aspects of Bharatanatyam are Natya, Nrtya, and Nrtta. Nrtaa is the aesthetic structure with clear graceful dance movements, foot work, and hasthas (hand gestures). Nrtya brings in the imaginary, interpretive aspect. It uses Abhinaya, the art of communication, through primarily Angika (facial expressions), Vacika, Aharya, and Satvika. The purpose of the dance is to evoke feelings and create rasa for the audience. A performance should distance the audience from reality and create an experience of emotional bliss.\r\n', 4, 1, 4),
(1502, 434, 262, 948, 'Abhinaya Darpana is one part of the Natyasastram. It was written by Nandikesvara between 3rd and 4th century BCE. As it is thought that Nandikesvara was from Andhrapradesh, the text/script is written in Telugu. There are 324 slokas, which discuss gestures of head, eyes, neck, hand gestures representing Gods, Dasaavataras, castes, relations, and the mandalas, utplavanas, bhramaris, charis, and gatis used in dance. Abhinaya Darpana is named for its description and explanation of expressions. South Indian dance forms including Bharatnatyam follow this text. ', 5, 1, 4),
(1503, 434, 258, 948, 'After a danseuse completed her Arangetram in the King\'s Court kutthu, she would receive gold and gems as a reward, titled Thalaikol. This was of a 7 hand span length, made of bamboo and decorated with gems with golden knots in between. At the beginning of Indira Vizha, there was a Puja done to this. The stick was then given to the royal elephant and was taken along with the king and his ministers. Then it was given to the dance teacher who would be waiting on a chariot. After receiving it, the teacher would keep it at the performance stage, Aragam. The female dancer who would receive this after her arangetram would be named Thalakoli. The Nattuvanar was called Thalaikol Asan. The singer was called Thoriya Madanthai.', 4, 1, 4),
(1504, 434, 259, 948, 'This term originated from the Sangam period, which was a period of brilliance for Tamil Literature, Art, and Science. Dance and song were also prevalent in the culture during this Sangam age. One of its most profound texts is the Silappadigaram, which contained information about the arts of music, dancing, building, and other activities performed by the ancient Tamils. It also explained the fame of Kutthu (drama) Tamil. After arangetrams which took place in the king\'s court Kutthi, the danseuse would receive the title Thalaikol. The singer for her arangetram who sang all the songs for her dances was called Thoriya Madanthai. ', 4, 1, 4),
(1505, 434, 261, 948, 'Dance in Tamil is kuttu, which refers to the arts in harmony with music. During the festivities and events in the ancient times, artists known as Kutthargal entertained the public with songs and dance. Paratavar and Kuravar were nomadic people who did so for entertainment. Because dancing and singing were a significant part of the culture, there were various kuravais and kuttus to describe different scenes that were performed. The folk dance kutthu performed in the streets during festivals was Tunangai. Pintherkuruvai specifically names the dance which was danced behind the chariot of kings who had won in battle. ', 4, 1, 4),
(1506, 434, 260, 948, 'Kutthus were the generic name for dances done by the ancient Tamils and collectively grouped the concepts of dance and drama. In the Silipaddigaram, an epic written by Illango Adikal, there were references to ancient culture, literature, and the life of the people; dance, drama, and song played a huge role in all these aspects and the lives and ways of the people. There were many different kutthus and kuruvais for different events and purposes in the Sangam days because music, dance, and song were popular culture. Muntherkuravai refers to the specific action of people on the streets dancing in front of the chariots of kings who had won in battle.', 4, 1, 4),
