(1527, 434, 394, 949, 'Shakatam --=The Cart,Chaturam=The square,Vayu=Araalam in right hand and Ardhapathakam in left with left fingers facing the earth,Varuna=Pathakam in right hand and shikaram in left held near the chest sama padam,Murugan=Right hand in Trishoolam and left in shikaram held near the chest. Mandalam position with leg bent inwards,Agni=Tripathakam in right hand and kangulum in left held near the chest,Soorya=Kapitham in right hand and left in alapadmam. Feet in samam position,Chandra=Ardhachandram in right hand and alapadmam in left held near the chest.,Vishnu=Both hands in tripathakam near the shoulders with palms facing outwards,Mahalakshmi=Both hands in kapitham near shoulders , body in asana  position', 10, 1, 5),
(1528, 434, 399, 949, 'Asamyutha hasthas are mentioned in the Natyasastra and the Nrtta hastham. In Sanskrit, muthras are often referred to as hasthas. In Bharatanatyam, these are hand gestures; they are important for communicating and conveying concepts, ideas, feelings, and information. There are nearly 30 single hand muthras or hasthas and 23 joing hand muthras in Bharatanatyam. In Sanskrit, the word Asamyuktam meaning non-union can trace its origins to the Tamil usage of the word. Combining these two terms, Asamyutha hasta means single hand gestures. The slokam starts with pathakam and ends with trishulam. ', 4, 1, 4),
(1529, 434, 400, 949, 'Lord Vishnu adopted 10 different Avataras in order to protect the people and restore Dharma. The 10 life forms mimic the progression of evolution and organisms on Earth, starting as a fish and ending as a human being. These 10 distinct Avataras of the Lord can be represented using the different positions of the body, feet, and hands. \r\nThe following is a description of the list of the Avataras in chronological order:\r\nMatsyam - the Fish - body in Samam turned sideways, left foot stretched back facing sky, hands in Matsya level with shoulders\r\nKurmam - the Turtle - seated in Asana, body bent forward, hands close to face in Kurmam\r\nVaraham - the Swine - body in Samam, right foot bent inwards, hands in Varaha close to face\r\nNarasimham - the Man-Lion - body in Mandala, right foot bent inside, left hand Simhamuka, right hand Tripatako\r\nVamana - the Divine Midget - seated in Mandala, both hands Mushti, left hand facing ground, right hand in front of shoulder\r\nParasurama - left hand hanging down in Dola, right hand Ardhapataka\r\nRama - right hand Kapitha, left hand Sikharam, mimic arrow, right foot perpendicular to left\r\nBalarama - seated in Mandalam, right foot bent in, right hand Pataka above left hand Musthi on right side of body level with chest \r\nKrishna - feet in Svastika, left foot cross in front of right on toes, both hands in Mrgasirsam on right side close to face, mimic flute\r\nKalki - standing in Samam, right leg bent, mimic riding horse, right hand Pataka above head, left hand Tripatako extended out', 5, 1, 4),
(1530, 434, 397, 949, 'The concepts of Bharatanatyam are Nritta, Nrtya, and Natya. Nrtta is the aesthetic structure and graceful movement of the body in tune with the tala and laya. This is about pattern and steps, not emotion or feeling. Nrtya is the component which uses Abhinaya to express emotions and feelings in an imaginative, interpretive sense to connect with the audience. Abhinaya communication and expression encompasses Angika, Vacika, Aharya, and Satvika. \r\nNatya is a combination of both of these aspects with the additional element of dramatization. The word Natya is derived from nat, meaning moving or acting. Natya is dramatic representation or drama through speech, music, and dancing. It is used to tell mythological stories or sing praises of Hindu Gods or kings with a theatrical rendition. They can use all the Abhinayas to represent different characters and ideas in the story.', 5, 1, 4),
(1531, 434, 396, 949, 'Nrithya uses Abhinaya to create emotion, feeling, and character in the Natya or performance along with adavus. Abhinaya, known as the art of communication and expression, is classified into four types. Angika Abhinaya is physical expression through movement of limbs and gestures. Vacika Abhinaya is verbal expression through voice and meaningful words. Aharya Abhinaya is external expression through attire and jewelry. Satvika Abhinaya is internal expression. In today\'s context it usually refers to facial expressions. Nrithya is the manifestation of dancing which includes rasa (aesthetic flavor) and bhava (emotion) in the dance with abhinaya (art of expression) combined with the Nrtta.', 4, 1, 4),
(1532, 434, 398, 949, 'The hands can flexibly form various shapes to effectively communicate ideas, indicate a point, narrate, or enhance the beauty of the composition. Samyutha hasthas are hand gestures that use both hands together to convey this purposes. In fact, in Sanskrit, Samyutha means union. There are 24 two-handed hasthas. The slokam starts with Anjali, which is two Patakas touching palm to palm to signify salutations, and ends with Avahitham, which is two Alapadmas crossing each other. \r\nThe slokam\'s start and end for the Samyutha Hasthas is:\r\nanjalisca kapotasca karkatah svastikastatha\r\n....\r\ntrayovimsatirityuktah purvagairbharatadibhih', 5, 1, 4),
(1533, 434, 395, 949, 'Nritha is a form of pure movement in dance, which while reflecting the mood of the musical composition, does not utilize mood or sentiment (rasa or bhava). Nritha is pure dance that results in aesthetic delight through structured, graceful movements in time with laya and thala. Nritha consists of foot movements, chari, hand movements, hasthas, arm positions, body movements, and body positions/posture. There is organization and pattern in the steps and movements, but there is no bhava or emotional aspect to Nritha. For example, Alarippu and Jathiswaram are purely Nritha, there are no emotions depicted by the dancer. ', 4, 1, 4),
