(1643, 711, 257, 963, 'Qualities of Danseuse=Qualities of Danseuse,Qualities of a Percussionist=nimble with fingers,Qualities of a Dancer=steady and balanced in performance,Qualities of a Nattuvanar=Able to utter accurately each rhythmic sequence,Qualities of a Guru=Humble without the arrogance of knowledge,Qualities of a Singer=learned in the marga and desi styles of music,Villadavu=the body arches like a bow,Mandiadavu=Dancer sits all the way down with knees bent,Marthitha Adavu=Hands and Body make a full swing front and sideways,Kuththa Adavu=Dancer jumps low with toes firmly rooted on the floor', 10, 1, 5),
(1644, 711, 258, 963, 'The nattuanar is known as thalaikol ashan.thalaikol was of 7 hand span length,made of bamboo and stunned with jems with golden knots between.At the beginning of Indra vizha-- pooja was done to this and then the stick was given to royal elephant and then taken for a procession along with the king who rode along with other ministers.it was given to the dance teacher who was standing on the chariot .The nattuvanar who received this is called as Thalaikol ashan.This reward will be done after the arangetram in kings court.', 5, 1, 4),
(1645, 711, 259, 963, 'One who sang songs for dance is called Thoriya madanthai.she will be learned most desi and marga songs.She will be expert in dance ,music and song.She will be rewareded by the king along with thalaikol.she will be expert in various types of tala and laya.knowledge in swaras and various types of ragas .She will be highly principled.', 5, 1, 4),
(1646, 711, 262, 963, 'Nandikesvara abhinaya darpana is written in 3rd - 4th century AD .Abhinaya darpana script is in Telugu. This book consists of 324 slokas in a single chapter.Unlike the Natyasastra, abhinaya darpana predominantly deals with the hand gestures,neck movements,eye movemets,head movements,hand gestures representing - Gods,dasavataras,casts ,relations,etc. and the mandalas,utplavanas,bhramaris,caris, and gatis employed in dance.All south indian dance forms like kuchipudi and Bharatanatyam follows this text. ', 5, 1, 4),
(1647, 711, 263, 963, 'South indian classical dances are strongly connected with religion and temple.Temples were not only the place for vership it was the place for performances , social networking etc.All dance to belied as beginged with devadasis who were dancing in temples and for the gods.there are 4 classical dances in south india - Bharatanatyam,mohiniyattam,kuchipudi and kadhakali.Where Bharatanatyam is considered as the oldest and originated in tamil nadu the city of temples. Mohiniyattam and kadhakali originated in kerala they refer the text hasta lakshana deepika more compared to natyasastra.Kuchipudi originated in andrha Pradesh follows natyasastra like Bharatanatyam.', 5, 1, 4),
(1648, 711, 261, 963, 'The dance which is done  behind the chariot of the kings who one after the battle pintherkuravai. infornt dance is known as muntherkuravai.this is folk style dancing .', 2, 1, 4),
(1649, 711, 260, 963, 'the dance which was danced infront of the chariot of the kings who had won the battle were called as muntherkuravai.this is a folk style of dance take place as part of rituals kuruvalach-chadangukal during the time of the war.This drama form has mention in silapadikaram written in sangam ages.', 3, 1, 4),
