(1670, 711, 394, 964, 'Shakatam --=The Cart,Chaturam=The square,Vayu=Araalam in right hand and Ardhapathakam in left with left fingers facing the earth,Varuna=Pathakam in right hand and shikaram in left held near the chest sama padam,Murugan=Right hand in Trishoolam and left in shikaram held near the chest. Mandalam position with leg bent inwards,Agni=Tripathakam in right hand and kangulum in left held near the chest,Soorya=Kapitham in right hand and left in alapadmam. Feet in samam position,Chandra=Ardhachandram in right hand and alapadmam in left held near the chest.,Vishnu=Both hands in tripathakam near the shoulders with palms facing outwards,Mahalakshmi=Both hands in kapitham near shoulders , body in asana  position', 10, 1, 5),
(1671, 711, 397, 964, 'Natya is the main technique of abhinaya ,is combination of Nrtya and nrtta with a dramatic element to it.natya is the visual painting that dancer draws to get the story across the audience.natya involves a story of a mythological episode ,characters ,aharya/props and bringing a theatrical experience through the rendition. eg: performing stories of ramayana ', 5, 1, 4),
(1672, 711, 398, 964, 'Samyutha hastas are double hand gestures. these gestures require use of both palms to convey the message or a particular meaning. eg: anjali mudra is simple gesture where both pataka gestures joined to show another meaning namaskara.there are 24 samyutha hastas .Anjali,kapota,karkata ,swastika,dola,pushpaputa,utsanga,sivalinga,kataka varthana,kartariswastika,sakata,sangha,cakra,samputa,pasha,keelaka,matsya,koorma,varaha,garuda,nagabandhana,gatva,bherunda,avahitta', 5, 1, 4),
(1673, 711, 399, 964, 'single hand gestures.natyasastra mentions about 28 asamyutha hastas.4 more added to the list these hand gestures are part of angika abhinaya.these hands use to capture wide range of emotions,actions,ideas etc to communicate. mudras are from pataka to trisula', 5, 1, 4),
(1674, 711, 395, 964, 'pure dance ,which doesn\'t have any meaning or message but it just creates sheer aestetic delight in the rasikas.its basic constituents are tala and laya - time measure and rhythm.in nritha the emphasis on the clarity of the dance movements with nritha hastas and hand movements.basically nritha are the pure adavus.', 4, 1, 4),
(1675, 711, 396, 964, 'is an integral component,using interpretive aspect of Bharatanatyam ,conjuring up an attractive world of imagination  it involves the abhinaya - devided into 4 - angika,vachika,aharya,satvika . interpretations are done using all types of abinayam is part of nrithya.most importently the hand gestures.', 5, 1, 4),
