(1687, 288, 492, 972, 'Uras=Chest,Svastika=Arm is crossed in the chest region,Uru=Thighs,Prasarita=Arm movement stretched,Padmanabha=Lord Vishnu,Vaishaka=Sthana for men,Padmakosha=Asamyutha hastha,Bramari=Seven types,Ayata=Sthana for women,Paadachari=Eight types', 10, 1, 5),
(1688, 288, 493, 972, 'There are seven sthanas pertaining to women. They are:\r\nAyata :the right foot is in sama and the left foot is in Tryasra. Right waist is raised.\r\nAvahitam : the left foot is in sama and the right foot is in tryasra. The left waist is raised.\r\nAshvakrantam : One foot is raised and the other is resting on it\'s forepart ready for Aviddha chari.\r\nGatagatam : the dancer, about to move forward, hesitates with one foot raised.\r\nValitam : body slightly twisted around. The foot in the direction that the body is twisted touches the ground with the little toe. The other foot touches the ground with the big toe.\r\nMotitam : one foot is in sama, and the other is in kunchita. Toes are half touching the ground. The two hands move up in karkata.\r\nVinivrtam : motita sthana with feet reversed and the positions to the back.', 4, 1, 4),
(1689, 288, 538, 972, 'The sanchari brava drishti are the 20 glances of the eyes that are used to express temporary emotions. They are :\r\nShunya (vacant) - the pupils, eyelids, and eyebrows are steady with a vacant stare.\r\nShranta (drooping) - the eyelids and the eyes are lowered in exertion.\r\nShankita (doubtful) - eyes move then rest. The pupils are raised then lowered, and concealed.\r\nMalina (impure) - the eyelids are partly closed with the ends of the eyelashes pale.\r\nMukula (bud-like) - eyelashes trembling and bright, the eyelids are happily lowered.\r\nMadira (intoxicated)\r\n          - (youthfulness) - eye rolling, ends contracted in fatigue\r\n          - (medium) - eyelids curved, pupils moving, brows quiver\r\n          - (excessive) - lids blinking, downward glance, pupils partly visible\r\nLalita (graceful) - sweet glance, eyes contracted, brows moving (love)\r\nLajjanvita (bashfulness) - eyelashes bent, gaze cast down, eyelids partly closed\r\nVishanna (depressed) - eyes still, pupils drawn apart\r\nVipluta (scattered) - eyelids trembling and still by turns, pupils move quickly.\r\nVibhranta (distracted) - pupils and lids move, eyes opened wide\r\nVitarkita (pondering) - eyes wide open with pupils cast downwards\r\nVikosha (wide open) - eyes wide open, pupils move.\r\nAbhitapta (scorched with pain) - pupils and lids move quickly in distress\r\nArdhamukula ( Half-opened bud) - pupils visible, eyelids half-opened, smiling glance\r\nAkekara (squinting) - pupils have semi-circular motion, lids half shut.\r\nGlana (tired) - pupils slowly move, eyelashes raised in fatigue.\r\nKunchita (deathy) - ends of lashes curved, pupils sunken\r\nJimha (athwart) - lids lowered, pupils have oblique movement\r\nTrasta (timid) - pupils quivering, eyes opened wide in fear\r\n', 4, 1, 4),
(1690, 288, 497, 972, 'Deities and their postures :\r\n\r\nVigneshwara  - left hand extended forward from the ear with pathaka. Shows trunk. Right hand in Katakamukha hasta.\r\n\r\nBramha - left hand in padmakosha. Right hand at shoulder height in Vedhabyasa pada hasta. Standing in sama.\r\n\r\nVishnu - Hands change from tripathaka to kartari at shoulder level. Standing in sama.\r\n\r\nPadhmanabha - padmakosha hasta held above the chest region.\r\n\r\nSiva - Standing in Shaiva sthanaka. Trisula in right hand and mrigasirsa in left hand.\r\n\r\nArdhanareeshwarar - Standing in shaiva sthanaka with padmakosha in left hand and trisula on the right.\r\n\r\nShanmukha - Standing in vaishaka sthanaka, with Pathaka hasta on the left hand.\r\n\r\n', 4, 1, 4),
(1691, 288, 496, 972, 'Angika Abhinaya is expression through the body gestures and expression. It can be divided into three main parts. Namely, Angas (major body limbs), Pratyangas (minor body limbs), and Upangas (ancillary body limbs). Accoring to the Natyashastra there are 6 Angas, 6 Pratyangas, and 7 Upangas. They are :\r\n\r\nAngas:\r\n1. Shiras (head)\r\n2. Uras (chest)\r\n3. Hasta (hands)\r\n4. Kati(hips)\r\n5. Paarswa (sides)\r\n6. Paadha (feet)\r\n\r\nPratyangas :\r\n1. Jathara (belly)\r\n2. Bahu (arms)\r\n3. Prsta (back)\r\n4. Skandha (shoulder)\r\n5. Jangha (shank)\r\n6. Uru (thighs)\r\n\r\nUpangas :\r\n1. Drishti/ Netra (eyes)\r\n2. Nasa (nose)\r\n3. Gandha/ Kapola (cheek)\r\n4. Chibuka (chin)\r\n5. Tara (pupils)\r\n6. Adhara (lower lip)\r\n7. Bhru (eyebrows)\r\n', 4, 1, 4),
(1692, 288, 536, 972, 'Lasyam, also known as Sukumara Prayoga, is the dance of women. According to legend, Goddess Parvati instructed princess Usa, daughter of king Banasura, to create a gentler form of thandavam (Uthama Prayoga). This form became known as lasyam, and uses the same movements as thandavam, but performed in a different manner. It requires elegance and purity of the soul, and mostly depicts love.', 5, 1, 4),
(1693, 288, 494, 972, 'Kati Bedha(hip movement). There are 5 movements of the hip. They are :\r\n\r\n1. Chinna - middle of the hip is turned aside. It is used in depicting exercise and confusion.\r\n2. Nivrtta - hip is turned to the front from another position, Depicts turning forward.\r\n3. Recita - hip moves in all directions. Depicts wandering.\r\n4. Udhvahita - hip is slowly raised. Depicts the walk of a stout person or a woman.\r\n5. Kampita - hips have oblique movement up and down Depicts movement of hunchbacks.\r\n\r\nAlthough found in the Natyashastra, the Kati bedhas have been abandoned by most modern schools of Bharathanatyam.', 4, 1, 4),
(1694, 288, 495, 972, 'Padha Bedhas are movements of the feet. There are 4 broad classifications. They are :\r\n1. Mandala (standing positions that are further divided into 10 categories)\r\n2. Utplavana (jumping movements that are further divided into 5 categories)\r\n3. Bhramari (turning movements that are further divided into 7 categories)\r\n4. Paadhachari(walking movements that are further divided into 8 categories)', 4, 1, 4),
(1695, 288, 537, 972, 'Kati bedhas are the movement of the hips and have been abandoned by most modern schools of Bharathanatyam. There are 5 Kati Bedhas. They are :\r\n\r\n1. Chinna - middle of the hip is turned aside. Depicts exercise and confusion.\r\n2. Nivrtta - hip turned forward from another position. Depicts turning forward.\r\n3. Recita - hip moves in all directions. Depicts wandering.\r\n4. Udhvahita - hip slowly moves up. Depicts the motion of a stout person or the seductive walk of a woman.\r\n5. Kampita - hips move obliquely up and down. Depicts the motion of hunchbacks or people of the inferior type.', 4, 1, 4),
