(1706, 288, 564, 973, 'Rakudi=Ornament for head,Triangular playhouse=Tryasra,Salangai=Feet ornament,Konarak temple=caves Sun god,Ajanta and Ellora=Buddhist paintings,Mridangam=Percussive accompaniment,Chidambaram=Nataraja,Elephanta=Trimurthi,Utkshiptam=When heels are raised,Yakshagana=Karnataka', 10, 1, 5),
(1707, 288, 560, 973, 'Dance and temple sculptures both relate to Indian religion. This is evident in the vast amounts of sculptures relating to dance, specifically the 108 karanas, that can be found in some of these temples. For example, the Nataraja temple in Chidambaram contains four massive gopurams, at the entrance of which, all 108 karanas are depicted in the form of deep reliefs, and lines from the Natyashastra are engraved. Another example of this is in the Brigadeeshwara temple in Thanjavur where king Raja Raja Chola intended to engrave all 108 karanas on the Gopura Vimanam of the temple, although only 81 of them were completed. Yet another example is at Sathara, where all 108 karanas are depicted. This temple is known as Uthara Chidambaram. Another example is at Tiruvarankulam, where a large bronze statue of Nataraja is present. Lastly, there is the Vriddhapuriswarar temple at Virudachalam, where all 108 karanas are depicted, although not in finished form. Dance sculptures are also engraved in the temples of Kumbakonam, Tharasuram, and Tiruvanamalai. ', 4, 1, 4),
(1708, 288, 602, 973, 'In modern day Bharathanatyam, there are some issues connected with lighting. One such issue is when the light falls directly in front of the dancer\'s head. If this happens, the shadows cast will make the dancer\'s facial feature, primarily the eyes. look sunken. Another issue is with footlights. These make the dancer\'s feet not visible to the audience, and disturb the eyes. Some issues with lighting today are caused by the size of the stage, which is large. Larger stages make it more difficult for the lighting to hit the dancer while still being dim enough to not blind the audience. However, nowadays, technology has advanced to the point that using floodlights(evenly spread lights), and spot lights(that brighten a single spot), optimal lighting can be achieved even on larger stages.', 4, 1, 4),
(1709, 288, 601, 973, 'Charis are simultaneous movements of the feet, shanks, hip, and other body limbs. It is the movement that is done with a single foot at a time. Charis are used mainly in fighting sequences, dance, ordinary movements, and theatrical and dramatic representations. There are two broad classifications of Charts, which are Bhumi(where the movements of the feet are primarily on the ground), and Akashi(where the movements of the feet are primarily in the air). The Natyashastra describes 16 Bhumi and 16 Akashi charts. Some examples of Charis are:\r\n\r\nBhumi Charis:\r\n1. Samapadha \r\n2. Sthitavarta\r\n3.Sakatasya\r\n4.Adyardhika\r\n5.Chasagati\r\n6.Vicyava\r\n7.Edakakridata\r\n8.Baddha\r\n9.Urudvrtta\r\n10.Addita\r\n11.Utsyandita\r\n12.Janita\r\n13.Syandita\r\n14.Apasyandita\r\n15.Samotsaritamattali\r\n16. Mattali\r\n\r\nAkashi Charis:\r\n1. Atikranta\r\n2. Apakranta\r\n3. Parswakranta\r\n4.Urdhvajanu\r\n5.Soochi\r\n6.Nupurapadhika\r\n7.Dolapadha\r\n8.Akshipta\r\n9.Aviddha\r\n10.Udhvrtta\r\n11.Vidyutbrantha\r\n12.Alata\r\n13.Bhujangatrasita\r\n14.Harinapluta\r\n15.Dhandapadha\r\n16.Bhramari\r\n\r\n', 5, 1, 4),
(1710, 288, 559, 973, 'A chari is the simultaneous movement of the feet, shanks, hip, and other body limbs in which only one foot is moved at a time. There are two main types of charis, namely Bhumi and Akashi Charis. According to the Natyashastra, there are 16 of each, but for the sake of time I was only able to write 8.\r\n\r\nBhumi Charis(where legs are mainly on the ground)\r\n1. Samapadha - feet close together after walking\r\n2. Sthitavarta - one agratalasanchara foot crosses and then separates from the other foot. Motion repeated on the other side.\r\n3. Sakatasya - one agratalasanchara foot stretched outward.\r\n4. Adhyardika - right foot touches the back of the left heel and comes to front. Left does opposite.\r\n5. Chasagati - Right foot stretched forward and then drawn backwards. Repeat for the left foot.\r\n6. Vicyava - the feet are separated from samapadha, and are struck with their fore-part.\r\n7. Edakakridita - Jumping up and down with talasanchara feet\r\n8. Baddha - two shanks bent and thigh turned upwards\r\n9. Urudvrtta - heel of talasanchara foot out, one shank bent, thought facing upwards\r\n10. Addhita - one agratalasanchara foot rubbing against the fore-part or the back of another foot.\r\n11. Utsyandita - feel move gradually sideways\r\n\r\n\r\nAkashi Charis(movements with the legs primarily in the air)\r\n1. Atikranta - kunchita foot thrown up tot he front, and falling on the ground\r\n2. Apakranta - two thighs in valana, kunchita afoot raised and lowered sideways.\r\n3. Parsvakranta - one foot in kunchita, other lifted near the sides.\r\n4. Soochi - kunchita foot thrown up above the knee, released on it\'s front\r\n5. Nupurapadika - ancita foot crossed behind other foot, and then lowered.\r\n6. Dolapada - kunchita foot raised and moved from side to side before it is lowered as ancita\r\n7. Akshipta - kunchita foot lifted and crossing over the other leg as ancita\r\n8. Alata - one foot stretched to the back and laid on it\'s heel', 4, 1, 4),
(1711, 288, 561, 973, 'The Brigadeeshwara temple in Thanjavur is massive, with it\'s 15 meter walls, and its 29 meter square base. On it\'s Gopura Vimanam(temple tower) which was constructed with a single 80-ton piece of granite, the king Raja Raja Chola intended to engrave all 108 karanas in the form of Lord Shiva dancing them. However, as he went away on a war journey, only 81 were able to be completed. This temple also hosts a dance festival, which draws in artists, dancers, and musicians from abroad.', 4, 1, 4),
(1712, 288, 563, 973, 'In Bharathanatyam, it is important to have good lighting on stage as to illuminate the dancer, and to allow the audience to enjoy her dance to the fullest. In the modern day, there are some issues with lighting. One such issue is with lighting that falls directly above the dancer. This causes shadows and makes the dancer\'s facial features look sunken in, especially the eyes. Another issue is if the lighting falls directly on the screen behind the dancer, as this will cause the dancer\'s face to look dull. A third issue is with footlights. These make it difficult for the audience to view the dancer\'s feel, and are painful to the eyes. Some solutions to these are to have flood lights(covering large areas with light), and spot lights(covering a smaller area with intense light) shining on the dancer to an angle to eliminate bad shadows. More problems are caused but he fact that nowadays, theaters are very large. However, with today\'s technological advancements, it is possible to create the exact angle and intensity of light that will illuminate the dancer best without blinding the audience. ', 4, 1, 4),
(1713, 288, 603, 973, 'The story of the temple of Simhachalam is as follows:\r\nThere was a king by the name of Hiranyakashipu(an ardent hater of Vishnu), who was furious at his son Prahalad\'s devotion to the lord. No matter how hard Hiranyakashipu attempted to kill Prahalad, Vishnu would always save him due to his bhakti(devotion). Is is said that in one of his attempts, Hiranyakashipu threw Prahalad into the sea, and covered him with a mountain to stop him from escaping. Lord Vishnu, in the form of Narasimha(half man half lion) tilted up the mountain allowing Prahalad to escape. The story goes on to say that later, Prahalad stumbled across the shrine at Simhachalam.', 5, 1, 4),
(1714, 288, 562, 973, 'The role of the orchestral accompaniment in a Bharathanatyam concert, is to compliment the singer\'s  voice, add layers and richness to the performance, and to keep a steady beat. The instruments in the orchestra are:\r\n\r\nTalam - metlica cymbal played by the nattuvanar that keeps the beat and tempo of the dance and adds to the excitement of the piece\r\n\r\nMiridangam - made of teak wood, red sandal, or Indian Kino. It is like a drum, with the hollow barrel being covered on both sides with animal hide, and with buffalo-skin straps across the barrel. A well tuned Miridhangam is the principle rhythmic accompaniment to the dancer, which enhances her footwork. It also helps keep the sruti(pitch) of the music.\r\n\r\nFlute - a wind instrument that is made with bamboo that is played by blowing into the mouth hole, and covering and opening the holes along the barrel. The flute\'s mellow quality and pure sound adds beauty to the performance. The flute can also be played solo.\r\n\r\nVeena - the even, also called the Saraswati Veena is a plucked string instrument. It provides musical accompaniment to the singer. The sound of the even is amplified by it\'s resonators.\r\n\r\nViolin - string instrument made using hollow wood. It is used as an accompaniment for the vocal music.\r\n\r\nVeena flute and violin give richness to the singer\'s voice.\r\n\r\nTampura (drone) - it is a string instrument that aids the singer in keeping the sruti(pitch) in the dance recital.  ', 5, 1, 4),
