(1735, 689, 257, 977, 'Qualities of Danseuse=Humble without the arrogance of knowledge,Qualities of a Percussionist=nimble with fingers,Qualities of a Dancer=steady and balanced in performance,Qualities of a Nattuvanar=Humble without the arrogance of knowledge,Qualities of a Guru=Able to utter accurately each rhythmic sequence,Qualities of a Singer=learned in the marga and desi styles of music,Villadavu=the body arches like a bow,Mandiadavu=Dancer sits all the way down with knees bent,Marthitha Adavu=Hands and Body make a full swing front and sideways,Kuththa Adavu=Dancer jumps low with toes firmly rooted on the floor', 7, 1, 5),
(1736, 689, 263, 977, 'bharatanatyam is one of the eight classical dance forms of india. this dance form originated in the temples and courts of southern india. later it was documented as a performing artin the 19th century by the four brothers known as the tanjore quartret musicians. their musical compositions are use for bharatanatyam dance repotire even today. the art form used to perform by generations to generation under devdasi system . devdasi womenwere dedicated to temples to gods as dancers and musicians performing part of the elaborate rituals. these male nattuvanars were the most important part of bharatanatyam , because these male gurus used to teach the devdasis at the temple. this dance form only infused in temple and not on stage or outside temple.\r\n', 5, 1, 4),
(1737, 689, 259, 977, '----', 0, 1, 4),
(1738, 689, 262, 977, 'the word abhinaya has been derived from the root word ni which means to to take or carry , with the proposition abi meaning towards. as per the traditional sloka , the root vi with the preposition abhi gives word abhinaya which means to carry the performance towards the audience . it is the facial expression of bhva through hand gestures and facial expressions.\r\nabinaya darpana which predominantally deals with dance.', 0, 1, 4),
(1739, 689, 261, 977, 'sangam work has ben known as pinther , nattu koothu\r\nthe dance which was danced in front of and behind the chariots of the kings who had won the battle were called pintherkuravai respectively', 3, 1, 4),
(1740, 689, 258, 977, 'thalaikol was of a 7 hand span link it was made of bamboo and was studeed with gems. there were golden knots inbetween at the begini ng of Indira vizha, a festival pooja was done to this . the stick was then given to the royal elephant and was taken for a procession along with the king who rode along with the other ministers. it was then given to the dance teacher who was standing on the chariot. he would receive it and keep it at the arangam. the performance stage.\r\nthe lady dancer who received this was called , thailaikol. the nattuvanar was called thalaikol assan. ', 4, 1, 4),
