(1751, 470, 492, 978, 'Uras=Chest,Svastika=Arms crossed in chest region,Uru=Thighs,Prasarita=Arm movement stretched,Padmanabha=Lord Vishnu,Vaishaka=Sthana for men,Padmakosha=Asamyutha hastha,Bramari=Seven types,Ayata=Sthana for women,Paadachari=Eight types', 10, 1, 5),
(1752, 470, 493, 978, 'There are 7 types of postures for women,\r\nThey are \r\nAyata -  right foot placed in sama & left foot in tryasra\r\n Avahitham- left foot in sama & right foot in tryasra\r\n Asvakranta- one foot raised  & other is resting \r\n Gatagatam- move forward with one foot raised\r\n Valitam- body is twisted around \r\n Motitam - one foot is sama & other is kunchita\r\nand Vinivrtam - opoosite of Motitam\r\n\r\n', 4, 1, 4),
(1753, 470, 494, 978, 'These are used rarely & are of 5 types:\r\n1. Chinna - hip is slanting\r\n2. Nivrtta - waist and Hip are turned front ward\r\n3. Recita - Hips move all directions\r\n4. Udvahit - Hip is raised slowly\r\n5. Kampita - Hips move up & down', 4, 1, 4),
(1754, 470, 538, 978, 'Sanchari Bhava dristi are the glances of the eyes used to express the transitory states . There are 20 glances of them\r\n1. Shunya - Vacant\r\n2. Malina - Impure\r\n3. Shranta - Drooping\r\n4. Lajjanvita - embrassment\r\n5. Glana - Languid\r\n6. Shankita - Doubtful\r\n7. Vishanna - Depressed\r\n8. Mukula - Happiness\r\n9. Kunchita - Curved\r\n10. Abhitapta - Scorched with pains\r\n11. Jimha - Athwart\r\n12. Lalitha- Graceful\r\n13. Vitarkita - Pondering\r\n14. Ardhamukula - Half opened bud\r\n15. Vibhranta - Distracted\r\n16. Vipluta - Scattered\r\n17. Akekara - Squinting\r\n18. Vikosha - Wideopen\r\n19. Trasta - Timid\r\n20. Madira - Intoxicated', 4, 1, 4),
(1755, 470, 496, 978, 'This is an artistic expression through the dancer\'s usage of body movements. Bod is seen as the medium of expression. This involves a rhythmic step forward and back as well as elaborate arm and hand movement with corordinating eye and eye brow movement. \r\n\r\nAll body movements fall under this and deals with major limbs(angas), minor limbs ( pratyangas) and Subsidary limbs(upangas)', 4, 1, 4),
(1756, 470, 536, 978, 'This is a dance for women. It is a gentle form of Thandavum. Sowshtava and the elegance along with purity of the soul are needed for lasyam. There are no separate movements for the Adavus of Thandavum and Lasyam. The difference is only in the method of carrying it out', 4, 1, 4),
(1757, 470, 495, 978, 'There are 4 types of Paada bhedas. They are \r\n1. Mandala - They are subdivided into 10 types based on the standing positions.\r\n2. Utplavana - They are subdivided into 5 types based on the  jump movements\r\n3. Bhramari - They are subdivided into 7 types based on the way the dancer circles or drags the legs\r\n4. Paadachari - They are subdivided into 8 types based on the way the dancer walks.', 5, 1, 4),
(1758, 470, 537, 978, 'They are rarely used in Bharatnatyam. The movements of Hips can be classified into 5 types\r\n1. Chinna - Middle of the waist to hip is turned aside\r\n2. Nivrtta - Waist and Hip are turned front ward from another position\r\n3. Recita - Hips moved in all directions\r\n4. Udvahita - Hip is raised slowly\r\n5. Kampita - Hip moves up and down obliquely.', 4, 1, 4),
(1759, 470, 497, 978, '1. Vigneswara - Left hand shows karika (elephant\'s trunk). Right hand is katakamukha Hasta.\r\n2. Brahma - Abhinaya of Brahma is shown with Padmakosha hastha in left hand \r\n3. Vishnu - Vishnu is shown with hands first Tripathaka and then karthari hastha at the shoulders\r\n4. Padmanabha - Shown by showing padmakosha hasta above the chest\r\n5. Sadashiva - Shown by standing saiva sthanaka and holding the sula hastha in the right hand and mrigasira hastha in the left\r\n6. Ardanareeswarar: Shown holding padmakosha at the left side and the Trisula hastha in the right\r\n7. Shanmukha :Shown holding karthari hastha in both the hands at the regions of the ears , standing in vaishaka sthanaka ', 5, 1, 4),
