(1770, 470, 564, 979, 'Rakudi=Ornament for head,Triangular playhouse=Tryasra,Salangai=Feet ornament,Konarak temple=caves Sun god,Ajanta and Ellora=Buddhist paintings,Mridangam=Percussive accompaniment,Chidambaram=Nataraja,Elephanta=Elephanta caves,Utkshiptam=standing,Yakshagana=Karnataka', 10, 1, 5),
(1771, 470, 563, 979, 'If the light is placed directly above the dancer, the shadow of the nose will fall on the lips. Similarly, the shade will fall on the forehead and the eyes will look sunken\r\n\r\nFoot lights should be avoided', 4, 1, 4),
(1772, 470, 560, 979, 'Temple sculptures and dance can be considered as the twins of the mother art.  The various dance postures engraved in sculpture have been taken as the grammar of dance. Throughout India, there are thousands of dance sculptures in various temples. \r\n\r\nMany great scholars and exponents have written books on bharatnatyam based in their study of these sculptures. The sculptures not help in research and studies but are also valuable ancient treasures of the temples.', 4, 1, 4),
(1773, 470, 603, 979, 'The foundation of the temple is attributed to the Hiranyakushubu who furious at his son Prahaldha\'s devotion to Vishnu threw him into the sea and placed this hill on his head. Narasimha went to his rescue and stood by the side of the hill and tilted it up so that the boy might escape from the weight of the hill. Later on Prahaladha is stated to have found the shrine.', 4, 1, 4),
(1774, 470, 562, 979, 'The role of an orchestra in a dance recital is significant . The musicians who accompany the dancers are :\r\n1. Nattuvanar : conductor of the dance recital. He leads the entire orchestra and controls the rhythm\r\n2. Mridangam : Percussion Instrument \r\n3. Flute : Wind Instrument\r\n4. Veena : String Instrument\r\n5. Violin: String Instrument\r\n6. Tambura: String Instrument used for sounding the shruti\r\n', 4, 1, 4),
(1775, 470, 561, 979, 'The temple is located in Thanjavur. The inner sanctum and gopuram was constructed of a single peice of granite\r\nRaja Raja Chola engraved 81 karanans in the temple\r\n The dance festival in the temple\'s premises witness a vibrant cadre of artists, both dancers and musicians from in and around India', 4, 1, 4),
(1776, 470, 559, 979, 'Chari is the beginning of the initial static position moving as if in sections along the parameter of a circle and completing the circle in a serious of movements.\r\nThe movement with a single foot at time is called a chari\r\nThe bhaumi chari are mostly virile movements of foot-work and are used in rhythmic movements. Akasiki charis are the delicate movements of foot work.\r\n\r\nNatyashastra describes 16 Bhaumi and 16 Akasi Charis. \r\n\r\nThe earthly charis are used in a personal combat whereas Aerial charis are applied to the use of weapons like bow and thunderbolt.', 5, 1, 4),
(1777, 470, 601, 979, 'Chari is the beginning of the initial static position moving as if in sections along the parameter of a circle and completing the circle in a series of movements.\r\nAs the chari prescribed by rules and connected with limbs related to one another they constitute a system. \r\nIn Earthly(bhaumi ) chari the feet are on the ground completely while in akasiki (aerial), one foot or both are raised. The bhaumi chari are mostly virile movements of foot-work and are used in rhythmic movements while the akasiki charis are mostly delicate movements of the foot work.\r\n\r\nNatyashastra describes 16 bhaumi and 16 akasi charis. ', 5, 1, 4),
(1778, 470, 602, 979, 'Stage light should not be placed above the dancer because the shade of the nose will fall on the lips. Similarly, shade of the forehead and the eyes will look sunken. \r\n\r\nFoot lights should be avoided as it disturb the eyes and audience cannot view the dancers foot\r\n\r\nLights should not fall directly on the screen since the dancers figure will not look bright', 5, 1, 4),
