(1799, 689, 394, 980, 'Shakatam --=The Cart,Chaturam=The square,Vayu=Araalam in right hand and Ardhapathakam in left with left fingers facing the earth,Varuna=Pathakam in right hand and shikaram in left held near the chest sama padam,Murugan=Right hand in Trishoolam and left in shikaram held near the chest. Mandalam position with leg bent inwards,Agni=Tripathakam in right hand and kangulum in left held near the chest,Soorya=Kapitham in right hand and left in alapadmam. Feet in samam position,Chandra=Ardhachandram in right hand and alapadmam in left held near the chest.,Vishnu=Both hands in tripathakam near the shoulders with palms facing outwards,Mahalakshmi=Both hands in kapitham near shoulders , body in asana  position', 10, 1, 5),
(1800, 689, 400, 980, 'matsyam fish\r\nkorma turtle\r\nvaraham swine\r\nnarisham man lion form\r\nvamanam divine miget\r\nparasuram tripatakam and shikaram\r\nrama right katakamukha left shikaram\r\nKrishna both hand mrigasheersham\r\nkalki right hand kapitam over head left hand mrigasheersham\r\n', 5, 1, 4),
(1801, 689, 399, 980, 'asamyutha means non union ,can be traced as origins for the tamil usage of these words.some of these handa gestures may not indicate or narrate anything . but may be used merely to enhance the beauty of the pure dance itself. such gestures are called nritha hastas. ', 4, 1, 4),
(1802, 689, 396, 980, 'nritya or abhinaya is integral comp[onent using interpretative aspect of bharatanatyam ,conjuring up and attractive world of imagination . the Sanskrit term abhinaya means to educte or convey ideas to the audience.the abhinaya darpana, a Sanskrit text by nandikeshwara states that actors educate the audience by stimulating in the latent possibility of an aesthetic.this interperration is done by the movement of the limbs and gestures by voice and meaningful words, by attire and decorattions and by physical manifestions. ', 5, 1, 4),
(1803, 689, 397, 980, 'natya is a combination of nritta and nritya with dramatic element to it ,it is the dramatization of a theme. the most common themes in the repotire of bharatanatyam are mythological stories which sing praise of the deds of the various hindu gods. other themes include a number of stories of kings of different eras, in whos praise many great poets have penned beautiful songs. natya is thus the visual painting that the dancer draws to get the story across to the audience.', 5, 1, 4),
(1804, 689, 398, 980, 'capturing of wide range of emotions actions, ideas, and objects, through a deft use of the hands is a unique aspect of bharatanatyam,the hand with its remarkable flexibility is hels in various shapes ,called hastas.\r\nand used as in an effect instruments of communications, the hastas or hand formations are classifeied into 2 asamyutha hasta and samyuthat hastas. samutha hasta mean double hand formations.', 5, 1, 4),
(1805, 689, 395, 980, 'nritha has ben defined as nritham, tala, laya, shrayam. \r\nin classical aesthetic terms nritha is pure dance that creates sheer aesthetic delight in the onlookers.\r\nits basic constituents are tala and laya. time measures and rhythm. in nritta the emphasis is on clarity od dance movements, with a accompainments provided by the nritta hastas, or pure hand gestures.\r\nsuch movements have no hidden emotive contents and they are dance done for their own sake, creating patterns in space and time.', 4, 1, 4),
