(1816, 99, 492, 984, 'Uras=Chest,Svastika=Arms crossed in chest region,Uru=Thighs,Prasarita=Arm movement stretched,Padmanabha=Lord Vishnu,Vaishaka=Sthana for men,Padmakosha=Asamyutha hastha,Bramari=Seven types,Ayata=Sthana for women,Paadachari=Eight types', 10, 1, 5),
(1817, 99, 495, 984, 'Within Angika Abhinaya there are three classifications of body parts: anga (major limbs), pratyanga (minor limbs), and upanga (subsidiary limbs). Pada bedhas are feet movements and fall under the category of anga. They are 13 types. Samam is standing straight with the feet together with a one inch gap. Anjitham is when the leg is stretched either to the sides of forward with the heel touching the ground and the toes lifted up. Kunjitham is when the heel is lifted up and the toes are kept on the ground and bent inwards. Soochi is when the big toe of one foot is on the ground with other parts of the foot raised up. Agratalasancharam is when the heel is raised and the toes are firmly on the ground. Uthkattitham is when the foot is on the ground and then the heel is lifted and beat on the ground. Thatitham is when the foot is on the ground and the toes are lifted and beat on the ground. Kadithothsedham is agrathalasancharam and uthkattitham in succession. Kattibthem is when the foot is bent towards the little toe without the sole touching the ground and beat on the ground. Mardhitham is when the foot slides to the side and is lifted up. Akragam is a sliding action with the foot. Parshnigam is when the heel is on the ground with the toes raised up and a movement is made. Finally, parchvagam is when the feet are turned at 180 degrees. ', 5, 1, 4),
(1818, 99, 538, 984, 'Within Angika Abhinaya there are three classifications of body parts: anga (major limbs), pratyanga (minor limbs), and upanga (subsidiary limbs). Dristi bedhas are eye movements and fall under the category of Upanga. There are three subdivisions of dristhi bedas which are rasa drishti, sthayi bhava dristhi, and sanchari bhava dristhi. Sanchari bhava dristi are eye movements that show transitory states. There are 20 of these movements.\r\nShunya is when the eyes are steady and have a vacant stare. It indicates lost in thought. Malina is when the eyelids are partly closed and pale. It is used to convey impurity.  Shranta is when eyes and eyelids are lowered due to fatigue. Lajjanvita is when the dancer wants to convey shyness and the eyelids are partly closed and the eyes are looking down. Glana is when the eyelashes are raised and almost touching the eyebrows but the pupils move slowly. It is used to show fatigue. Shankita is when the eyes move a little and rest a little and the pupils are raised and lowered. It conveys doubt. Mukula is when the eyelashes are trembling and the eyelids lowered. This is used to show happiness. Abhitapta is when the pupils and eyelids move quickly to show distress. Jimha is when the eyelids are down, the pupil quivering but concealed. Lalita means graceful eye movement. Vitarkita is pondering and the eyes are fully opened and the glance is down. Madira is the look of intoxication. The eyes are rolling and open. Others are vibranta or distracted, akekara or squinting, vikosha or wide open, vipluta or scattered or trembling, and trasta or timid. \r\n', 5, 1, 4),
(1819, 99, 493, 984, 'Sthanas are standing positions. There are separate sthanas for men and women. There are seven sthanas for women. Ayata is when the right foot is in sama and the right hip raised. The left foot is obliquely placed (tryasra). Avahitham is when the left foot is in sama and the left hip raised. The right foot is in tryasra. Asvakranta is when one foot is raised and the other is resting on its forepart. Gatagatam is when the dancer is about to move forward but hesitates. One foot is raised. Valitam is when the body is slightly twisted and the foot which is in the direction in which it is twisted touches the ground with its litle toe. The other foot touche the ground with its big toe. It is used when the dancer looks with desire. Motitam is when one foot is in sama and the other is in kunchita with the toes half touching the ground. Two hands move up in karkata pose and is used to describe love. The last sthana is Vinivrtam and it is the same as motitiam but with the feet reversed. ', 5, 1, 4),
(1820, 99, 494, 984, 'Within Angika Abhinaya there are three classifications of body parts: anga (major limbs), pratyanga (minor limbs), and upanga (subsidiary limbs). Kati bhedas are movements of the hip or waist and fall under the category of anga. These are rarely used in Bharathnatyam and are more common in Odissi and Kuchupidi. There are 5 kati bhedas.\r\n\r\nChinna is when the hip is turned aside. It is used to show confusion, or looking back. Nivrtta is when the waist and hip are turned forward from another position and is used to show turning away. Recita is hip movements in all direction and is used to show wandering. Udvahita is raised slowly. This shows the movement of a fat person or the seductive movement of a woman. Kampita is when the hips are moved moved up and down obliquely. This depicts the movement of inferior people. \r\n', 5, 1, 4),
(1821, 99, 497, 984, 'In Natyashastra, specific postures are used to describe specific deities. \r\n\r\nTo depict Vigneshwara, the left hand shows the elephants trunk. It is extended forward with pataka hasta hanging from the wrist. The upper arm touches the ear and the hasta is at the level of the abdomen. The right hand is in katakamukha hasta. Vigneshwara is the remover of all obstacles. Brahma is shown with padmakosha hasta in the left hand. The right hand is at shoulder level and drawn across the body. The sthanaka is sama. Vishnu is shown with tripataka hasta and then kartari hasta at the shoulders. The stanaka is sama. Sadashiva is shown by holding the sula hasta in the right hand and mrigasirsa hasta in the left hand. The sthanaka is saiva. Ardhanareeswarar is shown holding padmakosha with the left hand and trisula with the right hand. The sthanaka is saiva. ', 5, 1, 4),
(1822, 99, 536, 984, 'In natyashastra, the energetic variety of dance taught by Sage Thandu is called Thandavam. According to scriptures, thandavas were danced by Lord Shiva in different situations. They can also be seen in the temple sculptures. Thandavam depicts the grandeur and virility of men. The counterpart of Tandavam, danced by women is called Lasyam. \r\n\r\nThere are no separate movements, adavus, and gestures between Thandavam and Lasyam. The difference is only in the method with which the dancei s performed. Identical movements can be danced by men as Thandavam and by women as Lasyam. Lasyam is the gentle form of Thandavam. If needed, a female can dance thandavam and a male can dance lasyam. The natural traits of women such as beauty, elegance, and gentleness are depictions of feminity in Lasyam. The Puranas say that Goddess Parvati instructed Usa, the daughter of king Banasura, to produce Lasyam. \r\nLasyam means a few songs based on love. The Thandavam written by Bharata is known as Uthama Prayogam. The same movements done by a female is known as Sukumara Prayogam. Elegant and purity of the soul are needed for lasyam. \r\n\r\n', 5, 1, 4),
(1823, 99, 537, 984, 'This question is repeated? I am answering it again. \r\n\r\nKati bhedas are movements of the hip or waist and fall under the category of anga. In angikam ahbinaya there are 3 subdivisions of body parts: anga, pratyanga, and upanga. Anga is major limbs, pratyanga is minor limbs, and upanga is subsidiary limbs. Katu bhedas are more commonly used in Odissi and Kuchupidi compared to Bharatnatyam. There are 5 kati bhedas.\r\n\r\nChinna is when the hip is turned aside. It is used to show confusion or turning around. Nivrtta is when the waist and hip are turned forward from another position and is used to show turning away. Recita is when the hip moves in all directions and is used to show wandering. Udvahita is when the hip is raised slowly. This shows the movement of a fat person. It may also show a woman\'s seductive movement. Kampita is when the hips are moved moved up and down obliquely. This depicts the movement of inferior people like hunchbacks and harlots and eunuchs. \r\n', 5, 1, 4),
(1824, 99, 496, 984, 'Abhinaya is the technique of communication through the facial expressions, body movements, attire, and words. Abhi means towards and Ni means to lead. Therefore, abhinaya means to lead towards. The dancer uses abhinaya to lead the audience towards attaining rasa. The Abhinaya Darpana written by Nandikeshwara describes four types of abhinaya: Angika (expression through body movement and gesture), Vachika (expression through words), Aharya (expression through attire and stage dcor), and Satvika (expression through emotions). \r\n\r\nAngika Abhinaya is made of three elements. Shaka means branch is refers to the hastas used. Ankura means sprout and refers to the usage of the hastas or the hasta vinyoga. And finally, nritta is pure dance movement and is the non-narrative part of dance. Angika Abhinaya is further subdivided into three categories depending on the part of the body being used. The categories are angas (major limbs), pratyangas (minor limbs), and Upangas (subsidiary limbs). The gestures are subdivided into mukhaja abhinaya (expression using the face), saria abhinaya (expression using the limbs), and cesthakritha abhinaya (movement of the entire body). Cesthakritha abhinaya is further subdivided into nritta which is pure dance movement and gati prachara. Gati prachara is expressive body movement and is made up of stithi or posture and gati or movement from the posture. \r\n\r\nThus with the above detailed classifications of body positions and movements, Natyashastra explains how emotions and behaviors can be conveyed through coordinations of all these body movements together.\r\n', 5, 1, 4),
