(1835, 99, 564, 985, 'Rakudi=Ornament for head,Triangular playhouse=Tryasra,Salangai=Feet ornament,Konarak temple=caves Sun god,Ajanta and Ellora=Buddhist paintings,Mridangam=Percussive accompaniment,Chidambaram=Nataraja,Elephanta=Trimurthi,Utkshiptam=When heels are raised,Yakshagana=Karnataka', 10, 1, 5),
(1836, 99, 559, 985, 'Chari is the simultaneous movement of the foot, shank, and hip is called a chari. A chari is strictly the movement of one leg while the movement of both legs together is called a karana. Chari is subdivided into Bhaumi chari  (earthly) and Akasiki (aerial). In Bhaumi chari both feet are on the ground and it is used in rhythmic movements. In akasiki chari one or both feet are raised and it is applied in the use of weapons. Although chari only involves movement of the feet, shank, and hip, as per rules in the Natyashastra, the hands follow the feet and the feet follow the hands. In the chari, when the foot comes to rest, simultaneously the hand movements come to rest on the waist. This leads to a very composite and synchronized movement of the entire body. There are 16 Bhaumi charis and 16 Akasiki charis.\r\n\r\nThe Bhaumi charis are as follows: samapada, sthitavarta, sakatasya, adhyardhika, chasagati, vicyava, edakakridita, baddha, urudvrtta, aditta, utsyandita, janita, syandita, aparyandita, samotsaritamatalli, and mattali.\r\n\r\nThe Akasiki charis are as follows: atikranta, apakranta, parsvakranta, urdhvanjanu, suchi, nupurapadika, dolapada, akshipta, aviddha, urdvrtta, vidyudbhranta, alata, bhujangatrasta, harinapluta, dandapada, bhramari.\r\n\r\n\r\n\r\n\r\n', 1, 1, 4),
(1837, 99, 560, 985, 'Dance and sculpture are said to be the twins of the mother art. Dance postures are engraved in sculptures and these have been studied and the essential grammar of dance has been derived. Sculpture and architecture can be found in temples throughout India. Sculpures were first used as decoration within the templed but in later periods, temples had richly decorated exteriors with intricate dancers and animals and musicians. \r\n\r\nOne of the most important temples in South India is the Nataraja Temple in Chidambaram. Chidambaram is known as the city of the cosmic dancer. This temple is an example of Chola architecture. There are four gopurams, each with 108 karana in the form of a dancing lady. For each dancing form, there are two lines of the Natyashastra engraved. The deity of this temple is space and is known as the Akasa lingam. The Nataraja temple has the famous bronze statue of the Nataraja which is the dancing form of Shiva. The idol is separated by a veil which is only removed for specific occasions. \r\n\r\nThe Brigadeeswara Temple is in Thanjavur. It has a soaring vimara and a stunted gopuram. It was contructed from a single piece of granite weighing 80 tons and took 12 years to build! It was built in the 11th century by the great Chola King Raja Raja Chola. He intended to carve all 108 karanas but went to war and only managed to carve 81. All 108 karanas have since been completed at Sathara in the south and this is called Uthara Chidambaram. The dance festival is vibrant and brings people from around the world. \r\n\r\nKhajuraho temples are famous for their sculptures of gods, goddess, warriors, and celestial dancers. The elephanta caves are known for their mahayogi posture. Other sculptures in these caves depict Shiva\'s cosmic dance.\r\n\r\nThese are just a few exmamples of how dance is depicted in the sculptures of Indian temples. ', 5, 1, 4),
(1838, 99, 563, 985, 'Lighting plays a very important part in conveying the aesthetic sense of a dance recital. Initially, in the day when there was no electricity, the use of lamps lit by oil was to create an atmosphere of spirituality. These continued to be used even after electric lamps became available. With the use of electrical lights in Western countries, there are techniques used to create an aesthetic environment. \r\n\r\nIn modern day, there are two different types of stage lights- flood lights and spot light. Flood lights should be spread evenly across the stage. They should fall directly in front of the dancer and not on top. If it falls on top then a shadow will form on the dancers face and expressions will not be able to be seen properly. Flood lights should be tied in one angle in front of the dancer. Spot lights fall in a particular spot and should be placed above on the sides, not directly on top of the head. Foot lights should be avoided because the feet will not be able to be seen and it will disturb the eye. Light should also not fall onthe screen because then the dancer will not look bright. \r\n\r\nLight plays a very important part in the overall choreography of a dance.\r\n', 5, 1, 4),
(1839, 99, 601, 985, 'This is repeat question? I am answering again. \r\n\r\nChari is the simultaneous movement of the foot, shank, and hip. The movement of both legs together is called a karana. \r\n\r\nCharis are subdivided into Bhaumi chari which are the earthly charis and Akasiki chari or aerial charis. Bhaumi chari is used for rhythmic movements and both feet are on the ground. Akasiki chari is more delicate movements and one or both feet are raised. In Bharathanatyam, the hands follow the feet and the eyes follow the hands. So, although chari only involves movement of the feet, shank, and hip, when a chari is used, the entire body is used meaningfully and expressively. In the chari, when the foot comes to rest, simultaneously the hand movements come to rest on the waist. This leads to a very composite and synchronized movement of the entire body. There are 16 Bhaumi charis and 16 Akasiki charis.\r\n\r\nSome of the Bhaumi charis are as follows:\r\nSamapada is when the feet are close together.\r\nSthitavarta is when one agratalashancara foot is crossed with the other foot and vice versa.\r\nSakatasya is when one agrathalasanchara foot is stretched out and the chest is held straight.\r\nAdhyardhilka is when one foot touches the heel of the other and is then brought to the front. This can be repeated with the other foot.\r\n\r\nSome of the Aerial Charis are:\r\nAtikranta is when a kunchita foot is thrown up put forward and then brough to ground.\r\nApakranta A kunchita pada is raised and thrown down sideways.\r\nParsvakranta one foot in kunchita, the other thrown up and brought near the sides.\r\nUrdhvajanu is when a kunchita foot is thrown up and brought to chest level. This is then repeated with the other foot while the first foot is brought down to rest on ground.\r\n', 5, 1, 4),
(1840, 99, 562, 985, 'Orchestra is necessary for any dance performace. Nattuvanar plays a major role in the performance! He or she leads the orchestra as well as control the rhythm between the orchestra and the dancer. The nattuvanar plays the nattvangam (a small metallic cymbal). The nattuvanar also recites the sollukattus and sometimes can sing as well.\r\n\r\nMridangam is the chief musical accompaniment in a Bharatanatyam performavce. It helps in maintain the rhythm and also enhances the dancers footwork.  Mridangam is made of teek wood and is in the shape of a hollow barrel. The two open ends are covered by animal hide. They are joined to each other by 16 leather straps which go all around the hollow barrel. At the beginning of a recital a white paste made of rice and sooji is applied to the center of the left end. This is so adjusted that the note generated by the left side is exactly one octave below that from the right side. \r\n\r\nFlute is a wind instrument made of bamboo. Because of its ability to provide a fixed consistent note, other instruments can be tuned based on it. Veena is a stringed musical instrument. It is made from wood. Good quality wood is required to produce melodius sounds. The musician wears a small triangular piece on the finger to pluck the strings. Violin is a stringed instrument. It is made from hollow wood, and has 4 wires running across a narrow strip. The strings are made of steel. \r\n\r\nTampura is a string instrument which is used to produce the shruti throughout the recital. The pitch of tampura can be tuned to best match the sound quality of the singers voice. Nowadays, for the sake of convenience electronic tampuras are used. \r\n', 5, 1, 4),
(1841, 99, 561, 985, 'The Brigadeeswara Temple is in Thanjavur. The temple is made on a 29 meter base and is surrounded by walls that rise 15 meters. It has a soaring vimara and a stunted gopuram. The temple is unique in that it does not cast any shadow on the ground. It was contructed from a single piece of granite weighing 80 tons and took 12 years to build! It was built in the 11th century by the great Chola King Raja Raja Chola. He intended to carve all 108 karanas but went to war and only managed to carve 81. All 108 karanas have since been completed at Sathara in the south and this is called Uthara Chidambaram. \r\n\r\nDr. Padma Subrahmanyam has done research onthe 108 karanas and the publication has become very famous. The dance festival is vibrant and brings people from around the world. ', 5, 1, 4),
(1842, 99, 603, 985, 'The Simhachalam temple is built about 800 feet above sea level. It is said that Hiranyakashyab was furious at his son Prahlad for his devotion to Vishnu. He therefore threw him into the sea and placed the hill over his head so that Prahlad could not escape. Narasimha went to Prahlads rescue and tilted the hill so that he could escape. Later Prahlad founded the shrine at Simhachalam on this hill. One of the pillar in the shrine is called the tribute pillar and is said to be able to cure cattle diseases and grant women children who cannot have them. Lord Narasimha is the presiding deity of this temple. ', 5, 1, 4),
(1843, 99, 602, 985, 'Lighting plays an essential role in the choreography of a dance recital. In olden days, dane concerts were performed by the use of lamps lit by oil. It was believed that this created an atmosphere of spirituality. These continued to be used even after electric lamps became available. Today with the use of electricity, there are techniques used to aestetically light up a stage.\r\n\r\nThere are two different types of stage lights- flood lights and spot light. Flood lights should be spread evenly across the stage. Spot lights falls in a specific spot and should not be place directly on top of the head. They should be placed above from the sides of stage. Flood lights should fall directly in front of the dancer and not on top. If lights fall on top then a shadow will form on the dancers face and expressions will not be able to be seen properly. Foot lights should be avoided because the disturb the audience. \r\n', 5, 1, 4),
