(1864, 837, 257, 992, 'Qualities of Danseuse=steady and balanced in performance,Qualities of a Percussionist=nimble with fingers,Qualities of a Dancer=Qualities of Danseuse,Qualities of a Nattuvanar=Able to utter accurately each rhythmic sequence,Qualities of a Guru=Humble without the arrogance of knowledge,Qualities of a Singer=learned in the marga and desi styles of music,Villadavu=the body arches like a bow,Mandiadavu=Dancer sits all the way down with knees bent,Marthitha Adavu=Hands and Body make a full swing front and sideways,Kuththa Adavu=Dancer jumps low with toes firmly rooted on the floor', 0, 0, 5),
(1865, 837, 258, 992, 'The nattuvanar was called the thalaikol asan as referred from the dramas in tamil known as koothu. The Bharatanatyam orchestra was led by a male leader who knew dance choreography and music intimately. This person was known as the nattuvanar. He was the senior musician in most instances and a dance teacher. The nattuvangam involves several duties striking cymbals while singing in the style of Carnatic music, controlling the tempo of the dance, and conducting the orchestra. It took many years to become a nattuvanar. Skill in nattuvangam is important for a dance teacher. Of recent years, nattuvanars are no longer required. Today nattuvanars do not teach dance; they are specialists who conduct the recitals. \r\n', 0, 0, 4),
(1866, 837, 260, 992, 'The dance which danced in front of the chariot is called munther kuravai. There are references to this dance form in Sangam Literature. Sangam Literature began with the 5th century BC and ending with the 4th century AD. This consists of tamil literature which produced much poetry. The Golden Age has two major epics: the Silappadhigaram and Manimegalai. Silappadhigaram is a vast storehouse of information on the arts of music, dancing, building, and other activities of the Ancient Tamils. Silappadhigaram has two board divisions of knowledge known as Ahakkuthhu (nryta) and Purakkutthu (nrtta). The dancers of the munterkuravai are known as descendants of cowherders who were under the wing of Lord Krishna. The accompanying instrument for this dance is Urumi, which is used only for this dance. The long-held idea is that the dance of Devas came about to please Rudra Tandavam of Shiva. This is termed as Devara Attam. Nandi gives the accompaniment to this dance form. The dance which danced behind the chariot called pinther kuravai. ', 0, 0, 4),
(1867, 837, 259, 992, 'The one who sang songs for dance was called the Thoriya Mandanthai. This is derived from the dance drama in tamil known as Koothu. In ancient times, during festivities, artists known as Kutthargal entertained the public with their songs and dance. Paratavar and Kuravar who were a group of nomadic folk, sang and danced for entertainment. Apart from them there were people who had this art as their profession. The epic which explains the fame of Kutthu in Tamil is Silappadigaram. The Kutthars learned all 64 arts. At the beginning of Indira Vizha, a festival, a pooja was done to this. ', 0, 0, 4),
(1868, 837, 262, 992, 'The Abhinaya Darpana was written by Nandikesvara between the third and fourth century AD. The script is in Telegu and it is generally believed that the writer came from Andhrapradesh. It consists of 324 slokas in one chapter. It predominantly deals with the gestures of the head, eyes, neck, hand gestures representing Gods, Dasavtaras, castes, relations, mandalas, utplavanas, bhramaris, caris, and gatis in dance. Kuchipudi and Bharatanatyam follow this text extensively. The text also states that actors educate the audience by stimulating in them the latent possibility of an aesthetics. \r\n', 0, 0, 4),
(1869, 837, 263, 992, 'Bharatanatyam and Mohiniattam are two south indian classical dance forms. As this course mostly covers bharatanatyam extensively, I will be elaborating on Bharatanatyam. Bharatanatyam is perhaps the oldest among the contemporary forms of classical dance in India. Its foundation is built on the Natyasastra. Among the available references for dance, there is one called the Lasyanga in the Natyasastra. This is an element of \"nataka\" which is the solo dance form which is executed in Bharatanatyam. In this, an actor plays many roles involving many moods. The actor is the narrator. The actor presents, through abhinaya the particularly dominant state Sthayi Bhava. Bharatanatyam is a composite art, whose message is not merely to the senses, but also to the soul of the dancer and that of the perceiver. It is an art that conveys spiritual expression. The intimate association of dance with religion and as a ritual, a form of worship in the temples, is well established. The institution of the Devadasis, servants of God, contributed in being responsible for preserving the art. They would perform during temple worship, delighting the audiences with charming stories from mythology. These hereditary practitioners were supported by temple funds and they became apart of the sanctum. The Tanjore Quartet codified and framed the structure of the adavus and defined the margam tradition. Their work shaped the practice and teaching of bharatanatyam for the centuries to come. ', 0, 0, 4),
(1870, 837, 261, 992, 'The dance which danced behind the chariot called pinther kuravai. The epic which explains the fame of Kutthu in Tamil is the Silappadigaram. The Kutthars of those days learnt all the 64 \r\n', 0, 0, 4),
