(1911, 838, 257, 995, 'Qualities of Danseuse=Devotion,Qualities of a Percussionist=nimble with fingers,Qualities of a Dancer=steady and balanced in performance,Qualities of a Nattuvanar=Able to utter accurately each rhythmic sequence,Qualities of a Guru=Humble without the arrogance of knowledge,Qualities of a Singer=learned in the marga and desi styles of music,Villadavu=the body arches like a bow,Mandiadavu=Dancer sits all the way down with knees bent,Marthitha Adavu=Hands and Body make a full swing front and sideways,Kuththa Adavu=Stretching ones leg and striking with the heels', 0, 0, 5),
(1912, 838, 260, 995, 'Munterkuravai is a form of koothu dance performed in front of a chariot. Koothu is drama dance originated in Tamilnadu. There was another chariot koothu dance, Punterkuravai, which was danced behind a chariot. Another koothu dance of the same nature was performed by victorius soldiers with swords, Val Amalai. ', 0, 0, 4),
(1913, 838, 261, 995, 'Pintherkuravai - an ancient Tamil koothu drama dance performed behind a chariot. It was performed behind a King\'s chariot on his and his army victorious return a battle. ', 0, 0, 4),
(1914, 838, 263, 995, 'Indian classical dance originated thousand of years ago as a form of religious art. There are many dances that originated in South India, for example Kuchipudi, and Bharatanatyam. \r\nOne of the most prominent classical dances from South India is Bharatanatyam, from Tamil Nadu. Natyashastra, written by Sage Bharata around three thousand years ago, is a foundation of bharatanatyam. It describes many aspects of performing arts, such as dance moves, music theory, music instruments, stage design, costumes and other. It also defines Rasa - a term wich means an aesthetic pleasure created as a result of a dancer performance. ', 0, 0, 4),
(1915, 838, 262, 995, 'Abhinaya Darpana is an ancient script written by Nandikesvara in Telugu in 3rd-4th century AD. It provides description hand, head, eyes, neck gestures to represent dieties. Also is gives description of mandalas and caris and other things pertaining to dance. The script is wtitten in 324 slokas in one chapter. ', 0, 0, 4),
(1916, 838, 259, 995, 'Thoriya madanthai is a singer of songs which accompanied a koothu dance performed by koothars in Tamil King\'s court. The Koothars were called Thalaikoli after their arangetram and were given a stick made of bamboo and gems.    ', 0, 0, 4),
(1917, 838, 258, 995, 'Thlaikol Asan - a Tamil name of a nattuvanar, a dance teacher, who directed Koothu dance performances. He would receive a Thalaikol, a stick made of bamboo and gems received by the thalaikoli (dancer) after her arangetram. Thalaikol Asan woud keep this stick at the performance stage. ', 0, 0, 4),
