(1928, 386, 564, 1001, 'Rakudi=Ornament for head,Triangular playhouse=Tryasra,Salangai=Feet ornament,Konarak temple=caves Sun god,Ajanta and Ellora=Buddhist paintings,Mridangam=Percussive accompaniment,Chidambaram=Nataraja,Elephanta=Trimurthi,Utkshiptam=When heels are raised,Yakshagana=Karnataka', 10, 1, 5),
(1929, 386, 563, 1001, 'The development of electric lights has brought many advantages to lighting in dance performances. However, the use of such lights should be carefully regulated as they may pose problems if incorrectly used. For example, lights directly above the dancer\'s head will cause a shadow to fall upon the mouth of the dancer and cause the eyes to be shaded by the forehead. Footlights disturb the audience\'s view of the dancer\'s feet and disturb the eyes of the dancer. The lights should not fall onto the screen, as that will render the dancer\'s form dull. Spotlights must be used appropriately, held above the stage and to the sides. Floodlights provide adequate and balanced lighting, but must be tied in front of the stage in a stationary spot. If these rules are followed, the lighting will prove complimentary to the dance.', 5, 1, 4);
INSERT INTO `essay_qsn` (`essay_id`, `student_id`, `q_id`, `r_id`, `essay_cont`, `essay_score`, `essay_status`, `q_type`) VALUES
(1930, 386, 603, 1001, 'The temple in Simhachalam is in North-West India in the state of Andhra Pradesh. It is dedicated to Lord Narasimha. It is built on hills above the sea, which is explained through the Puranic story. In the Puranic story, the asura Hiranyakashapu was livid upon discovering his son Prahaladas devotion towards Lord Vishnu. He threw Prahalada into the sea and placed the hill on his head. Lord Narasimha rescued him by tilting the hill up so that Prahalada could escape. Later on, Prahalada found the shrine on the hills that he had been saved from. There is also a \"tribute pillar\" in the mukamandapam which is the pillar Lord Narasimha appeared from.', 4, 1, 4),
(1931, 386, 561, 1001, 'The Brigadeeshwara Temple dedicated to Lord Shiva is located in Tanjavur in Tamil Nadu. It is also known as Rajarajeeshwara Temple and Periya Kovil. During the 11th century, the great Raja Raja Chola I intended to engrave all 108 Karanas by Lord Shiva into the temple\'s famous 80-ton granite gopuram. However, the king went on a war journey and only 81 of the 108 Karanas were completed. In Sathara, all 108 Karanas are depicted in a shrine known as Uthara Chidambaram. The dance festival in the temple premisis includes a variety of artists- dancer and mucisians- from all abroad India. In September 2010, to mark the millennial anniversary of the temple, 1000 dancers from all over the world participated in a performance at the temple.', 4, 1, 4),
(1932, 386, 601, 1001, 'Charis are defined as moving the feet, shanks and hips simultaneously. Charis constitute of a system, as in they connect multiple limbs. The movement with a single foot is called a Chari. Charis have various purposes. They can be used to perform war-like actions, such as releasing missiles or fighting. The Charis are also used in theatrical representation. The rules of Charis must be followed in dance, ordinary movements, and fights on stage.\r\n\r\nAs per the Natyashastra, the word Chari has come from the root, Char, meaning movement. Charis are of 32 kinds, 16 belong to the Bhoumi Chari variety, and the other 16 belong to the Akashiki Chari variety. Charis are employed for the occupation of space, where the extended movement of the legs, toes, and other parts below the waist, are included. Thus, Chari is a basic movement of the body below the waist.\r\n\r\nIn the Bhoumi Charis, the movement of the body is so beautiful and graceful that at no time do the two feet lose contact with the ground. In the Akashiki Chari, only one leg will be in constant contact with the ground or in alternative contact with the ground, while the other leg will always be above the ground.\r\n\r\nBhoumi Charis are extensively earthly in nature, hence they are soft and sober. However, Akashiki Charis have extended movement in the space above the ground, and so their nature is very expressive and energetic.\r\n\r\nThe Natyashastra describes 16 Bhaumi Charis. These are as follows:\r\n\r\nSamapada - when the feet are close together, with the nails of the toes meeting.\r\nSthitavarta - one Agratalasancara foot is drawn up to cross the other foot, and is repeated on the other side\r\nSakatasya - The body is held upright, one Agratalasancara foot is stretched outward and the chest is in Udvahita\r\nAdhayrdhika - the left foot is at the back of the right toe, which is drawn away\r\nChasagati - the right foot is put forward and then drawn back, and the left foot is drawn back then put forward\r\nVicyava - Separating the feet from the Samapada position and striking the ground with their forepart\r\nEdakakridita - jumping up and down with the Talasancara feet\r\nBaddha - the sideways movement of the thighs when the two shanks to be slightly bent and the thigh turned up\r\nUrudvrtta - the heel of a Talasancara foot is placed outwards, one of the shanks to be slightly bent and the thigh turned up\r\nAddita - one Agratalasanchara foot rubbing against the forepart or the back of another foot\r\nUtsyandita - the two feet to move gradually sideways in the manner of rechaka\r\nKanita - a mushti hand held at the chest and another hand moved around, and the feet in Talasancara\r\nSyandita - one foot put forward five talas away from the other\r\nApasyandita - another foor put forward five talas away from the other\r\nSamotsaritamatalli - going back with a circular movement and the feet in Talasanchara, crossing the shanks\r\nMattali - going back with a circular movemnt and the hands in Udvesthita and motionless\r\n\r\n\r\nThere are 16 Akasiki Charis as per Natyashastra, as follows:\r\n\r\nAtikranta - a Kunchita foot thrown up, put forward, and brought upon the ground\r\nApakranta - the valana posture of the two thighs, a Kunchita foot raised and thrown down to the side\r\nParsvakranta - one foot in Kunchita and another thrown up and brought near the sides\r\nUrdhvajanu - throwing up a Kunchita foot with its knee brought up to chest level, repeated on the other leg\r\nSuchi - a Kunchita foot thrown up and brought above the knee of the remaining foot anf then placed on its forepart\r\nNupurapadika - one Anchita foot raised up and then taken behind the other foot and quickly brought to the ground\r\nDolapada - one Kunchita foot thrown up and moved from side to side and then caused to fall on the ground as an Anchita foot\r\nAkshipta - one Kunchita foot thrown up and then placing it quickly on an Anchita foot by crossing the shank of the remaining leg.\r\nAviddha - One kunchita foot from the Svastika position stretching and falling on the ground quickly as an Anchita foot\r\nUdvrtta - the Kunchita foot of the Avvidha Chari taken round the thigh of the remaining leg and thrown up and then brought to the ground.\r\nVidhyudbhranta - one foot turned to the back and after touching its top part to be stretched and the head moved in a circle\r\nAlata - one foot stretched backwards and then put in and afterwards brough onto its heel\r\nBhujangastrasita - one Kunchita foot thrown up and the waist and the knee being turned round and the thigh of the remainging foot to be turned round too\r\nHarinapluta - te foot in the Atikranta Chari to be brought to the ground after a jump and the shank of an Anchita foot to be put in the Ksipta posture\r\nDandapada - the foot in the Nupurapadika Chari to be stretched and quickly to turn\r\nBhramari - the foot in the Atikranta Chari to be thrown up and the entire body turned round then then the second foot to be moved onto its sole\r\n\r\n', 4, 1, 4),
(1933, 386, 560, 1001, 'Sculpture and dance are the twins of Mother Art. They embrace on another in the shadow of religion and have grown in India. The various ancient dance postures engraved in sculpture have been taken as the grammar of dance. Many great scholars and exponents have written books on Bharathanatyam, based on their study of these sculptures. The sculptures not only help in researches and studies, but are also valuable ancient treasures of the temples. These temples were not just a place of worship, but were a place of social gathering, education, and celebration. Thus, art and craft flourished in these temples and many art performances in music, dance, and drama were carried out within these temples. The sculptures in the temple exhibit a beauty that can only be created by those familiar with the art of both dancing and sculpting.', 4, 1, 4),
(1934, 386, 559, 1001, 'A Chari is defined as the simultaneous movement of the feet, shank, and hips. The movement of a single foot at a time is called a Chari. Dance, movements, release of missiles, and fighting are all made with Charis. Charis also are included in theatrical representation. The rules of the charis are used in dance, ordinary movements, and fights on stage.\r\n\r\n\r\nIn Bhaumi Chari, also known as the Earthly Charis, the feet are on the ground completely. The Bhaumi Charis are masuline in features and are used for rhythmic movement. The Earthly Charis are normally used in personal combat as well as in Karanas. The following verse from the Natyashastra lists the 16 Bhoumi Charis.\r\n\r\nSamapada Sthithaavarthaa Shakataasya Thathaivacha |\r\nAdhyarthika Caasagatir Vicyava ca Thathapara ||\r\nEdakakriditha Bhaddha Urudvritta ThathAdditha |\r\nUtsyanditha ca Jaanitha Syanditha caApasyanditha ||\r\nSamotsaritha-mattali Mattali Chethi Shodasha |\r\n\r\n\r\nIn the Akasiki Charis, also known as the Aerial Charis, one or both feet are raised. They are mostly delicate movements of footwork. They are applied in the use of weapons such as the bow and the thunderbolt. The following verse from the Natyashastra lists the 16 Akasiki Charis.\r\n\r\nAtikrantah Apakrantha Parsvakrantha Thathaivacha | \r\nUrdhvajaanuscha Suchi ca thatha Nupurapaadika || \r\nDholapada ThathAkshipta Aviddho Udvrtta Shamshithe | \r\nVidhydbhrantah Aalatha cha Bhijangatasita Thatha || \r\nMrigaplutha ca Dhandha ca Bramari Chethi Shodasha |', 4, 1, 4),
(1935, 386, 562, 1001, 'The role of orchestra in a dance recital is significant. Bharathanatyam follow the Carnatic style of music from South India. The musicians who accompany dancers are as follows:\r\n\r\n\r\n1) Nattuvanar\r\n\r\nA Nattuvanar is usually the guru of the dancer. He or she plays the major role and is the conductor of the dance recital. They lead the entire orchestra and control the rhythm, resulting in complete harmony between the dancer and the orchestra. The Nattuvanar plays the talam, a small metallic cymbal. The Nattuvanar also vocalizes the solkattus of the dance.\r\n\r\n\r\n2) Mridangist\r\n\r\nThe Mridangist is the precautional accompaniment of the dancer. The mridgam is made of wood, with animal hide stretched over the ends in order the create sound from the hollow barrel. They enhance the dancer\'s footwork and provide support to the laya.\r\n\r\n\r\n3) Flautist\r\n\r\nThe flute is a wind instrument made of bamboo. It involves elaborate finger and blowing techniques. It enhances the music through mellifluous sound and haunting beauty, providing support to the vocalist and enhancing emotion brought forward by the dancer.\r\n\r\n4) Vainika\r\n\r\nThe Veena from South India is also called the Saraswati Veena and is made of wood. It is a fretted plucked string instrument. The Veena is both melodic and rhythmic, aiding in both the musical aspect brought by wood and string instruments and the rhythmic aspects of the cymbals and drum.\r\n\r\n5) Violinist\r\n\r\nThe violin is a non-fretted and inverted bowed string instrument originally used for Western classical music. However, it was adopted into Carnatic music and is a staple in the orchestral line-up for a dance performance. It provides music to augment the singer\'s voice and supplies music during Sanchari bhava.\r\n\r\n6) Tampura\r\n\r\nThe Tampura, also known as the drone, is a string instrument used to sound the pitch, or shruthi. It is played throughout the concert in order to provide a basis of harmony to the entire orchestra. ', 5, 1, 4),
(1936, 386, 602, 1001, 'The development of electric lights has brought many advantages to lighting in dance performances. However, the use of such lights should be carefully regulated as they may pose problems if incorrectly used. For example, lights directly above the dancer\'s head will cause a shadow to fall from the nose upon the mouth of the dancer and cause the eyes to be shaded by the brow bone. Footlights disturb the audience\'s view of the dancer\'s feet and disturb the eyes of the dancer. There are two types of modern lights that can be used- spotlight and floodlight. These lights should not fall onto the screen, as that will render the dancer\'s form dull. Spotlights must be used appropriately, held above the stage and to the sides. Floodlights provide adequate and balanced lighting, but must be tied in front of the stage in a stationary spot. If these rules are followed, the lighting will prove complimentary to the dance.', 4, 1, 4),
