(1960, 920, 263, 1002, 'South Indian Classical Dance is called Bharatanatyam, which is termed as traditional and cultural treasure of India. Sage Bharata wrote Natyasastra. BHaratanatyam can project all different aspects, including religion.  Other forms include: Kathak, Kuchupudi, and Odissi. ', 3, 1, 4),
(1961, 920, 262, 1002, 'Abinaya Darpana is a book written by Nandhikeshvara. Abhinaya is the art of communication. Classified into four types: Angika, Vacika, Aharya and Sathvika. Abinaya is understood as expression.', 4, 1, 4),
