(1983, 867, 257, 1005, 'Qualities of Danseuse=City of cosmic dancer,Qualities of a Percussionist=nimble with fingers,Qualities of a Dancer=steady and balanced in performance,Qualities of a Nattuvanar=Able to utter accurately each rhythmic sequence,Qualities of a Guru=Humble without the arrogance of knowledge,Qualities of a Singer=learned in the marga and desi styles of music,Villadavu=the body arches like a bow,Mandiadavu=Dancer sits all the way down with knees bent,Marthitha Adavu=Hands and Body make a full swing front and sideways,Kuththa Adavu=Dancer jumps low with toes firmly rooted on the floor', 10, 1, 5),
(1984, 867, 260, 1005, 'The dance which was danced in front of the Chariot of the Kings who had won the battle was called \"Muntherkuravai\". It was the privilege of the chivalrous men to perform in front of the chariot of the king. The dancers identify themselves as the descendants of the cowherds who were under the protection of Lord Krishna. They dance this to the accompaniment of the musical instrument Urumi, which is used exclusively for this purpose. The legendary belief is that this dance of the Devas originated to appease the Rudra Tandavam of Lord Shiva. Hence it is rightly termed as Devara Attam. Nandi is supposed to have provided the accompaniment to this dance.', 4, 1, 4),
(1985, 867, 259, 1005, 'The one who sang songs for dance were called \"Thoriya Madanthai\".  The \"Thalaikol\" was a 7 hand span length. It was made of bamboo and was studied with gems. There were golden knots in between. At the beginning of Indra Vizha, a festival, puja was done  to this. The stick was then given to the royal elephant and was taken for a procession along with the King who rode along with his ministers. It was then given to the dance teacher who was standing on the chariot. He would receive it and keep it at the Arangam, the performance stage. The lady dancer who received this was called \"ThalaiKol\". The Nattuvanar was called \"Thalaikol Asan\". The one who sang songs for dance was called \"Thoriya Madanthai\".', 4, 1, 4),
(1986, 867, 263, 1005, 'Dances in India can be classified into two types: Classical and Folk form. The various South Indian classical forms are: Bharatanatyam, Mohiniattam, Kuchipudi, etc\r\n\r\nBharatanatyam is a form of South Indian Classical dance which can be termed as traditional and classical treasure of India and marks its evolution thousands of years back when Sage Bharata wrote the \"Natyasastra\". It takes its roots from South India which is said to be the abode of major temples and magnanimous Kings.\r\n\r\nVarious successive south Indian dynasties, from the Pallavas and Cholas (6th to 9th, and 10th to 14th centuries) to the Andhra kings of Andhra and Tamilnad, and the Maratha rulers of Tanjore (who reigned into the 19th century), contributed some measure of patronage to this dance art. And another line of dance history in the courts can be traced from \"Kashmir to Malwa and Sourashtra and then to Karnataka, Andhra and Tamilnad.\"\r\n\r\nIn the ninth and tenth centuries, South India witnessed a sudden spurt of temple building which brought with it a comparable increase of interest in the temple arts. The class of musicians and dancers known as devadasis (\"servants of god\") enjoyed high status and prosperity at this time and were encouraged in their art (Dasi-attam). \"There is hardly a Chola temple and Chola inscription which does not refer to the temple dancers, some of the more distinguished among them even being mentioned by name.\" A Tanjore inscription commissioned in 1004 A.D. by the Chola king Rajaraja refers to four hundred devadasis who were attached to the Great Temple, received free living quarters on four neighboring streets, and were allowed tax-free land out of the temple endowment. \r\n\r\nThe next well-documented period of dance history is far more recent. In the first half of the 19th century the dance tradition was revitalized and defined anew through the contributions of four talented brothers (known today as the Tanjore Quartet): Chinniah, Sivanandam, Ponniah and Vadivelu. By coordinating their diverse talents, the four managed to organize all the basic dance movements of pure dance into a progressive series of lessons [adavu chapters]. Each adavu (basic unit of motion) was taught in systematic order and then combined with others to produce choreographed sequences based upon the rhythmic contour of a musical composition. In addition the brothers composed new music specifically for the dance, and introduced a different sequence of items which integrated the various aspects of dance and music into a carefully coordinated, aesthetically sound progression. This infusion of creative energy marks the early 19th century as one of the most innovative periods in the history of Indian dance. ', 4, 1, 4),
(1987, 867, 262, 1005, 'The Abhinaya Darpana was written by \"Nandikesvara\" presumably between 3rd and 4th century AD. Abhinaya Darpana\'s script is in Telugu and it is generally believed that Nandikesvara hailed from Andhra Pradesh. This book consists of 324 slokas in a single chapter. Unlike the Natyasastra, the Abhinaya Darpana predominantly deals with the features of head, eyes, neck, hand gestures representing Gods, Desavtaras, castes, religions, etc. and the mandalas, utplavanas, bhramaris, caris, and gatis employed in dance. All South Indian dance forms like Kuchipudi and Bharatanatyam follow this text extensively.\r\n\r\n', 4, 1, 4),
(1988, 867, 261, 1005, 'The dances which are danced in the back of the Chariot of the Kings who won the battles are called \"Pintherkuravai\". Devarattam is a pure folk dance still preserved by the descendants of Veerapandiya Kattabomman dynasty at Kodangipatti in Madurai District. It was actually performed once a year near the temple and that too restricted to that community alone. Folklore research scholars have found that Devaraattam is a combination of ancient muntherkuravai and pintherkuravai.', 4, 1, 4),
(1989, 867, 258, 1005, 'The Nattuvanar is called \"Thalaikol Asan\". The Nattuvanar is an expert musician who sings and plays the cymbals and conducts the whole dance recital.\r\n\r\nThe Arangetrams which took place in the King\'s court, the Kutthi, the danseuse would receive gold and gems as a reward and a title \"Thalaikol\". This Thalaikol was of a 7 hand span length. It was made of bamboo and was studded with gems. There were golden knots in between. At the beginning of Indra Visa, a festival, puja was done to this. The stick was then given to the royal elephant and was taken for a procession along with the King who rode along with his ministers. Its was then given to the dance teacher who was standing on the chariot. He would receive it and keep it at the Arangam, the performance stage. The lady dancer who received this was called \"Thalaikol\". The Nattuvanar was called \"Thalaikol Asan\" The one who sang songs for dance was called \"Thoriya Madanthai\". \r\n\r\nNATTUVANGAM is a Tamil word i.e. Natta + Angam. Natta means dancer or Dance Performance and Angam means body or main operating or controlling centre. The combination of this two is called Nattuvangam. In other words a Dancer for presenting dance with aesthetic effect always tries to keep link with Nattuvangam. This effort by a dancer brings harmony for total attraction which ultimately leaves lasting effect in the mind audience. A good Nattuvangam is recognised by qualities like, melodious singing giving aesthetic effect to valuable meaning of words coming in song, keeping link with calculative and time bound rhythm, having soft and hard touch understanding in `sollukattu\' and creating harmony with expression by dancer through eyes and body languages and also powerful footwork with attractive choreography. Thus all such qualities are to be developed by a good Nattuvanar, who plays the Nattuvangam (Tattakali-Stick and wooden block) with melodious singing, controlling the tempo (laya) of the dance and conducting the dance orchestra. This is a very difficult task. He should have the knowledge of Music, Percussion and Literature. A good Nattuvangam does not need separate singing, but Nattuvanar himself is capable to sing perfectly creating harmony with dance performance and he is also very clear about Bha - Ra - Ta, means Bhava, Raga and Tala. Now a days such Nattuvanars are rare. Engaging a separate singer for dance performance in addition to Nattuvangam is nothing but creating the dirtiest adulteration in best qualitative performance of dance. A good singer without knowledge of dance is always trying to show his singing ability only which is always found in distorted condition for best performance of dance as he is not having any understanding of dance. The role of Nattuvanar is found similar to role played by a director in Films. The Director is not much exposed before spectators but his role is considered to be most valuable and effective. In the same way a good dance performance is possible only by an effective role of Nattuvanar. His work is involved right from the primary stage to final stage i.e. upto performance so far as Training and Shaping of a dancer is concerned.', 5, 1, 4),
