(2011, 913, 258, 1006, 'Thalaikol was of a seven hand span length. It was made of bamboo and was studded with gems. There were golden knots in between. aAt the begining of Indira Vizha, puja was done to this, the stick was given to the royal elephant and was taken for a procession along with the king. It was then given to the dance teacher, and he would keep it in the Arangam. The lady dancer who received this was called Thalaikoli. The nattuvanar was called \"Thalaikolassan\".', 4, 1, 4),
(2012, 913, 263, 1006, 'South Indian classical dances take root from Southern India, which is set to be the abode of magnificent teples and magnanimous kings who hold major roles in providing luster. and prominence to the art form. Bharatanatyam has seen different eras and has been handled and presented with induvidual creative bakgrounds. Bharatanatyam can project all aspects like religion, sentimental values, yoga, science, myth, philosophy, and everyday today activity of every life form on earth by beatiful patterns and movements. ', 4, 1, 4),
(2013, 913, 262, 1006, 'Abhinaya Darpana is a sanskrit text by Nandikesvara, states that actors educate the audience by stimulating in them the latent possibility of an aesthetics. This interpretation is done by movement of the limbs and gestures(angikham), by voice and though meaningful words(vacikam), by attire and decorations and physical manifestations(sattvikam).', 4, 1, 4),
