(2037, 911, 262, 1007, 'Written by Nandikesvara presumably beetween 3rd and 4th century AD. \r\nIt is written in Telugu and generally believed that Nandikesvara hailed from Andhrapradesh.\r\nConsists of 324 slokas in a single chapter.\r\nDeals with gestures of head, eyes, neck, hand gestures representing gods, Dasavataras, castes, relations etc. and the mandalas, utplavanas, bhramaris, caris, and gatis employed in dance.\r\nAll South Indian dance forms (Kuchipudi and Bharathanatyam) follow this text.', 4, 1, 4),
