(2049, 349, 638, 1013, 'According to the Natyasastra Abhyantara is when the head, the face, the hands, the chest, the hips, the thighs and the feet all equally share the expression in a graceful manner. They must be kept to the tempo and tala and have distinct words that are not harsh or hurried. Bahya is the opposite where everything is as one wills, irregular or incorrect. Abhyantara is within the rules while Bahys is outside the rules. Those without training or access to sastras employ only bhaya just immitating others.', 0, 0, 4),
(2050, 349, 636, 1013, 'Samanya abhinaya depends on words and their tone while sattva abhinaya depicts those words through emotions. An analogy is like when a perfumer buys various sweet smelling substances and concocts them into a homogeneous mixture that makes a wonderful perfume. In the same way a performer combines her acquired skills blending all the elements she is skilled at to give an excellent and balanced performance.', 0, 0, 4),
(2051, 349, 635, 1013, 'Samanya abhinaya is elaborated in great detail in the context of theater. it includes specific ways of using the voice and limbs forms the very basis of the Sanskrit theater tradition. If a firebrand is rotated a circle appears. In reality there is no circle but it appears to exist because of the skill of rotation. Samanya abhinaya is the coming together of each major and minor part of action so that the result of their combination is a unified whole like the image of an alatachakra', 0, 0, 4),
(2052, 349, 639, 1013, 'Bhararta, in the Natyashastra, lists some miscellaneous things and ideas and their representation in abhinaya specifically by angika abhinaya (bodily gestures). Such abhinayas is used to specifically depict ideas such as garlands and seasons. Garlands are shown by using arala hasta on the left shoulder and then gradually separating them. Autumn is conveyed with all the limbs relaxed, suggesting all quarters are clear and conveying various flowers can be seen. Winter is conveyed by contracting the body, by chattering teeth, sneezing, shaking head while crouching as if in cold. Spring is conveyed by gestures of rejoicing, enjoyment, blossoming of various flowers. Summer is conveyed by suggesting the hear of the ground, movements of fanning and wiping of sweat. Rainy season is conveyed by appropriate flowers, grass and presence of peacocks. By covering one\'s face with a cloth, dust storm or smoke can be indicated. With widened eyes and appearance of shock and fear, lightning, thunder, shooting stars can be conveyed.', 0, 0, 4),
(2053, 349, 637, 1013, 'A woman\'s desire will be seen in her eyes which are tearfully smiling, eyelids drooping and eyes slightly closed. When the cheeks are slightly reddened with drops of perspiration glistening and the body is thrilled, it is a sign of desire. A courtesan shows her desire by side long glances by attractive gestures, postures of the body, by touching her ornaments, by drawing designs on the ground with her toe and by tying her hair. A woman of noble birth reveals her love by speaking with her face downcast, replying softly with a smile, conceals her perspiration, and her lips throbbing with a look of dismay about her.', 0, 0, 4),
(2054, 349, 640, 1013, 'The natural posture of a man is vaishnava and that of a woman is either ayata or avahittha according to the Natyashastra. In contemperorary Bharatanatyam, swastika is often employed for depicting women while a simple samasthana with sama or trayasra pada is used for men. The gesture of male characters must be expressed boldly yet gracefully but for the females they should be delicately charming. For women the feet and hands should be graceful while for men it should be deliberate and firm. Man\'s happiness is depicted by hugging one\'s self and smiling eyes. Female\'s happiness is depicted by sudden thrill, closed eyes full of tears and happy attitude. In male, anger is depicted by upturning his eyes, breathing hard and his whole body shaking with agitation. In female, her eyes arefilled with tears, her chin trembles, lips quiver, eyebrows are knit, discards her ornaments and assumes the ayata position. Man breathes deeply and silently and sighs to express sorrow. A woman weeps, falls on the floor,  and beat her breast to express sorrow. Fear in a man is depicted by looking restless and by dropping woman. A woman shows fear by shaking in her limbs, looking this side and that and clinging to anyone nearby.', 0, 0, 4),
(2055, 349, 709, 1016, 'Sringara means love and beauty. It is an emotion to show love between friends, mother and child, teacher and disciple, or love for God. The most popular sringara is depicted between a man and a woman. In bharatanatyam it is mostly used to depict the love for God. Sringara comes from the sthayi bhava which is the basic emotion emotion of love, or rati. Sringara is of two kinds. One is Sambhoga, love in union, and the other is Vipralambha, love in seperation. While depicting Sringara the chari should be easy and graceful.', 0, 0, 4),
(2056, 349, 708, 1016, 'The moods and emotions of nayaka are classified into Dheerodaatta, Dheeroddhata, Dheeralalita, and Dheerashanta. Dheerodaatta means brave, steady, high, and noble like Lord Rama. Dheeroddhata  means brave, steady, proud, conceited and arrogant like Ravana. Dheeralalita means brave, playing and amorous like how Vatsaraj neglets his duties while he is immersed in love with his lady. Dheerashanta means peace, and tranquility like Buddha. The other classsifications of a nayaka consists of Pati, which means married and faithful to his wife, Upapati, which means married but in love with another women, and Vaisika, which means one who pays and enjoys women. Some further classifications are Anukoola, which means faithful to his wife like Lord Rama, Dakshina, which means loves all his wives like Arjuna, Drishta, which means when rejected he pleads to be accepted by his woman such as Vaali, and Shatha, which means the deitiful one such as Lord Krishna. The combination of Sringara and Bhakti are only present when depicting the relationship between a devotee and God which falls outside the nayika and nayaka. There are varanams, jawalis and padams which are entirely about Bhakti describing the beauty, splendor and grace of divinity. Sakhi Prana is one of the pieces I have performed where the nayika adresses her beloved (the divine being) from a human level.', 0, 0, 4),
(2057, 349, 707, 1016, 'The eight kinds of Nayikas are:\r\n-Abhisarika which means boldly going out to meet her lover\r\n-Kalahantarita which means regretting in quarelling with her lover resulting in separation\r\n-Khandita which means angry with her lover for causing disappointment\r\n-Proshitapathika which means suffering in the absence of her beloved (a long journey)\r\n-Swandheenapathika which means proud of her husband\'s love and loyalty\r\n-Vasakasajika which means preparing for the arrival of her beloved\r\n-Virahotkanitha which means separated from her lover are yearning for reunion\r\n-Vipralabdha which means disappointed that her lover had not turned up at the tryst as he promised\r\n', 0, 0, 4),
(2058, 349, 705, 1016, 'The four vrittis are Bharati, Satvati, Kaisiki, and Aarabhati. Bharati is a style where predominance is given to speeches. It is employed only by male actors who announce their own names. Satvati is endowed with the quality of satva where there is good behavior and exuberance of joy and absences of shoka. The abhinaya depicts speech, gestures and episodes with vigourous words. There is very little karuna or sringara rasa. Veera, adbhuta and raudra rasas are predominant showing that the characters are bold and constantly challenging each other. Kaisiki Vritti artists are usually women wearing charming and colorful costumes. There is plenty of dancing, music, stories of love and enjoyment. The main emotions that are depicted are love and humour. Aarabhati vritti depicts daring in the form of fraud, bragging, deceit and etc. There would be falling, jumping, crossing, magic and many types of conjuring during the depiction. Bharati is born from the rigveda which emphasizes the hymns and chants. Satvati is born from Yajurveda which emphasizes the conduct of rites. Kaisiki is born from Samaveda whihc tells the way the hymns have to be sung and how gestures must be used during sacrifices. Arabathi is born from Yajurveda which deals with black magic and etc.', 0, 0, 4),
(2059, 349, 710, 1016, 'Adhbuta means wonder, curiosity and surprise. it is the awe that one feels when they come across something divine and supernatural, some power or beauty that is remarkable, never seen or imagined before. Adhbuta is the curiosity regarding the creation of world and its wonders, astonishment caused by seeing something magical. It is the appreciation that goes beyond the routine. Surprise is the sthayi bhava of Adhbuta rasa. It is created within by the sight of divine persons, sudden achievement of what is desired and it is shown through distended eyes, unwinking steady glaces, thrill, tears and word of appreciation. The vyabhichari bhava is being stunned, shedding tears, stammering, and excitement. Adhbuta rasa is to be acted by crying, praising, trembling, stammering, and etc.', 0, 0, 4),
(2060, 349, 706, 1016, 'Dharmi means a play which can be performed using realistic actions or it can be stylized and dramatic. The former is called lokadharmi and the latter is called natyadharmi. Lokadharmi is a play in which men and women in their own nature behave and act naturally. Natyadharmi is a play in which speech is artificial and exaggerated, actions are unusually unusual and gestures are grateful. In natyadharmi voice and costumes are not from common ordinary use. When you invest characters with emotions it becomes natyadharmi. The main stay of abhinaya in dance is natyadharmi.', 0, 0, 4),
(2061, 349, 711, 1016, 'Raudra means anger. It is outrage over audacious behavior and disobedience, fury caused by an offense, rage evoked by disrespect, anger over injustice. Raudra also contains divine fury and fury of nature with unexpected calamities and natural disasters. Its sthayi bhava is krodha. This emotion is connected with evil spirits, rakshashas, and people with violent temper. its Vibhava are anger, boldness, abuse, insults, lies, harsh words and etc. It is expressed by beating, cutting, striking, dragging, attacking, and etc. Other expressive ways are widened eyes, knitted eyebrows, biting lips, rubbing the palms, puffing up the cheeks, etc. While depicting the anger of rakshashas, walk with feet raised high and spread them far apart.', 0, 0, 4),
(2062, 349, 712, 1016, 'Rasa Bhanga means disruption of aesthetic experience which is caused from over utilizing or under utilizing bhavas in dance. Depicting the emotion of love has various vibhava, anubhava, and vyabhichari bhava roles to play. The selection and treatment of these depends on artist and choreographer. In vyabhichari bhava if suspicion or depression are overly shown the whole effort could get side tracked. So appropriateness is the main challenge. Beggining from stage decor, dance costumes, music to the actual choreography and execution needs to be carefully looked into and taken care of.', 0, 0, 4),
