(2073, 479, 492, 1019, 'Uras=Chest,Svastika=Arm is crossed in the chest region,Uru=Thighs,Prasarita=Arm movement stretched,Padmanabha=Lord Vishnu,Vaishaka=Sthana for men,Padmakosha=Asamyutha hastha,Bramari=Seven types,Ayata=Sthana for women,Paadachari=Eight types', 10, 1, 5),
(2074, 479, 496, 1019, 'In simplest terms, Angika Abhinaya is expression through movements and gestures. However, it may be categorized based on a few different qualities. Classifying Angika Abhinaya by the limbs that are used to express is one main method. Angas, Pratyangas, and Upangas are the three branches of limb movements. The second way that abhinaya can be classified is through the methods of expressing: Mukhaja, Sarira, and Ceshtakritha Abhinaya. Abhinaya can also be categorized into Shaka hastas, Ankura Hasta Prayoga, and Nritta.\r\n\r\nAngas are categorized as the six major limbs. These are the head, hands, chest, sides, waist, and feet. The movements of these parts are called Shiras (head), Uras (chest), Parsva (sides), Kati (waist), and Pada (feet) bhedas, as well as Hastas (hand gestures). Pratyangas are the postures of minor limbs, such as arms, shoulder blades, back, belly, thighs, and shank. Respectively, these movements are called Bahu, Skanda, Prstha, Jathara, Uru, and Jangha bedhas. Lastly, Upangas, or the movements of ancillary limbs are generally used to show fine or subtle expression with the eyes, eyebrows, pupils, nose, lips, cheeks, and chin. These delicate movements are called Netra, Bhru, Tara, Nasika, Adhara, Kapola, and Cibuka bhedas.\r\n\r\nThe different techniques of expressing Angika Abhinaya are Mukhaja, Sarira, and Ceshtakritha Abhinaya. Mukhaja Abhinaya, as the name suggests, is expression using the face. The most important element of Mukhaja Abhinaya is the used of eyes. As the word Sarira means body in Sanskrit, Sarira Abhinaya deals with the usage of the various limbs in the body to express or emote. Lastly, Ceshtakritha Abhinaya can be thought of as a combination of Mukhaja and Sarira Abhinaya. It is expression throughout the entire body. It has two aspects: Nritta, or pure footwork, and Gati Prachara, or expressive movements. Gati Prachara can be further split into Stithi (posture) and Gati (movement). \r\n\r\nAngika Abhinaya can also be divided into Shaka Hastas, Ankura Hasta Prayoga, and Nritta. Shaka, meaning branch, hastas encompass Samyutha, Asamyutha, and Nritta Hastas. Ankura Hasta Prayoga also has three subcategories: Hasta Pracara, Hasta Recaka, and Hasta Karana. Nritta is pure footwork and is the non-narrative aspect of dance.', 5, 1, 4),
(2075, 479, 497, 1019, 'Vaisnavam samapadam cha vaishakam mandalam tatha\r\nPrathyaleedam tathaleedam sthananyethani shanrunam\r\n\r\nThe six Sthanas for men described in the sloka above are Vaisnava, Samapada, Vaishaka, Mandala, Alidha, and Pratyalidha. Each of these stances has a presiding deity. Described below are the Sthanas for two principal deities: Vishnu and Skanda. Vaisnava is the Sthana used to portray Lord Vishnu. In this stance, the feet are placed two and a half talas apart with toes pointing sideways. The shank is bent in Anchita position. Next, in Vaishaka, the feet are kept distant at three and a half talas distance and are pointing sideways. The thighs do not move at all. This posture is used to show Skanda.', 4, 1, 4),
(2076, 479, 493, 1019, 'Ayatham chavahithamcha\r\nAshwakrantha mathapicha\r\n\r\nThe seven Sthanas for women are Ayata, Avahitham, Asvakranta, Gatagatam, Valitam, Motitam, and Vinivrtam.\r\n\r\n1. Ayata: The right foot is in Sama position and the left foot is in Tryasra. The right hip is raised.\r\n2. Avahitam: ayata is done on the opposite side (with the left foot in Sama position, the right foot in Tryasra, and the left hip raised).\r\n3. Asvakranta: One foot is raised slightly off the ground and the other is on the ground only with the front of the foot. This is the stance leading Suchi or Aviddha Chari.\r\n4. Gatagatam: The dancer is about the step forward. This position is between staying put and moving forward.\r\n5. Valitam: The body is twisted in a certain direction. The foot on the side that the body is twisted is touching the ground with the small toe. The other foot is touching the ground with the big toe. This posture is often associated with looking in desire.\r\n6. Motitam: One foot is in Sama position, and the other in Kunchita, but this foot is barely touching the ground with the toes. The hands are in Karkata hasta. Motitam is associated with the stages of love.\r\n7. Vinivrtam: Motitam is done in the back on the opposide side.', 4, 1, 4),
(2077, 479, 494, 1019, 'Kati bhedas are the movements of the hips. They are rarely used in Bharatanatyam and are more prominently used in Odissi and Kuchipudi. There are five Kati bhedas:\r\n\r\n1. Chinna: The hip is moved to one side. Chinna is used to show confusion, turning around, exercise, or looking back.\r\n2. Nivrtta: The hip is moved is moved to the other side. This is used to depict turning away forward.\r\n3. Recita: Both hips are used to move in a circular motion. Rechita is used to portray generally wandering.\r\n4. Udvahita: Both hips are raised alternately. This movement shows movements of a stout person and seductive movements.\r\n5. Kampita: The hips are raised alternately while moving feet front and back. Kampita portrays the movement of a hunchback or an inferior person.', 4, 1, 4),
(2078, 479, 537, 1019, 'I have already answered this question. Please see answer to question #4.', 0, 0, 4),
(2079, 479, 495, 1019, 'There are 13 Pada bedhas, or foot movements. These can be further divided into two subcategories: Margi Pada bedhas and Desi Pada bedhas. There are six Margi Pada bedhas and seven Desi Pada bedhas, which are described below:\r\n\r\nMargi Pada bedhas:\r\n1. Samam: the feet are in natural position (straight with about an inch gap between the feet)\r\n2. Anjitham: the leg is stretched sideways or front with the heel touching the ground and the toes pointing diagonally upwards\r\n3. Kunjitham: the toes are bent on the ground while the heel is kept up\r\n4. Soochi: the big toe of one foot is pointing on the ground, and the rest of the foot is raised off the ground\r\n5. Agratalasancharam: alternating between Kunjitham and keeping feet flat in Aramandi position\r\n6. Uthkattitham: tapping heel on the ground without moving the rest of the foot\r\n\r\nDesi Pada bedhas:\r\n1. Thatitham: tapping toes on the ground without moving the rest of the foot\r\n2. Kadithothsedham: alternately performing Agratalasancharam and Uthkatthitham\r\n3. Kattitham: touching the side of the foot closer to the small toe on the ground with the other side facing upwards\r\n4. Mardhitham: sliding both feet alternately from one side to another\r\n5. Akragam: Sliding both feet in a zig-zag path in both directions\r\n6. Parshnigam: Alternately striking both heels on the ground repeatedly without touching any other part of the foot on the ground', 4, 1, 4);
