(2080, 479, 538, 1019, 'Sanchari Bhava Drishti are eye movements used to depict temporary states of emotion. There are 20 glances into which Sanchari Bhava Drishti can be categorized into, each of which is discussed briefly below.\r\n\r\nShunya is a vacant expression, and Malina is used to show impurity. Next, Shranta can be used to show drooping eyes because of exhaustion. Glana (or Mlana) is very similar to Shranta. Lajjanvita and Trasta can both be used to show shyness or bashfulness. Shankita is a doubtful or skeptical glance, and Vishanna depicts depression or dejection. In contrast, Mukula is used to show taking pleasure in small or simple things. Kunchita is the glance in which the pupils are sunken and eyelashes are curved to give the impression of curved eyes. Abhitapta shows distress or sudden pain, and Jimha is the movement of the eyes from side to side in an obscure manner. Lalita is a graceful and sweet glance, while Vitarkita is used to show someone pondering or thinking. Ardhamukula is very similar to Mukula, except the eyelids half closed in this glance. In Vibhranta, the eyes are constantly in motion, and Vipluta is an even faster motion. They are used to show distraction or scattering. Akekara is used to show squinting, thus explaining the half closed eyelids. Lastly, Vikosha is simply a glance with wide open, unblinking eyes, but the pupils are not completely still.', 4, 1, 4),
(2081, 479, 536, 1019, 'Lasyam is another name for Sukumara prayoga. This term was coined by Sage Bharata in the Natyashastra. Similarly, another name for Thandava is Uthama prayoga. Since Lasyam is a delicate and gentle way of dancing and Thandava is more manly, these terms are well suited for the nature of these styles of dancing. Lasyam is a more gently way of performing Thandavam. It uses the same steps and other technical aspects as Thandavam, but the way of dancing these steps makes the difference between Sukumara prayoga and Uthama prayoga. In the same way that Lord Shiva asked Sage Thandu to produce Thandavam, Goddess Parvathi instructed Usa, daughter of a king named Banasura, to create Lasyam. Grace, elegance, and purity of the mind and soul are essential qualities for Lasyam.', 4, 1, 4),
