(2092, 479, 564, 1020, 'Rakudi=Ornament for head,Triangular playhouse=Tryasra,Salangai=Feet ornament,Konarak temple=caves Sun god,Ajanta and Ellora=Buddhist paintings,Mridangam=Percussive accompaniment,Chidambaram=Nataraja,Elephanta=Trimurthi,Utkshiptam=When heels are raised,Yakshagana=Karnataka', 10, 1, 5),
(2093, 479, 561, 1020, 'The Brihadeeswara temple in Thanjavur was built in the eleventh century. With walls rising above 15 meters high, a 29 meter square base, and a soaring vimana, this grand temple was constructed from a single, 80 ton piece of granite. One of thie highlights of the Brihadeeswara temple in Thanjavur is the sculptures of the Karanas. However, these are unique because the set is not complete. During the construction of the temple, the architect, King Raja Raja Chola, intended to engrave all 108 karanas (by Lord Shiva) in the Gopura Vimanam of the temple. However, the king left for war before the project could be completed, and it was never finished. Thus, the speciality of the Karana statues at Brihadeeswara temple is that there only 81 were built out of the 108 karanas. Another significant aspect of Brihadeeswara temple on Bharatanatyam is the dance festival, which attracts dancers and musicians from around the world. On a more recent note, in 2010, Dr. Padma Subrahmanyam, the great Bharatanatyam exponent, gave a live performance in the temple with 1000 dancers on the occasion of the 1000th year of Brihadeeswara temple\'s construction.', 5, 1, 4),
(2094, 479, 602, 1020, 'With modern technology, stage lights have become of major importance, but there are also several issues connected with their incorrect use. There are two types of stage lights: flood lights and spot lights. Flood lights spread evenly throughout the stage, while spot lights usually focus on a particular spot. If used correctly and in the appropriate places, spot lights add beauty to the dance recital. However, light should not fall straight on top of the head because shade from the nose will fall on the lips, and shade from the forehead will fall on the eyes, giving the face a sunken appearance. Light needs to fall directly in front of the dancer, and foot lights should be avoided. Additionally, lights should not fall directly on the screen because the dancer\'s figure will not look bright in comparison. Spot lights, if used, should be kept high up and to the sides. Flood lights should be tied at an angle in front of the center spot as opposed to straight ahead.', 5, 1, 4),
(2095, 479, 559, 1020, 'A Chari is a movement of the foot, shank, and hip simultaneously to transition from one pose or posture to another. If the movement involves only one leg, it is called a Chari, but if the dancer uses both legs for the motion, it is called a Karana. Further, a group of Karanas make up a Khanda and Khandas in triplets or quartets make up a Mandala. Charis have many uses in dance, including movement like releasing missiles, fighting, or histrionic representation. There are two types of Charis: Bhaumi (earthly) and Akasiki (aerial). In Bhaumi Charis, the feet are completely on the ground, while in Akasiki Charis, one or both feet are raised. Thus, Bhaumi Charis are inherently used for more rhythmic movements, and Akasiki Charis are used for delicate motions. Natyashastra and Abhinaya Darpana both describe Charis, but in different ways. While Natyashastra discusses 16 Bhaumi Charis and 16 Akasiki Charis. Abhinaya Darpana only includes 8 Charis without any classifications that are completely different from those listed in Natyashastra.\r\n\r\nThe Bhaumi Charis are Samapada, Sthitavarta, Sakatasya, Adhyardhika, Chasagati, Vicyava, Edakakridita, Baddha, Urudvrtta, Addita, Uttsyandita, Janita, Syandita, Apasyandita, Samotsaritamatalli, and Mattali. The Akasiki Charis are Atikranta, Apakranta, Parsvakranta, Urdhvajanu, Suchi, Nupurapadika, Dolapada, Akshipta, Avidda, Udvrtta, Vidyudbhranta, Alata, Bhujangatrasita, Harinipluta, Dandapada, and Bhramari.\r\n\r\nAn example of Bhaumi Chari is Edakakriditha, which is the action of jumping up and down with Talasanchara feet. Likewise, an example of Akasiki Chari is Bhujangatrasita, in which one Kunchita foot is thrown up, the waist and knee are turned around, and the thigh of the other foot is turned around.', 0, 0, 4),
(2096, 479, 560, 1020, 'Sculpture and dance are widely considered the twins of the mother art. For over two thousand years, the evolution of stone sculptures has remained uninterrupted. The contribution of the art of sculpting is found in rock cut cave temples, like those at Elephanta, Ajanta, and Ellora. In the eighth century, stone temples began to be built as places of worship and later began to serve other community purposes as well. By around the eleventh century, several temples\' exteriors were richly decorated with sculptures of dancers in many poses, musicians, elephants, and more. Focusing in on dance, it was important for a sculptor to know the dance postures that he carved. This is clearly seen through the accuracy and detail in the thousands of dance sculptures in temples throughout India.', 5, 1, 4),
(2097, 479, 562, 1020, 'The role of the orchestra in the Bharatanatyam concert is very important. The Nattuvanar, the conductor of the dance recital, plays a major role in the orchestra. He plays the nattuvangam, a small metallic cymbal, and plays the rhythmic beats to match the dancer\'s footwork. He also recites the sollukattu (rhythmic syllables) for the nritta sequences. The Nattuvanar is often times the guru. Next, the mridangam is an ancient percussion instrument from South India. The mridangist provides principal rhythmic accompaniment to the dancer during the concert. This enhances the dancer\'s footwork and closely follows the laya, or tempo, of the item.\r\n\r\nThe flute is a wind instrument made of bamboo. Through the adjustments in blowing strength and partial opening and closing of holes, playing the flute involve elaborate technique. The flute has a very unique quality that produces a melodious and pure sound. The veena is a plucked string instrument that involves using a plectrum to pluck the strings. The veena and flute both have several connections and symbolism in Hinduism. The violin is a string instrument made of hollow wood. It is played using a bow held in the right hand and the fingertips of the left hand. Together, the flute, veena, and violin provide melodious accompaniment to the singer, and add overall richness to the dance recital. Lastly, the tampura, or drone, is a string instrument that is used for shruthi. It is tuned to match the shruthi of the singer, and it provides a pleasing background pitch to ensure that all other members of the orchestra are in harmony with each other.', 5, 1, 4),
(2098, 479, 563, 1020, 'I have already answered this question. Please refer the answer for question #2.', 5, 1, 4),
(2099, 479, 603, 1020, 'Hiranyakashipu was an Asura whose son, Prahlada, was a great devotee of Lord Vishnu. Hiranyakashipu tried to mend the ways of his son, but in vain. Unable to stand his son\'s immense devotion, Hiranyakashipu made young Prahlada undergo many hardships. He made elephant trample over him and tried to poison him. However, every time, Lord Vishnu was there to protect his devotee. For example, Hiranyakashipu threw Prahlada into the sea and tried to throw a hill on his head, but Lord Vishnu tilted the hill so the young boy would not be hurt. This hill is said to be the very same hill as the one upon which the Simhachalam temple stands today. The form of Varaha Lakshmi Narasimha was assumed by Lord Vishnu upon the prayer of Prahlada, who wished to see both incarnations of the Lord, the one which had killed Hiranyaksha (Varaha) and the one which would kill Hiranyakashipu (Narasimha). Thus, the presiding deity of the Simhachalam temple, Varaha Lakshmi Narasimha, has the face of a boar, torso of a human, and tail of a lion.', 5, 1, 4),
