(2121, 938, 257, 1035, 'Qualities of Danseuse=steady and balanced in performance,Qualities of a Percussionist=learned in the marga and desi styles of music,Qualities of a Dancer=steady and balanced in performance,Qualities of a Nattuvanar=Able to utter accurately each rhythmic sequence,Qualities of a Guru=Humble without the arrogance of knowledge,Qualities of a Singer=learned in the marga and desi styles of music,Villadavu=the body arches like a bow,Mandiadavu=Dancer sits all the way down with knees bent,Marthitha Adavu=Hands and Body make a full swing front and sideways,Kuththa Adavu=Dancer jumps low with toes firmly rooted on the floor', 0, 0, 5),
(2122, 938, 297, 1035, 'Adavu is the basic unit of Bharathanatyam. It comprises of three components\r\n1. leg movements: It is the combination and coordination of movement of legs. Each adavu has different styles or forms of leg movements. It is different from but comparable to the charis mentioned in natyashastra.\r\n2 Nratta hastas/Hand gestures: It is the different hand gestures used to show the beauty of dance, they can be used to express various meaning in the dance. there are Asamyutha and samyutha and nratta hastas.\r\n3 Sthana; It is the position of body with respect to movement of legs and hands. Sthana is important aspect of the dance. it can be used to show various gods position.', 0, 0, 4),
(2123, 938, 269, 1035, 'Natyashasthra is the thousands of years old epic sanskrit text written by sage Bharatha. And this text contain 6000 cults and 36 chapters which describe everything required to know about the stage. This text also mentions about 108 karanas which are believed to be base to the recent Adavus. This was believed to be spread to different parts of the world by the 100 sons of sage bharatha. The Natyashastra mentions about cari means the coordinated leg, thighs, shanks movement, Hand gestures and Sthanakas in the dance. The 36 chapters in the natyshastra mentions about various topics about the dance, music, lyrics, songs, mandalas, karanas, percussion instruments and other important aspects of the Natya(Dramatized theme). Natya according to bharath is to communicate the expressions to the spectators. This epic text acts as a reference to the historians.', 0, 0, 4),
(2124, 938, 300, 1035, 'Bharathanatyam as the name depicts it involves Bhava, Raga and tala. It helps to express the dancers internal feeling to the audience by producing Rasa in the mind of audience. The dancer can take the audience soul to the spiritual pleasure or enjoyment by instilling the emotional bliss. Rasa is the aesthetic enjoyment of the dancers expression where in the audience mind is beyond the enjoyment of physical apperence of dancer. Bharathanatyam always helps the soul to attain the pure essence of Rasa. So the dancer should be in a well balanced mental state to produce such kind of aesthetic enjoyment.', 0, 0, 4),
(2125, 938, 339, 1035, 'Kinkini is made out of leather belt  and the kinkini is made with bronze or silver. It will have 3 rows tied with thread and it is wore to both the legs and they also say 3 rows in one leg and 4 rows in other leg. It should produce  a nice sound.', 0, 0, 4),
(2126, 938, 280, 1035, 'Namaskaram or salutation is done beginning of the dance. Where the dancer is going to express her gratitude and taking the blessing and asking for forgiveness from mother earth for stamping her and also taking blessings from Guru and God. It involves the dancer standing in samapada and hands in katakamukha at the chest level and striking the right foot first and then the left foot and changing the hands to shikara and stretching inward at the middle and bringing it to shoulders and then sitting in Muzumandi with changing the hands to chatura and touching the earth and asking for forgiveness and touching to eyes and then change the hands to Anjali at the chest level then at the forehead and then above the head for blessings from God.', 0, 0, 4),
(2127, 938, 259, 1035, 'Thoriya Mandathai is the singer who sings for dance. the koothi after learning the 64 arts will present their skills at the arangetram in th kings court and they will be awarded thalikol which is 7 hand span long and studded with gems and golden nots. This Talaikol is taken in procession with King and minsters by an kings elephant and they do puja and present it to the teacher, who will be standing in the chariot and the female dancer is called thalaikoli and the nattuvanar is called Thalai Asan.', 0, 0, 4),
(2128, 938, 346, 1035, 'Thattimettadavu: Thattu means to beat and mettu is strike. Here the dancer stands in araimandi and stamps the feet and lifts the heel and then stamp the heal without lifting the whole leg. Toes will be in contact with floor but the heal strikes. there are 5 variations of rhythmic syllabus used in this adavu.\r\n1Thakita which is 3 beats \r\n2Thakadhimi which is 4 beats\r\n3 Thaka thakita which is 5 beats\r\n4 thakita thakadimi which is 7 beat\r\n5.Takita thakadimi thakathakita which is 9 beats.', 0, 0, 4),
(2129, 938, 282, 1035, 'Shiksha arambam is the beginning of dance practice. Where the student will take oil bath and dress up. Adult will accompany the student to the teacher and they will bring beetle leaves, fruits, coconut and vasthra to the teacher. Where in the teacher applies kumkum to the forehead and bless the student. Then the student will take the blessing of god and elders. The student should have certain qualities to be an student or else the teacher can refuse to teach the dance. The student should also have well balanced mind and body. Then the first class starts with the salutation to the mother earth.', 0, 0, 4),
