(2150, 838, 394, 1036, 'Shakatam --=The Cart,Chaturam=The square,Vayu=Araalam in right hand and Ardhapathakam in left with left fingers facing the earth,Varuna=Pathakam in right hand and shikaram in left held near the chest sama padam,Murugan=Right hand in Trishoolam and left in shikaram held near the chest. Mandalam position with leg bent inwards,Agni=Tripathakam in right hand and kangulum in left held near the chest,Soorya=Kapitham in right hand and left in alapadmam. Feet in samam position,Chandra=pathakam,Vishnu=Both hands in tripathakam near the shoulders with palms facing outwards,Mahalakshmi=Both hands in kapitham near shoulders , body in asana  position', 0, 0, 5),
(2151, 838, 476, 1036, 'Shiro bedham - head movements: \r\nSamam - head looking staight \r\nUdvahitam - head tilted up\r\nAdhomukham - heaad down \r\nAlolitam - head goes in circular motion \r\nDhutam - head side to side \r\nKampitam - up and down \r\nParavrutam - turning head away\r\nUkshitam - turning head to one side and raising it\r\nParivartitam - moving head side to side in wave motion ', 0, 0, 4),
(2152, 838, 417, 1036, 'Tala is a time measure used in dance and music. Adavus in dance are sequenced according to tala. There are 108 talas in bharatamatyam. Talas comes to avartana, which one full cycle of counting. \r\nIt\'s very important for dance students to understand tala to properly doing dance', 0, 0, 4),
(2153, 838, 404, 1036, 'Kavithuvam - is a form of ritual dance which was performed to show devotion to a deity, it is a form of a prayer. ', 0, 0, 4),
(2154, 838, 403, 1036, 'Siro bhedas are head movements which consist of: \r\nSamam - heasd straight \r\nUdvahitam - head tilted up looking at celestial beings  \r\nAdhomukham - head down looking on the earth\r\nAlolitam - head in circular motions showing uncontoled laughter\r\nDhutam head moves side to side \r\nKampitam - up and down \r\nParavruttam head away in anger\r\nUtksitam - turning one side and raising \r\nParivartitam - side to side\r\n', 0, 0, 4),
(2155, 838, 430, 1036, 'Deva hastas: \r\nBrahma the creator - hamsasya and catura\r\nSiva the destroyer - tripatakam and mrigashirsam\r\nVishnu th protector - tripatakam \r\nSarasvati (learning) - kapitam and suci \r\nparvati - ardhachandra \r\nganesa - kapittam \r\n', 0, 0, 4),
(2156, 838, 421, 1036, 'Mandala - combination of charis \r\nChari - movement of a single foot at a time \r\nAngahar - longer sequences of movements \r\nSthanakas - postures', 0, 0, 4),
(2157, 838, 401, 1036, 'The hand movement of nine planets: \r\nSun, surya  - kapittam and alapadma\r\nmoon, candra - patakam and alapadma\r\nmercury, budha - musti and pataka \r\nJupiter, guru - both hands in shikhara \r\nSaturn, sani - shikara and trishura\r\nVenus, sukha - both hands in mushti', 0, 0, 4),
(2158, 838, 471, 1036, 'Samyuta hastas are done with both hands. \r\nSome of them are: \r\nAnjali (greeting) - both hands together by the chest\r\nKapotam (pigeon, conversing with guru) - hands together touching with tips of the fingers and the bottom and sides of the hands, forming a hollow space between the hands\r\nKartaka (crab, a group) - fingers of are interlocked \r\nSvastikam (crossed, crocodile) - both pataka hands crossed \r\nDolam (swing, obsession) - hands in pataka by the sides of the body, dangling \r\nPushpaputam (flower basket, offering) - hands together, only little fingers touching \r\nUtsanga (embrace) - both hands in mrigashirsa toching the opposite shoulders \r\nShivalingam - right hand in shikara is on the left pataka hand \r\nKatkavadhana (taking decision) - both hands in katakamukha crossed at the wrist \r\nKartarisvastika (tree) - both hands in kartarimukha crossed at the wrist\r\nShakatam (cart, demon) - both hands in bramara circling by the face\r\nShankam (conch) - right hand is holding a big finger of the left hand \r\nCakra (Lord Vishnu disc) - both ardhachandras tou\r\n', 0, 0, 4),
(2159, 3, 705, 1039, 'The four vrittis are bharati vritti, satvati vritti, kaisiki vritti, and arabhatti vritti. Bharati vritti is characterized by speeches taking predominance. It is only conducted by self announced male actors. Satvati vritti is characterized by the central tenet of sattva. This representation promulgates joy, vigor, and negates shoka. The abhinayas being influential are those of veera rasa, adhbuta, and raudra. Kaisiki vritti is one where the majority of artists are beautifully clad women, emphasizing love, and the joy that one gains from love. Sringara and hasya are characterized most. Arabhatti vritti is where one can find audacious forms of malpractice, including deceit, illusion, and backstabbing. Each rasa has a different vritti associated with it. For instance, one could use the kaisiki vritti for love and humor, where one could also use arabhatti vritti for bhayanaka rasa. Bharati vritti could use karuna rasa, and kaisiki could use hasya. ', 0, 0, 4),
(2160, 3, 707, 1039, 'The eight kinds of nayikas are abhisarika, kalahantarita, khandita, proshitapathika, swadheenapathika, vasakasajjika, virahotkanthita, and vipralabdha. Abhisarika is a bold lover who ventures out to meet her lover. Kalahantarita is one who regrets arguing and separating with her lover. She displays this through signs of anxiety and stress. Khandita is one who is extremely disappointed in her lover, and shows signs of detachment and disinterest. Proshitapathika is suffering because of having to have been separated from her partner who is away on a trip, for which she waits, sleepless and afraid. Swadheenapathika is proud of her dear\'s loyalty, and who is the dominant partner in that her lover is quite devoted to her (i.e., Satyabama). Vasakasajjika is one who is decorating herself immensely to welcome her lover back. Virahotkanthita is separated and is yearning for her lover. Utkanthita would be seen when the nayika is waiting for her lover eagerly, who is late or absent. Being this causes her to be virahotkanthita. Vipralabdha is one who is tremendously disappointed because her lover has not come to her, and she shows signs of feeling a lack of self worth as a result. Three of these (swadheenapathika, vasakasajjika, and abhisarika) are cheerful, with lots of aharyam. However, the others are not, and are saddening. ', 0, 0, 4),
(2161, 3, 710, 1039, 'Adhbuta rasa is one that shows wonder or delight in astonishment. Aspects, such as vismaya, would characterize this. For instance, in the padam Devi Neeye Thunai, one feels the necessity to express adhbuta when devi appears to kill Mahishasura. Although this is more of an expression of veera by the actor, or the dancer, in this case, the onlooker would certainly have that expression. Another expression would be in where a deva reveals his true identity to the king Mahabali, where Mahabali is humbled by having deva in his presence, and having had the opportunity to approach him. The padam, being a abhinaya based, expressive piece, would be one that has the ability to showcase a multitude of emotions. In so much as these pertain to the divine connection, there is an inevitable presence of adhbuta or wonder at some act or larger than life presence. Adhbuta rasa, therefore, is showed by the dancer through an expression of wide eyes, an aghast but wondrous expression, and a standstill moment, before trembling and standing in shocked delight. The padam shows this in this multitude of capacities. ', 0, 0, 4),
(2162, 3, 709, 1039, 'Sringara is a rasa that shows love, happiness, and that which appeals to the human mind. This evokes love and beauty, and it is apparent in the majority of dance pieces, since it makes itself present in almost all scenarios. One can experience it as the love between any two entities, including mother and child, devotee and deity, man and woman, friend and friend, etc. Therefore, since it is so prevalent, it is absolutely central to the entirety of the dance. The sthayi bhava of rati is displayed through it, and purity is characterized entirely by this rasa, through purity of intent, of actions, and of thought. One can go into detail regarding the love in union and separation that describes it, but, essentially, the sringara rasa is present in all capacities, and, thus, makes itself tremendously essential to the aesthetic pleasuring intent of a dance. The elegance required, the beauty of the steps involved, each are thus important. ', 0, 0, 4),
(2163, 3, 712, 1039, 'Rasa bhanga is the disproportion or the inappropriateness of the use of an expression within the aspect that is being conveyed in the dance. This is, in essence, a test and an opposing force to aucitya. For instance, if one were to consider aspects that factor into showing love, vyabhacharis, anubhavas, and vibhavas all play key roles. An imbalance of these, in that if one were to convey an excessive level of suspicion, for instance, could hinder with the conveyance of sringara, and instead make it confusing for the audience party. Aucitya and anaucitya must be considered when conducting any sort of choreography to carefully balance these and ensure the correct representation of rasas and avoid rasa bhanga. ', 0, 0, 4),
(2164, 3, 711, 1039, 'Raudra rasa is the expression of anger. The sthayi bhava of krodha takes precedence in this state. Vibhavas such as apamana, dharsana, and droha can be aspects of conveyance for this. It is one of the most influential and impactful forms of anger displayed through the dancer\'s actions and expressions. There is a necessity to be powerful and forceful in the display of this rasa. For instance, one can look towards characterizing rakshasas through the implementation of this. One would have wide eyes, clenched teeth, and puffed cheeks when showcasing this rasa, in order to be able to show the vigorous and heated nature of this. In essence, forms of evil and evil actions are displayed through this, in addition to Lord Narasimha\'s angry actions and similar raudra actions. ', 0, 0, 4),
(2165, 3, 708, 1039, 'The nayaka types are split into a multitude of manners, including relation to women, attitudes, and love. Within the relation to women, the nayakas are of three types. Pati (married and faithful), upapati (married and in love with another), and vaisika (one with many loves who dislikes commitment). The relation to attitudes is characterized as dakshina (pleading to be accepted when rejected), satha (deceitful), and anukoola (faithful). Lastly, with relation to love, the nayakas are proshita (on a journey), virahi (separated and characterized by pangs of loneliness), drishta (guilty as being unfaithful), vipralabdha (feels cheated), or vaisika (seeking union with his love). Sringara and bhakti are both shown abundantly through these manners, since sringara, describing love, is shown through any form of nayaka-nayika relation, and bhakti is devotion in any capacity. In this instance, bhakti would be shown through one\'s devotion to their lover and the purpose of their union. The actions and expressions of the dancer abundantly show whether the individual is experiencing sringara or bhakti throughout the piece. ', 0, 0, 4),
(2166, 3, 706, 1039, 'Lokhadharmi and natyadharmi are aspects of dharmi. In the first of these, men and women are shown plainly and naturally, without any sort of enhancements. In natyadharmi, actions are exaggerated and unusually characterized, such as elaborate expressions and gesticulation, as well as speech. Different artists specially incorporate different types of dharmi in order to show this. Lokhadharmi, although used, is more of an over and above incorporation, while natyadharmi is the essence of the art, and should be focused upon. Dr. Padmasubramanyam uses lokhadharmi extensively in her abhinaya. On the other hand, Smt. Kalanidhi Narayanan uses natyadharmi more extensively, and lokhadharmi sparingly. Within the aspect of dance, one seeks a tremendous level of exaggeration in order to satisfy the audience viewing of the art form. Natyadharmi is, then, the main component of Bharatanatyam, and lokhadharmi is more of an addition or optional addition to the matter. ', 0, 0, 4),
(2167, 3, 643, 1040, 'There are a multitude of stories that are commonly depicted in Bharatanatyam. One of these is the war in Lanka with Ravana to free Sita. Rama and his troops led the battle against him, where Rama\'s brother, Lakshmana, is rather wounded. The medicine man tells Rama that Sanjeevani is the only cure for Lakshmana\'s ailment, which Hanuman makes a trip across several seas to get. However, in order to find the herb, Hanuman brings the entirety of the mountain back to Rama. This story is popular and conveys bravery, as well as loyalty and love of a brother. Another commonly told story is that of Krishna\'s childhood, particularly that of stealing the butter and conducting such childhood pranks. For instance, there is a common depiction of gopis carrying pots and pans of butter, which Krishna targets in order to gather that butter. Another particularly common depiction is that of Krishna stealing the gopis clothes and insisting that they bow down to him to reclaim them. Similarly, the kaliya nardanam is a very common piece that is depicted of Krishna\'s childhood to show how Krishna overpowers the seven hooded fear inspiring serpent. ', 0, 0, 4),
(2168, 3, 647, 1040, 'Abhilasha: the first stage of longing\r\nCintana: obsession with the lover\r\nVyadhi: fainting and being restless to show deliriousness\r\nVilapa: walking to and fro, trying to recall particular moments\r\nAnusmriti: sighs of longing, constantly in his thought\r\nMarana: death as a result of unrequited love, to not be shown on stage', 0, 0, 4),
(2169, 3, 648, 1040, 'The dancer\'s hands are in arala on the left shoulder, and are separated in swastika gestures gradually to show the garland. Hamsasyo, chatura, and katakamukham are also used in the present, contemporary form of Bharatanatyam to indicate garlands. ', 0, 0, 4),
(2170, 3, 653, 1040, 'a. The dasavatara is the embodiment of the ten avataras that Lord Vishnu sought and seeks to take to satisfy his mission of divine preservation. The dasavataras include nine already taken ones in certain forms, while the tenth is yet to come (as indicated in the Bhagavat Geeta). The ten avataras are matsya, kurma, varaha, narasimha, vamana, parashurama, rama, balarama, krishna, and kalki. \r\n\r\nb. Ardhanareeswara is a deity of Lord Shiva and Sati. This is supposed to show the combination of both the male and female energies, and shows the concept of the half male and half female making up one entity. The sculptures at Elephanta and such caves are most indicative of such a being. On the right side exists the moon, serpent, and Ganges, with the left side adorned with jewels. The adhbutha rasa is invoked through it. \r\n\r\nc. A javali is a sringara based abhinaya piece, and is lighter than padam in raga and tala. The pace of the composition is quicker and more upbeat. Some famous ones are Entadi Kuluke in Kalyani, etc. ', 0, 0, 4),
(2171, 3, 652, 1040, 'The concept of tala keeps beat as one were to sing, dance, or play an instrument. A tala anga constitutes the body of the talam. Laghu, dhrutham, anudhrutham, plutha, guru, and kaka pada. Only laghu, dhrutha, and anudhrutha are used, primarily. The combination of these three elements gives one the essential talam being worked with in some combination. The combination of these creates the 35 tala system, while the obsolete 108 tala system used the other aspects of tala angas, as well. ', 0, 0, 4),
(2172, 3, 639, 1040, 'Chitra abhinaya describes the miscellaneous concepts of abhinaya that are not quite categorized into samanya abhinaya. It uses angika abhinaya through the use of bodily gestures to show the chitra abhinaya being represented in the dance piece. Contemporary Bharatanatyam artists use similar concepts to the traditional interpretation of such abhinaya, although a few changes have occurred. For instance, to indicate moonlight, or happiness, gestures that may also represent touch or a thrill of excitement are used. Udveshita and paravartita represent the repenting nature of disgust. Holding tripataka and swastika can show getting blessings from elders. As such, a multitude of examples of such nature do, indeed, exist. ', 0, 0, 4),
(2173, 3, 642, 1040, 'Sancharis are extensions of thought that are to the dancer\'s interpretation almost exclusively. Although it is kept with the raga and tala of the piece, the interpretation of the sanchari and the use of it within a piece to show a specific story is dependent on a dancer\'s personal depiction. Abhinaya in contemporary Bharatanayam is dependent upon sanchari to show transient emotions that are dependent upon the eight sthayi bhavas. For instance, if one were to show sringara, jealousy and suspicion can be sanchari expressions. But in contemporary Bharatanatyam, the above given representation is most accurate, in that it represents the dancer\'s personal abhinaya representation of an extension of thought in relevance to specific storytelling or elaboration. In most varnams and shabdams, there is at least one instance where the dancer is expected to have an opportunity of conveying these sancharis, but the same does not hold true for padams, where the emotion is to be held consistently without a break for such deviation. ', 0, 0, 4),
(2174, 3, 651, 1040, 'The Bharatanatyam dancer strives to convey the Hindu culture through all of his or her depictions. The traditional and contemporary repertoires of Bharatanatyam are drawn from Hindu mythology. Therefore, the essence of the dancer and his or her performances is gained from such sources. To be more specific, some common sources of dance are the epics, including the Ramayana, Bhagavat Gita, etc. For a dancer to be able to embody that abhinayam and be able to accurately and abundantly express the appropriate emotions associated, it is crucial that he/she takes the time to understand and respect the cultural divinity behind that. In essence, then, the dancer must be able to understand their art to be able to represent it on stage in such vigor and exemplary depiction. ', 0, 0, 4),
