(2185, 409, 492, 1050, 'Uras=Chest,Svastika=Arms crossed in chest region,Uru=Thighs,Prasarita=Sthana for men,Padmanabha=Lord Vishnu,Vaishaka=Sthana for men,Padmakosha=Asamyutha hastha,Bramari=Circular,Ayata=Sthana for women,Paadachari=Eight types', 0, 0, 5),
(2186, 409, 495, 1050, 'There are 13 different types of Paadha(feet) Bhedas:\r\n1.Samam - Standing straight in a natural position with an inch gap betwwen the feet\r\n2.Anjitham - Leg is stretched with heel on the ground and toes pointing up.\r\n3.Kunjitham -Toes on the ground bent inside and heels raised\r\n4.soochi -one foot flat on the ground  and the other foot with only big toe on the ground\r\n5.Agrathalasancharam -heel is raised and toe firmly on the ground\r\n6.Uthkattitham - one foot on the ground with other foot with heel up and beating on the ground\r\n7.Thattitham- first feet on the groundbeating on the ground with toes with succession\r\n8.Kadithotsedham-Agrathalasancharam and utkadiham in succession\r\n9.Kattibtham-beat the ground with foot on little toe side on the ground\r\n10.Mardhitham-slide on the side and lifting\r\n11.Akragam-Sliding\r\n12.Parshnigam-Move with only heel on the ground with toe not touchinh\r\n13.Parchvagam.feet turned in 180 degrees with heels touching\r\n', 0, 0, 4),
(2187, 409, 539, 1050, 'Thandavam is the dance for men.Lord Shiva asked Sage Thandu to come up with dance which is called Thandavam.There are seven thandavams which are called Saptha Thandavam\r\n1.Ananda  Thandavam\r\n2.Gowri Thandavam\r\n3.Sandhya Thandavam\r\n4.Urdhva Thandavam\r\n5.Kalika Thandavam\r\n6.Samhara Thandavam\r\n7.Tripura thandavam\r\n1.Sandhya Thandavam.On the request of Goddess Parvathi Shiva performed the dance on Mount Kailash at Dusk with celestial beings giving accompaniment.the performance happened at twilight which is called Sandhya in Sanskrit.This thandavam is represented in Madurai.\r\n\r\n2.Anadha Thandavam.  This is also called  Dance of Bliss in the presence of all dods adevotees and sages .especially SAge Pathanjali and SAge Vyakrapada .The thandavam indicates the protection of Shiva to his devotees.It is found in Chidambaram\r\n\r\n3.Urdhva Thandavam: This is a dance contest between SHiva and Shakthi which happened in Thillai.Shiva won the contest.Shiva dropped his earring during the contest and picked it up while dancind as a part of dance and won over shakthi.Since he beats shakthi and possessed Thillai as apart of the contest it is called Urdhva thandavam.It is found in Thiruvalangadu', 0, 0, 4),
(2188, 409, 543, 1050, 'Putta bhedas are movement of eyelids.There are 9\r\nUnmesh :opening to express anger\r\nNimesh :closing to express anger\r\nPrasrutha :expanding to show wonder,happiness\r\nKunchita: contracting to show dislike\r\nSame :Levelled to show erotic sentiments\r\nVivartita :Looking up to showing anger\r\nSphurita :blosomming to show jealousy\r\nPihita :concealing as in dreaming\r\nVitalita :suddenly closing to show accudents', 0, 0, 4),
(2189, 409, 540, 1050, 'Angika abhinaya is an expression through body movements\r\nthis has 3 elements.\r\nShaka or branch\r\nAnkura or sprout\r\nNritta or dance movements\r\n\r\nAngika abhinaya is classified into 3 types\r\nanga -major body parts\r\npratyanga- minor body parts\r\nupanga -ancillary body parts\r\n\r\nthis is further classified into\r\nMukaja abinaya- expression through face\r\nsarira abhinaya-expression through various limba\r\ncesthakritha abinaya-movement of entire bodywhich is further classified into gati prakara and pure dance\r\n\r\nher angas are 6 :Shiras,Hastha,Ura,Parswa,Kati,Pada\r\nPratyangas -6-bahu,skanda,prastha,jatara,uru,janga\r\nUpanga-7-Netra,bhru,tara,nasika,adara,kapola,cibuka', 0, 0, 4),
(2190, 409, 542, 1050, 'sthayi means permanent.eye movement used to depict permanent states of mind.Ther are 8 glances to express sentiments\r\nsnigdha-to showaffection\r\nHrista-to showjoy\r\ndina-to show sorrow\r\nkrudha-to show anger\r\ndripta- to show enthusiasm\r\nbayanvita - to show fear\r\njugpsita- to show disgust\r\nvismita- to show surprise', 0, 0, 4),
(2191, 409, 493, 1050, 'There are 7 sthanas foe women.\r\n1.Ayata-right in samam and left obliqued\\\r\n2.avahitam-left in sama and right obliqued with raised waist\r\n3.asvakranta\r\n4.gatagatam-hesitating movement with one foot raised\r\n5.valitham\r\n6.motitam\r\n7.vinivratham', 0, 0, 4),
(2192, 409, 538, 1050, 'sanchari bava is to express transitory states \r\nthe different types are\r\nshunya :to express misunderstanding giving vacant look\r\nMalina-eyelids partly closed\r\nshranta- drooping to show exer', 0, 0, 4),
