(2203, 409, 564, 1051, 'Rakudi=Ornament for head,Triangular playhouse=Tryasra,Salangai=Feet ornament,Konarak temple=caves Sun god,Ajanta and Ellora=Buddhist paintings,Mridangam=Percussive accompaniment,Chidambaram=Nataraja,Elephanta=Trimurthi,Utkshiptam=When heels are raised,Yakshagana=Karnataka', 0, 0, 5),
(2204, 409, 609, 1051, 'Nataraja temple (Chidambaram):\r\n\r\nChidambaram temple is poplarly knwn as temple of cosmic dance.It is an example of chola architecture.This temple represents anandha thandavam .All 108 karana explained in natyasastra are engraved in chidambaram temple.Shiva is represented here in the form of space or vacuum.chidambara ragasiyam is a famous concept about this temple.Because the idol of Nataraja is seperated by veil and only removed during special occassions.This temple is tribute the art of bharatanatyam.Chidambaram natyam festival is the world famous one and dancing in this festival is considered as agreat honor and privelage.\r\n\r\nThanjavore Bragadeeshwarar temple:THi is the huge temple built in 11th century by chola king rajaraja chola.Out of 108 ,81 karanas are depicted in the templke.This temple is called utthara chidambaram.the temple vimana is made of single granite stone.The dance feestival in this temple is also a very famous one among dancers and micisians.', 0, 0, 4),
(2205, 409, 605, 1051, 'Orchestra plays a significant role in bharatanatyam concert.the b haratanatyam follows carnatic music system.the musicians accompanyind dancers are\r\nNattuvanar:plays a major role.He is the conductor.Traditionally nattuvar is the Gure .Sometimes they also give vocal support.He plays nattuvangam which is a small metallic cymbal which synchronises with the foot of dancer.\r\nVocalist:Main player in the orchestra  who has the freedom to set the pitch which is followed by other instruments.\r\nMridangam:It is a percussion instrument.Animal hide covers the two ends of hollow wooden barrll ane are joined together by leather strap.This is the principal rhythmic accompaniment.\r\nFlute :this is a wind instrument made of bamboo.music is prodeuced by blowing techniques and opening and closing fingers on the holes.\r\nveena:Veena is a string instrument.music is produced by plucking strings.The mail resonator is placed on the ground which is in the shape of hollow round pot.veena is made of wood\r\nviolin:violin is also a string instrument.music is prodeuced by playing bow over the string.\r\nTampura:it is a string instrument which produce drone like sound which sets the shruthi or pitch.It creates pleasing background sound.', 0, 0, 4),
(2206, 409, 607, 1051, 'Sthanas are stati position or poses.Natyasastra explains 9 sthanakas ,6 for male and 3 for female.THese sthanakas are used to depict some feeling or to represent deity.\r\nThe sthanakas explained in natyasastra which are commonly used in bharatanatyam are\r\nSwastika sthana :used in adavus in bharatanatyam\r\n2.Samhatha sthana :similar to samapadha sthana\r\n3.Ekapadha sthana:used to show rishi in japa\r\n4.Prastotanatala :used in nadai or walk\r\n5.vaishnavadesi :to show Lord Krishna\r\n6.Garuda sthana', 0, 0, 4),
(2207, 409, 603, 1051, 'The temple of simhachalam is built on the hills.This temple is based on on the story of Prahaladha ,a great devotee of Vishnu.Vishnu took Narasimha avatar to rescue Pragaladha who had been tortured by his father Hiranyakasipu.Hiranyakasipuwas furious about his son\'s devotion to Vishnu.He threw his son in the sea and tried to placed a hill over his head.Vishnu came to his rescue and tilted the hill,so Pragaladha escaped the weight of the hill.Then he found the shrine for Lord Narasimha.', 0, 0, 4),
(2208, 409, 602, 1051, 'Stage lights play a very major role in modern day bharatanatyam.Since the technology is developed even a very huge stage can be balanced with good lighting.Though care need to be taken to keep it balanced.\r\nthere are 2 types of lights\r\n1.flood light ,2.spot light\r\nflood light shoud be even and spot light should be added in appropriate places.No light should fall on top of the head as it creates shade of nose to fall on forehead to create sunken eyes.Light should fall infront of the dancer.\r\nthe points to be considered are\r\n1.Foot lights should be avoided\r\n2.Light should not fall directly on the screen\r\n3.spot lights sholuld be held well above and from sides\r\n4.Avoid floodlights sttraight over the head.Stage decor,scene and costume of the dance should also be taken into consideration while lighting the stage', 0, 0, 4),
(2209, 409, 562, 1051, 'Orchestral accompaniment is very important in bhbaratanatyam concert.\r\nIt is given by\r\nNattuvanar who place nattuvamgam  who is also a conductor of orchestra.He sometimes gives vocal support\r\nMridangam which gives the percussion support\r\nFlute :it is a wind instrument made of bamboo\r\nVeena:string instrument made of wood.music is created by plucking the string\r\nViolin:also a string instrument.Music is create by playing bow over the strings\r\nTambura:creates drone like sound which sete the shruthi or pitch', 0, 0, 4),
(2210, 409, 563, 1051, 'Modern day stage lights are very advanced and sophisticated.There are two types Flood light and spot light.\r\nFlood light will spread evenly and spot light is used on particular spot.\r\ncare must be taken while lighting the stage\r\nlight should not fall on the head of the dancer which creates shadow of nosewill fall on the lips and forehead andeyes look sullen.Light should fall infront of the dancer.Footlight should be avoided.It should not fall directly on the screen.Spotlights should be well above and from sides.Avoid flood lights straight over the head.Consider color of the costume of the dancer.', 0, 0, 4),
(2211, 409, 559, 1051, 'Chari:\r\nsimultaneous movement of feet,shank and hip is called chari.the movement with single foot is also clles chari\r\ncharis are classified as \r\nEarthly chari:the feet are on the ground completely.They are virile movement of footwork\r\nAkasiki chari:One foot or both are raised.\r\nEarthly charis are16 types\r\nsamapada,stitavarta,sakatasya,adhyardhika,chasagati,vicyava,edakakridita,baddha,urudvarta,addita,utsyandita,janita,syandita,apasyandita,samotsaritamatalli,mattalli\r\n\r\naerial charis are of 16 types\r\n', 0, 0, 4),
