INSERT INTO `essay_qsn` (`essay_id`, `student_id`, `q_id`, `r_id`, `essay_cont`, `essay_score`, `essay_status`, `q_type`) VALUES
(2233, 965, 273, 1065, 'Khajurahoo is in Madya Pradesh which is well known for their sculptures. These temples are the most famous attractions. The sculptures include statues of gods and goddesses, warriors, celestial dancers, and animals. These temples celebrated a Hindu faith exuberant in its love for the divine. The other sculptures in these temples depict the daily lives of the people in the 10th and 11th century A.D. The temples also display a cultural beauty, evoking the splendor of the snow capped Himalayas and the earthly pleasures of life.', 0, 0, 4),
(2234, 965, 308, 1065, 'Bharatanatyam can project all aspects like religion, sentimental values, yoga, science, myth, philosophy, and every day activity of every life form on Earth by beautiful patterns and movements. The Bhava of a performer can render plentiful meanings to the onlookers without words. The tune set and the rhythmic patter can exhibit different moods. The name Bharatanatyam is a combination of of Bhava (expression), Raga (tune), Tala (rhythm).', 0, 0, 4),
(2235, 965, 340, 1065, 'After the 10th century, Bharatanatyam seems to have developed in the South and gradually came to be restricted to what is now known as Tamil Nadu. The Pallava and Chola rulers gave great stimulus to music and dance with the building of imposing temples in the South. Around the 12th century A.D. we find that technical illustrations of dance movements were made in many temples. During the Maratha rule, King Shahaji wrote nearly 500 padams and King Tulaja II wrote the Sangitasaramrta dealing with the adavus. During Sarfoji II, Bharatanatyam recieved its definitive shape from the Tanjore Quartet. ', 0, 0, 4),
(2236, 965, 346, 1065, 'Thakitta-3 beats\r\nThaka Dhimi-4 beats\r\nThaka Thakitta-5 beats\r\nThakitta Thaka Dhimi-7 beats\r\nThaka Dhimi Thaka Thakitta-9 beats\r\n\r\n', 0, 0, 4),
(2237, 965, 310, 1065, 'Nattuvanar: Well-versed in dance, music and song; expert in the sastras of rhythm; of pleasing figure and countenance; of ready wit; learned in different types of rhythm; able to utter accurately each rhythmic sequence, obedient to his guru\r\n\r\nSinger: Learned in the Marga (sacred) and Desi (Folk) styles of music; expert in dance, music, and song; possessing knowledge of various types of tala and laya; handsome; knowledgeable in svaras (note combinations) and various types of ragas; highly principled\r\n', 0, 0, 4),
(2238, 965, 266, 1065, 'Purakoothu or Nrtta is pure dance which consists of movements of the body and limbs which are performed to create beauty and decorative effect and not to convey any specific meaning or idea to the beholder. It is one of the two major divisions of Bharatanatyam.', 0, 0, 4),
(2239, 965, 291, 1065, 'Varnams performed in a dance recital are called as Pada Varnam. Varnam meaning color is a blend of both pure dance and abhinaya in depth. It is an item of Nrtya and the most complex piece in a Bharatanatyam recital.', 0, 0, 4),
