(2260, 965, 394, 1066, 'Shakatam --=The Cart,Chaturam=The square,Vayu=Araalam in right hand and Ardhapathakam in left with left fingers facing the earth,Varuna=Pathakam in right hand and shikaram in left held near the chest sama padam,Murugan=Right hand in Trishoolam and left in shikaram held near the chest. Mandalam position with leg bent inwards,Agni=Tripathakam in right hand and kangulum in left held near the chest,Soorya=Kapitham in right hand and left in alapadmam. Feet in samam position,Chandra=Ardhachandram in right hand and alapadmam in left held near the chest.,Vishnu=Both hands in tripathakam near the shoulders with palms facing outwards,Mahalakshmi=Both hands in kapitham near shoulders , body in asana  position', 0, 0, 5),
(2261, 965, 431, 1066, 'Dampati (Husband and Wife)-right hand in Mrgasirsam, denoting the wife, and the left hand is in Sikharam, standing for the husband\r\nPitr (Father)-Right hand in Sandamsam, going around the stomach and holding the left hand in Sikharam\r\nBhartr Bhratr (Brother-in-law)-Left hand in Sikharam and the right hand is in Kartarimukham on its own side\r\nSnusa (Daughter-in-law)-Sandamsha hasta on the right hand near tht ebelly and move it round and then hold Sikhara on the left hand, and then show Mrgasirsa on the right hand\r\n', 0, 0, 4),
(2262, 965, 475, 1066, 'Abhugna (Slight bent)-when the chest is lowered: hurry, fainting, sorrow, fear\r\nNirbhunga (Un bent)-shoulders straight and stiff: look of surprise, excess of pride\r\nPrakampita (Shaken)-Moving the chest up and down: laughter, weeping, panic\r\nUdvahita (raised)-Chest is raised up: deep breathing and yawning\r\nSama (natural)-All parts of the body in the natural position: Obedience and worship', 0, 0, 4),
(2263, 965, 413, 1066, 'These are the various chest movements:\r\nAbhugna (slight bent)\r\nNirbhugna (un bent)\r\nPrakampita (shaken)\r\nUdvahita (raised)\r\nSama (Natural)', 0, 0, 4),
(2264, 965, 417, 1066, 'Tala or the time measure forms the back bone of music and dance. In Bharata\'s time there existed 108 talas under the Margi form. Later many new talas came into being under Desi form. Talas are distinguished by the different combinations of Laghu, Dhrtam, and anudhrtam. Laghu is one beat followed by a specific count marked by counting the fingers. Dhrtam is one beat and one open palm. Anudhrtam is just one beat. The various talas are distinguished by different Avartanas. Avartana is one full cycle of counts in a particular Tala.', 0, 0, 4),
(2265, 965, 472, 1066, 'Samam-Eyes are motionless and straight or even\r\nAlokitam-Circular movement of the eyes\r\nSaci-Looking askance\r\nPralokitam-Glancing towards both the sides with wide eyes\r\nNimilitam-Half-closed eyes\r\nUllokitham-eyes raised in upward glance\r\nAnuvrttam-Speedily moving the eyes up and down\r\nAvalokitam-Eyes downcast', 0, 0, 4),
(2266, 965, 478, 1066, 'Nritta-pure dance that creates sheer aesthetic delight in the onlookers. Its basic constituents are tala and laya-time measure and rhythm. In Nritta, the emphasis is on clarity of dance movements with accompaniments provided by Nritta hastas. These have no hidden emotive contents.\r\n\r\nNritya-Integral component using interpretative aspects of Bharatanatyam, conjuring up an attractive world of imagination. The AbhinayaDharpana states that actors educate the audience by stimulating in them the latent possibility of an aesthetics. This interpretation is done by the movements of the limbs and gestures (angikam), by voice and through meaningful words (vacikam), by attire and decorations (aharyam), and by physical manifestations (sattvikam).\r\n', 0, 0, 4),
