(2316, 951, 257, 1076, 'Qualities of Danseuse=Qualities of Danseuse,Qualities of a Percussionist=nimble with fingers,Qualities of a Dancer=steady and balanced in performance,Qualities of a Nattuvanar=Able to utter accurately each rhythmic sequence,Qualities of a Guru=Humble without the arrogance of knowledge,Qualities of a Singer=learned in the marga and desi styles of music,Villadavu=the body arches like a bow,Mandiadavu=Dancer sits all the way down with knees bent,Marthitha Adavu=Hands and Body make a full swing front and sideways,Kuththa Adavu=Dancer jumps low with toes firmly rooted on the floor', 0, 0, 5),
(2317, 951, 340, 1076, 'Bharatanatyam is perhaps the oldest among the contemporary classical dance forms of India. It is an art which is mystical about itself and the search for understanding it in all totailty still continues. Dance has special mention in 2 important tamil works, Silappadigaram and Manimegalaiof the sangam age (500 B.C - 500 A.D). These sacred texts prescribed the mode of worship and referred to the consecration of dancing girls towards the service of the Gods. By the 10th century A.D., the Ardhamandali position (basic position) common to the classical dance was common to dance styles from Orissa to Gujarat and from Khajuraho to Trivandrum. The Pallava and chola rulers (4th to 12th centuries A.D) gave great stimulus to music and dance with the building of imposing temples in the south. This temple building tradition was kept alive by rulers, especially the Pandiyas, Nayak and the Marathas untill the end of 19th century. During the Maratha rule (A.D. 1674 - 1854) over Thanjavur, this dance art received considered filip. King Shahaji (1684 - 1711) wrote nearly 500 padams which are found in the form of palmleaf manuscript in Telugu script. King Tulaja II (1763 - 87) wrote the Sangitasaramrta, dealing with adavus (basic dance steps).\r\nDEVADASIS : Devadasis were found in TamilNadu and we find references to them in sacred text called Agama Sastras (principles of temple building). The word Devadasi has the meaning embedded in its own, Deva - God and Dasi - Servant which frames them as \"Servant of God\". The institution of Devadasis, servants of God, contributed in being responsible for preserving the art. They would perform during temple worship, delighting the audiences with charming stories from our mythologies. They were supported by the temple funds and became part of the sanctum sanctorum of the temple. In the beautiful Natya-Mandapas (dance halls), Praharas (Pathways) and Garbagraha (sanctum sanctorum) the dance dramas, ritualistic dances and the devotional numbers were done by the devadasis as offering to the presiding deities. They dedicated themselves to the service of God through their music and dance and were known as Devaradiyar (Servant of God). \r\nThe dancers were of three types:\r\n1. Devadasi - who danced in front of the deity in the temple\r\n2. Rajadasi - who danced in the courts of kings\r\n3. Alanakaradasi - who danced at the weddings. \r\nDASIATTAM : A sysytem of presentation of dance developed, in which there was only a single dancer, and the dance came to be known as Dasiattam. The dance was also called Sadir during the period of maratha rulers. The kuravanji dance came into prominence during the 18th century. Sadir was a solo dance form whereas kuravanji was a group production. \r\nTANJORE QUARTET : During the reign of King Serfoji II, four brothers from Tanjavur catapulated into limelight. They were Chinnaya, Ponnaya, Vadivelu and Sivanandam. They are sons of Subbaraya Nattuvanar and disciples of celebrated Music composer, Muthuswamy Dikshitar. They are equally well versed in music and were attached to the royal court as musicians. The brother codified and framed the structure of the Adavus and defined the Margam tradition. \r\n', 0, 0, 4),
(2318, 951, 342, 1076, 'Brihadiswara temple at Thanjavur is called \"Big Temple\". It is within a huge compound with walls rising above 15m. The temple is made over a 2m square base and has a soaring and a stunted gopuram. The inner sanctum and the gopuram were constructed over a period of 12 years. It was constructed from a single piece of granite weighing around 80 tonnes. The dome was hauled into place along a 4km earthwork ramp in a manner similar to Egyptian Pyramids. When building the Tanjore Brihadiswara temple in the 11th century, the great Chola king, Raja Raja Chola, intended to engrave the full 108 karanas by Lord Shiva in the first floor of the temple goupram. But only 81 of 108 are in finished state since he went on a war journey. The dance festival in the temple premises witnessess a vibrant cadre of artists, both dancers and musicians from in and around India and abroad.\r\n', 0, 0, 4),
(2319, 951, 279, 1076, '1. Kinkini\'s are beads like small pebbles\r\n2. made up of copper, brass or silver and shoud have good sound. \r\n3. Tied with black thread at an inch gap\r\n4. They appear glittery\r\n5. Should be in harmony with singer\'s sruti\r\n6. 100 - 200 are worn in one leg (100 for right leg and 200 for left leg). But nowadays, approximately 50 to 60 kinkinis are stitched in leather and worn. ', 0, 0, 4),
(2320, 951, 271, 1076, 'Chidambaram is popular as the \"city of the cosmic dancer\" and the temple is an example of Chola architecture. The temple is dedicated to dancing form of Lord Shiva, Nataraja who dances to the rhythm of the cosmic sound \"OM - pranava mantra\" and he is the deity of this sthala. The dance of nataraja is the essence of the five sacred syllables (panchaksharam) interprets the five fold manifestations of creation (srishti), preservation (sthiti), destruction (samhara), illusion (Tirobhava) and salvation (Anugraha). Just as the human heart is not in the center of the body but to the little left, so also the sanctum is little moved to the side. and as human blood flows through the sides, so is the entrance paths to this shrine are only at sides. In the Kanaka sabha, 18 pillars indicate 18 puranas, 5 pillar steps the panchakshara and 96 silver interstices for 96 cults. The 5 pillars of the chit sabha indicate 5 senses. of 10 pillars of Brahma pita, lower 6 stands for 6 sastras and upper 4 for vedas.\r\nThere are four gopurams to the temple in which 108 karanas are depicted in the form of a lady dancing there and are carved from top to the bottom of the pillars. For each dancing form, 2line reference from natyasastra is engraved. The presiding deity is represented by the vacuum space and known as Akash Lingam, one of the five elements (Pancha bhutam). The temple has statue of nataraja made in bronze, famous all over the world. ', 0, 0, 4),
(2321, 951, 344, 1076, 'Chidambaram is popular as the \"city of cosmic dancer\". The Nataraja temple is an example of Chola architecture. The temple is dedicated to the Dancing form of Lord Shiva, Nataraja and is a tribute ti the art of Bharatanatyam. Lord Nataraja is called as Cosmic dancer as he dances to the rhythm of the cosmic sound in the form of OM - pranava mantra. Hence, the city chidambaram gets its name as \"city of cosmic dancer\"  ', 0, 0, 4),
(2322, 951, 301, 1076, 'Basic stance : Mandala Sthanam or half sitting posture wherein the dancer holds her kness folded anf turned outwards, with legs turned out in parallel.\r\nHand gestures : Katakamukham, Alapadmam, Tripatakam\r\nVariations in Hand gestures : Sikharam, Patakam\r\nRhythmic Syllables : Thai Ha Thai Hi\r\nfoot positions : Agratala Sancaram, Ghatithothsedham\r\nMEthod : Jumping on toes of both feet with a proper poise and stance, followed by placing the heels firmly on the ground with full force. the hands at first are in katakamukham in front of chest and then extended sideways or held in same place while the hands change to katakamukha. for each gesture the dancer performs the toe heel movement ', 0, 0, 4),
(2323, 951, 305, 1076, 'Mahabalipuram Dance festival:\r\nThe dance festival starts on christmas day every year and is conducted on all saturdays and government holidays right up to the week of february.\r\n\r\nBrahadishwara Temple:\r\nThe dance festival in the temple\'s premises witnesses a vibrant cadre of artists, both dancers and musicians from in and around India and abroad.\r\n\r\nNatyanjali Festival - Nataraj Temple:\r\nThe chidambaram natyanjali festival is an inspiration to many young people and a divine glory for its spectators\r\n\r\nKapaleeswarar temple, Mylapore:\r\nThe dance and music season of December sees a lot of artists performing in the temple premises\r\n\r\nKonark dance festival:\r\nKonark city is well know for the dance festival every year in the month of december. Its a virtual feast to the lovers of the classical art forms of dance and music, attracts tourists across from the globe.\r\n', 0, 0, 4),
(2324, 951, 259, 1076, 'After the arangetrams which took place in the king\'s court, the kutthi, the danseuse would receive gold and gems as a reward and a title `Thalaikol`.\r\n\r\nThis `Thalaikol`was of a 7 hand span length. It was made of bamboo and was studded with gems. There were golden knots in between. At the beginning of Indira vizha, a festival, Puja was done to this (reminiscent of the jarjara puja done in purvarangam in dance). The stick was then given to the royal elephant and was taken for a procession along with the king who rode along with other ministers. It was then given to the dance teacher who was standing on the chariot. He would receive it and keep it at the Arangam, the performance stage. The lady dancer who received this was called `Thalaikoli`. The Nattuvanar was called `Thalaikol Asan`. The one who sang songs for dance was called `Thoriya Madanthai`.', 0, 0, 4),
