(2345, 951, 394, 1081, 'Shakatam --=The Cart,Chaturam=The square,Vayu=Araalam in right hand and Ardhapathakam in left with left fingers facing the earth,Varuna=Pathakam in right hand and shikaram in left held near the chest sama padam,Murugan=Right hand in Trishoolam and left in shikaram held near the chest. Mandalam position with leg bent inwards,Agni=Tripathakam in right hand and kangulum in left held near the chest,Soorya=Kapitham in right hand and left in alapadmam. Feet in samam position,Chandra=Ardhachandram in right hand and alapadmam in left held near the chest.,Vishnu=Both hands in tripathakam near the shoulders with palms facing outwards,Mahalakshmi=Both hands in kapitham near shoulders , body in asana  position', 0, 0, 5),
(2346, 951, 474, 1081, 'The first item of a recital, the alarippu is a short and simple item, but is significant as a ritual dance prelude to the performance. Its primary intention is to invoke the blessings of the divine and to offer homage to the audience. Its sanctifies the body of the dancer and the performace space. \r\n\r\nA connotation of the name `alarippu` is flowering, suggesting the opening of the body and the limbs in preparation for the dance items to follow. It features a progression of movements, beginning with head and eyes, and then involving more and more of the body, and using more of the performance space. The alarippu is accompanied by the sollukattu\'s \"tham-thi-tha thai-tha-thai\", and percussion in slow, medium and fast tempos. The duration of the alarippu is about three to five minutes.\r\n\r\nAlarippu means to adorn with flowers or blossoming out. The dance gradually starts with a simple movement of the eyes, neck, hand and feet and blossoms out displaying beautiful abstract movements in accordance with the drum syllables recited by the nattuvanar playing the cymbal. This is usually an invocatory item.', 0, 0, 4),
(2347, 951, 477, 1081, '1. Patakam - flag\r\n2. Tripatakam - the flag with three parts\r\n3. Ardhapatakam - half flag\r\n4. Kartarimukham - the scissors blades\r\n5. Mayuram - the peacock\r\n6. Ardhachandram - the half moon\r\n7. Aralam - the bent formation\r\n8. Sukatundam - the parrot\'s beak\r\n9. Musti - the fist\r\n10. Sikharam - the pinnacle\r\n11. kapitham - the wood apple\r\n12. katakamukham - the mouth of the bangle\r\n13. Suci - the sewing needle\r\n14. chandrakala - the crescent moon\r\n15. Padmakosam\r\n16. Sarpasirsam - the hood of the cobra\r\n17. Mrgasirsam - deer\'s head\r\n18. simhamukham - the lion face\r\n19. Kangulam - less than an inch\r\n20. Alapadmam - fully bloomed lotus\r\n21. Chaturam - square\r\n22. Bhramaram - the beetle\r\n23. Hamsasyam - the swan\'s bill\r\n24. Hamsapaksam - the swan\'s quill\r\n25. sandamsam - the tongs\r\n26. Mukulam - the bud\r\n27. Tamrachudam - the rooster\r\n28. Trisulam - the trident', 0, 0, 4),
(2348, 951, 429, 1081, 'Techniques/Qualities of a male dancer (Nata Laksanam) are:\r\n1. Handsome\r\n2. Soft Spoken and Eloquent\r\n3. Learned all the sastras\r\n4. Steady and balanced in performance\r\n5. Should possess a sweet voice\r\n6. Well versed in music and musical instruments\r\n7. Self confident and witty\r\n\r\nTechinques/Qualities of a dansuese (Nartaki laksanam) are:\r\n1. Young and Moderate stature\r\n2. Charming with soft and gentle face\r\n3. Self-confident and able to perform any difficult dance\r\n4. Agreeable and expert in grasping and releasing the various techniques acquired.\r\n5. Skilled in mandalams, caris, tala and laya\r\n6. An expert in posing hastas, sthanas, and angaharas\r\n7. Should have wide open eyes\r\n8. Able to follow the song rendered along with the percussion instruments\r\n9. Adorn with the best jewels\r\n10. Graceful in handling karanas.\r\n\r\nBoth the dancer and danseuse should possess all the good qualities mentioned in the sastras.\r\n', 0, 0, 4),
(2349, 951, 411, 1081, 'Effective symbol to denote matters pertaining to women, cheek, chakra, courtesy or traditional manners, fear, arguments, costume and make-up, welcoming, place of residence, putting threelines on the forehead with vibhuti, face of a deer, drawing patterns on the floor, massage of the feet, grouping, house, holding an umbrella, stairs, graceful movement of the feet, inviting the beloved, roaming.', 0, 0, 4),
(2350, 951, 401, 1081, '1. Surya - the sun\r\nRight hand in kapitha and left hand in alapadmam near shoulders.\r\n\r\n2. Chandra - the moon \r\nRight hand in patakam and left hand in alapadmam with finger tips pointing to sky near chest.\r\n\r\n3. Angaraka - the mars\r\nRight hand in suci - pointing to sky and left hand in musti near chest\r\n\r\n4. Budha - the mercury\r\nRight hand in musti and left hand in patakam\r\n\r\n5. Guru - the jupiter\r\nBoth hands are in shikaram as if holding sacred thread\r\n\r\n6. Sukra - the venus \r\nBoth hands in musti with left hand raised (near the shoulder) and right hand lowered (close to hip)\r\n\r\n7. Sani - the saturn\r\nRight hand in trisulam with fingers pointing sky and left hand in sikharam with slow gait and cruel look\r\n\r\n8. Rahu - the snake\'s head\r\nRight hand in suci - pointing to sky and left hand in sarpasirsa.\r\n\r\n9. Ketu - the snake\'s tail \r\nRight hand in patakam and left hand in suci - pointing to sky\r\n', 0, 0, 4),
(2351, 951, 431, 1081, '1. Dampati - Husband and Wife\r\nRight hand in Mrgasirsam (wife) and left hand in Sikharam (Husband)\r\n\r\n2. Matru - Mother\r\nBegin with the left hand in `Ardhachandra` and the right in `Sandamsam`\r\nAfter circling the stomach, the left hand switches to Mrgasirsam.\r\n\r\n3. Pitr - Father\r\nThe right hand is in sandamsam going around the stomach and holding the left hand in sikharam\r\n\r\n4. Svasru - Mother in law\r\nThe right hand is in Hamsasyam held at the neck level and then changes to sandamsam and kept pressed against the stomach with the left hand changing to Mrgasirsam\r\n\r\n5. Svasura - Father in law\r\nThe right hand is in Hamsasyam held at the neck level and changed to sandamsam and kept pressed against the stomach with the left hand changing to sikharam\r\n\r\n6. Bhartr Bhratr - Brother in law\r\nThe left hand is in sikharam and the right hand is in kartarimukham on its own side\r\n\r\n7. Nanadr - Sister in law \r\nAfter performing the hasta for brother in law the right hand does Mrgasirsam\r\n\r\n8. Jyestha Kanistha Bhratr - Elder and younger brothers\r\nMayura hands should be shown in front and on two sides\r\n\r\n9. Putra - Son \r\nHold Sandamsa hasta on the right hand near the belly and move it around and then hold sikhara on the left hand\r\n\r\n10. Snusa - Daughter in law\r\nAfter showing son\'s hands, Mrgasirsa should be held with right hand\r\n\r\n11. Sapatni - Co - wife\r\nAfter depicting Pasa hasta Mrgasirsa should be done with both the hands.', 0, 0, 4),
(2352, 951, 478, 1081, 'Nritta:\r\nNritta is defined as Nrittam-tala-layasrayam. \r\nNritta is a pure dance which consists of movements of body and limbs which are performed to create beauty and decorative effect and not to convey any specific meaning or idea to the beholder. Its basic constituents are tala and laya - time measure and rhythm.\r\n\r\nNritya:\r\nNrtya on the other hand is a dance with facial expressions. i.e a dance which is performed specifically to convey the meaning or import of a theme or an idea to the beholder. This interpretation is done by movement of the limbs and gestures (angikam), by voice and through meaningful words (vacikam), by attire and decorations (aharyam) and by physical manifestations (sattvikam).', 0, 0, 4),
(2353, 951, 471, 1081, '1. Anjali - the salutation\r\n2. Kapotam - the pigeon\r\n3. Karkatam - the crab\r\n4. Svastikam - crossed\r\n5. Dolam - the swing\r\n6. Puspaputam - the flower basket\r\n7. Utsangam - the embrace\r\n8. Sivalingam\r\n9. Katakavardhanam\r\n10. Kartarisvastikam\r\n11. Sakatam - the cart\r\n12. Sankham - the conch\r\n13. Cakram - the weapon of Lord Vishnu\r\n14. Samputam - the container\r\n15. Pasam - the rope\r\n16. Kilaka - the bond\r\n17. Matsya - the fish\r\n18. Kurmam - the turtle\r\n19. Varaha - the pig\r\n20. Garuda - the eagle\r\n21. Nagabhandam - the tangled snakes\r\n22. Khadva - the cot\r\n23. Berundam - the twin-headed bird\r\n24. Avahittam', 0, 0, 4),
