(2374, 867, 394, 1088, 'Shakatam --=The Cart,Chaturam=The square,Vayu=Araalam in right hand and Ardhapathakam in left with left fingers facing the earth,Varuna=Pathakam in right hand and shikaram in left held near the chest sama padam,Murugan=Right hand in Trishoolam and left in shikaram held near the chest. Mandalam position with leg bent inwards,Agni=Tripathakam in right hand and kangulum in left held near the chest,Soorya=Mushti,Chandra=chalapathakam,Vishnu=Both hands in tripathakam near the shoulders with palms facing outwards,Mahalakshmi=Both hands in kapitham near shoulders , body in asana  position', 0, 0, 5),
(2375, 867, 399, 1088, 'The Hastas or Hand Formations are classified into: Asamyutha Hastas (Single Hand Gestures) and Samyuta Hastas (Double Hand Gestures). In Sanskrit, the word Samyutam (meaning union) and Asamyuktam (meaning non-union) can be traced as origins for the Tamil usage of these words.\r\n\r\nSome of the hand gestures may not indicate or narrate anything but maybe used to enhance the beauty of the pure dance itself. Such gestures are called Nrtta Hastas.\r\n\r\nThe thirteen hand gestures generally used in Nrtta are Pataka, Svastika, Dolahasta, Anjalii, Katakavardhana, Sakata, Pasa, Kilaka, Kapittha, Sikhara, Kurma, Hamsasya and Alapadma.\r\n\r\nAsamyukta Hastas are Pataka, Tripataka, Ardhapataka, Kartarimukham, Mayuram, Ardhachandram, etc', 0, 0, 4),
(2376, 867, 472, 1088, 'Drishti Bedham means \"Eye Movements\". There are 8 eyes movements:\r\n\r\n1. Samam - Eyes are motionless and straight or even\r\n\r\n2. Alokitam - Circular movements of the eyes\r\n\r\n3. Saci - Looking askance.\r\n\r\n4. Pralokitam - Glancing towards both sides with wide eyes\r\n\r\n5. Nimilitam - Half-closed eyes\r\n\r\n6. Ullokitam - Eyes raised in upward glance\r\n\r\n7. Anuvrttam - Speedily moving the eyes up and down\r\n\r\n8. Avalokitam - eyes downcast\r\n\r\nThese are the classifications of Drishti bedham.', 0, 0, 4),
(2377, 867, 395, 1088, 'Nritha in classical aesthetic terms is Pure Dance that creates sheer aesthetic  delight (ananda) in the on lookers. Its basic constituents are Tala and Laya - Time measure and Rhythm.  In Nritha the emphasis is on clarity of dance movements with accompaniments provided by The Nritha Hastas or hand movements.\r\n\r\nAbhinaya is the main technique used in Natya. Abhi means towards and ni or Naya is the root meaning to carry. Thus as the meaning implies the dancer through the vehicle of Abhinaya has to reach out to the spectators. It is an inseparable component of Natya.\r\n\r\nNatya has got six elements namely:\r\n\r\n1. Nritta (Pure dance)\r\n\r\n2. Geeta (Song\r\n\r\n3. Abhinaya (Gestures)\r\n\r\n4. Tala (Rhythm)\r\n\r\n5. Bhava (Emotions)\r\n\r\n6. Rasa (sentiment)\r\n\r\nNatyshastra says that Abhinaya is the art of exhibiting the meaning of what one depicts. The dancer has an enormous resource bank to communicate a story, an idea, an emotion. She uses her body, her limbs, hands, face, eyes to express her ideas. The dancer has to draw the audience into her world. The shores reached by both the viewer and the dancer are described as the experience of Rasa, which is compared to spiritual experience.The main purpose of dance is to evoke Rasa, which means sentiment or flavor among the audience. Abhinaya Darpanam of Nandikeshwara says:\r\n\r\nYatho Hastato Dhrishtihi\r\nYatho Dhrishtisto Manaha\r\nYatho Manatato Bhavaha\r\nYatho Bhavastato Rasaha\r\n\r\n\r\n', 0, 0, 4),
(2378, 867, 476, 1088, 'Shiro Bedham are Head movements\r\n\r\nThe various Shiro bedlams are:\r\n\r\n1. Samam - Keepubf', 0, 0, 4),
