(2399, 911, 394, 1090, 'Shakatam --=The Cart,Chaturam=The square,Vayu=Araalam in right hand and Ardhapathakam in left with left fingers facing the earth,Varuna=Pathakam in right hand and shikaram in left held near the chest sama padam,Murugan=Right hand in Trishoolam and left in shikaram held near the chest. Mandalam position with leg bent inwards,Agni=Tripathakam in right hand and kangulum in left held near the chest,Soorya=Kapitham in right hand and left in alapadmam. Feet in samam position,Chandra=,Vishnu=Both hands in tripathakam near the shoulders with palms facing outwards,Mahalakshmi=Both hands in kapitham near shoulders , body in asana  position', 0, 0, 5),
(2400, 911, 430, 1090, 'To depict Bramha, the dancer uses Hamsasyam and Chatura placed near the chest. To show Shiva, the dancer uses tripatakam in the right hand and mrgasirsam in the left hand. To depict Visnu, the protector, the dancer holds tripatakam in both hands facing outwards, and placed near the shoulders. To show Sarasvati, Suci and Kapitha, or Mrgsirsam. To show Parvati, Ardhacandra is held in both hands near the hip. To show Mahalakshmi, both of the hands are held in kapitham near the shoulder. To show Vigneshwara, or Ganesh, both hands are placed near the hip in kapitham. To show Sanmukha or Muruga, the left hand is held in trisulam, and the right is held in Sikaram, near the chest. To show Manmatha, the god of love, katamukha, and Sikharam are used near the chest. To show Indra, both hands are kept in tripataka, or swastika. To show Agni, the right hand is kept in Tripatakam, and left hand is in Kangulam. For Yama, the right hand is in Suci, and the left hand is in Pasam near the chest. To show Varuna, the right hand is in Patakam, and the left is in sikaram near the chest. To show Vayu, the right hand is in Aralam, and the left is in Ardhapatakam. And finally, to show Kubera, the right hand is in Musti, and the left hand is in Alapadmam held near the chest.', 0, 0, 4),
(2401, 911, 473, 1090, 'A Kavuthuvam is an invoacatory item in Bharathanatyam. It is a song of devotion in the praise of a god or deity. It was performed by devadasis as part of special rituals or daily rituals. Most of the Kavituvams are dedicated to a particular deity or god. For example, Chidambaram Natesha Kavituvam, composed by Gangai Muttu Natuvanar, is the most famous Kavituvam, dedicated to the Chidambaram Nataraga Temple.', 0, 0, 4),
(2402, 911, 419, 1090, 'Margam is a well thought plan to approach any Bharathanatyam recital in order to create Rasa among the veiwers. The sequence includes, an Allaripu, Jathisvaram, Sabdham, Varanam, Padam, Javali, Kirthanam, Thillana, and Mangalam.', 0, 0, 4),
(2403, 911, 477, 1090, 'Some Asamyutha Hasthas are, Patakam, the flag, Tripatakam, the flag with three parts, Ardhapathakam, the half flag, Kartarimukham, the scissors blades, Mayuram, the peacock, and Ardhachandram, the half moon.', 0, 0, 4),
(2404, 911, 401, 1090, 'Surya, the sun, is depicted with two Kapitthams that change to alapadmam at cheek-level. To show Candra, the right hand is in patakam, and the left hand is in alapadmam, Angaraka is shown with suci, and musti, Budha is shown with musti in the left hand and patakam in the right. Guru is shown with two sikhara hastas. Sukra is shown with musti in each hand. Sani is shown with the left hand in sikaram and the right in trisulam. Rahu is shown with sarpasirastata in the left hand, and the right hand in suci. And Ketu is shown with suci in the left hand and patakam in the right.', 0, 0, 4),
(2405, 911, 400, 1090, 'Matsyam - the body in samam, the left foot is stretched back facing the sky, and the hands are in matsya\r\nKurmam- the body is in asna position, the body is bent forwards, and the hands are held close to the face in kurmam\r\nVaraham -  the body is in samam, the right foot is bent, and the hands are close to the face in varaham\r\nNarasimham -  the body is in mandala, the right foot is bent on the side, and the left hand is in simhamukham and the right is in tripatakam. \r\nVamana - the body is in manala, and both hands are in musti, the left hand is facing the ground, and the right hand is before the shoulder\r\nParasurama -  the right hand  is in ardhapataka, the left hand is placed on the waist or hung down\r\nRama - the right hand is in Kapittha, and the left is in Sikharam, the right foot is placed on the side of the left\r\nBalarama - the right hand is in Pataka, and the left is in Musti, both hands are placed one above the other, and is held sideways near the chest, the body is seated in Mandala.\r\nKrsna - both hands are in Mrgasirsm, and held on the right side close to the face, feet are in svastika\r\nKalki - the right hand is in Pataka, and the right hand is in Tripataka, standing in samam, the right leg should be folded from the front and kept lifted.', 0, 0, 4),
(2406, 911, 402, 1090, 'Drsti Bedham are the eye movements. Some include, Samam, the eyes motionless and straight or even, Alokitam, the circular movement of the eyes, Saci, looking askance, Pralokitam, glancing towards both the sides with wide eyes. Nimilatam, half closed eyes, Ulokitam, eyes raised in an upwards glance, Anuvrrtam, speedily moving the eyes up and down, and Avalokitam, the eyes are downcast.', 0, 0, 4),
(2407, 911, 470, 1090, 'Neck movements can be used to show many things. For example, \r\nSundari - building friendship, effort, saying \"well done\", witty conversation, or acceptance\r\nTirascina - slithering movement of a snake, or brandishing of a sword\r\nParivartita - erotic dances, and in kissing both cheeks of the beloved\r\nPrakampita - several implications like \"you and I\", swinging, and sweet sounds of a pigeon', 0, 0, 4);
