INSERT INTO `faq` (`faq_id`, `title`, `content`, `type`, `status`, `created_by`, `updated_by`, `created_at`, `updated_at`) VALUES
(1, 'What if I dont want to pay for the DVDs in each of the courses?', 'The DVDs are mandatory. It is part of the coursework and it provides a basic outline of what is required for the practical exams.', 2, 1, 'Super Admin', 'Super Admin', '2016-01-13 11:53:10', '2016-03-14 06:36:21'),
(3, 'What is the Value of getting certification from this program?', 'Students of Bharathanatyam spend years learning the art and perfecting the practices and mostly perform the Arangetram which is a graduation performance. This process might typically take about 6 to 7 years for a student. If a student were to pursue studies during this time', 1, 1, 'Super Admin', 'Super Admin', '2016-01-13 12:01:45', '2016-01-13 12:01:45'),
(4, 'Is this certification given only by Alagappa University from India or is it affiliated with universities in the USA as well?', 'Currently the degrees are given through Alagappa University. However we are working with the US department of Education to get the program accredited as actively seeking affiliation with established US universities. We hope to receive the affiliation by next year.', 1, 1, 'Super Admin', 'Super Admin', '2016-01-13 12:28:52', '2016-01-13 12:28:52'),
(5, 'What is the value of accreditation to US universities?', 'It shows recognition of the students hard work over the past years learning the art andobtaining credits towards a degree program at the University. It will also make the studentsresume more impressive.', 1, 1, 'Super Admin', 'Super Admin', '2016-03-14 06:30:50', '2016-03-14 06:30:50'),
(6, 'What types of learning aids are supplied?', 'On enrollment in a specific program:Specific text books will be provided that elaborate on the various concepts and techniques of Bharathanatyam. Additionally interactive DVDs are provided to enhance the practical aspects studied through the books. The DVDs vividly describe the precise execution of this art and provide a valuable aid to help students practice what they have learnt at the dance centers.', 1, 1, 'Super Admin', 'Super Admin', '2016-03-14 06:31:16', '2016-03-14 06:31:16'),
(7, 'Is a particular dance style forced onto students who join the course?', 'The Curriculum has been designed in cooperation with a group of eminent dance teachers with varied dance styles. Therefore no particular style is forced on the student.', 1, 1, 'Super Admin', 'Super Admin', '2016-03-14 06:31:37', '2016-03-14 06:31:37'),
(8, 'What are the roles of APAA Authorized Certification Centers (APAC)?', 'To provide training and guidance to enrolled students to fulfill requirements of the respective program. The APAC will also help students prepare for the examinations. To conduct proctored examinations and send test papers to APAA.To record on DVD the practical exams and send to APAA for evaluation.', 1, 1, 'Super Admin', 'Super Admin', '2016-03-14 06:31:58', '2016-03-14 06:31:58'),
(9, 'Can a student withdraw from a course after enrollment?', 'If a student withdraws from a course no refund will be provided. If a student does not rejoin a course within a one year period, registration has to be completed again.', 1, 1, 'Super Admin', 'Super Admin', '2016-03-14 06:32:15', '2016-03-14 06:32:15'),
(10, 'What are the requirements to enroll in the Certificate program?', 'Enrollment in the Certificate Program is open to all students, but to obtain a Certificate within one year a student would be required to have 2 to 3 years prior experience in Bharathanatyam, as the practical requirement for the Certificate program requires knowledge in specifi c dance routines such as Alarippu, Kavithuvam and Sabdham.', 1, 1, 'Super Admin', 'Super Admin', '2016-03-14 06:32:34', '2016-03-14 06:32:34'),
(11, 'Can a student register for the Degree program directly if he / she has completed Arangetram?', 'No, in accordance with University guidelines a student is required to complete and pass all the required courses in the Certificate Program and then complete the same in the Associate Degree Program.To acknowledge time spent learning the art and staging an Arangetram, students are permitted to take the courses on a FAST TRACK basis so that they can complete the Certifi cate and the Associate Degree in a shorter time period (for example in 6 months) On successful completion of the coursework, which includes all theory exams, a student will be accepted in to the Diploma program and will be exempt from practical work provided they are able to demonstrate knowledge of the required practical work for the Certifi cate and Associate Degree programs', 1, 1, 'Super Admin', 'Super Admin', '2016-03-14 06:32:53', '2016-03-14 06:32:53'),
(12, 'Where are the programs offered?', 'The APAA programs are offered though APAA Authorized centers (APAC), which have been previously evaluated by APAA based on their stringent guidelines and certified to offer the program. All such centers are stated and updated on the APAA website on a regular basis.', 1, 1, 'Super Admin', 'Super Admin', '2016-03-14 06:33:12', '2016-03-14 06:33:12'),
(13, 'Who will teach the textbook material?', 'Dance Centers (APACs) will set up a study outline. It is up to the students to interact with the dance center and complete the study materials before the exams. Any questions can be asked to the teachers in the dance center or the students can ask questions online and our professional staff will respond to queries.', 1, 1, 'Super Admin', 'Super Admin', '2016-03-14 06:33:43', '2016-03-14 06:33:43'),
(14, 'Can I get the model question papers?', 'Yes, sample questions have been sent on the APAA website to provide students a flavor of questions that will be asked in the exams. User ID, you can login and access to the sample questions.', 1, 1, 'Super Admin', 'Super Admin', '2016-03-14 06:34:06', '2016-03-14 06:34:06'),
(15, 'If we relocate to another city are the credits transferable?', 'As long as the students decide to stay within the APAA system, all the credits are transferable to APAA authorized dance centers all over the country. It is our fervent goal to establish authorized dance centers in all the major cities.', 1, 1, 'Super Admin', 'Super Admin', '2016-03-14 06:34:25', '2016-03-14 06:34:25'),
(16, 'I am not able to complete the practical for the Certificate course in 1 year? What do I do?', 'For students who are not able to complete the dances within the 1 year time period, they can work with the dance center at a slower pace and complete the requirements.', 1, 1, 'Super Admin', 'Super Admin', '2016-03-14 06:34:45', '2016-03-14 06:34:45'),
(17, 'What if I dont want to pay for the DVDs in each of the courses?', 'The DVDs are mandatory. It is part of the coursework and it provides a basic outline of what is required of students in the practical exams. Any one item should be performed from the DVD for certificate and Associate program and any two item should be performed for Diploma and Degree Program.', 1, 1, 'Super Admin', 'Super Admin', '2016-03-14 06:35:04', '2016-03-14 06:35:04'),
(18, 'Kalaimamani Dr.M.S. Sarala', 'Kalaimamani Dr.M.S.Sarala is an accomplished dancer who is a disciple of Smt.K.J.Sarasa and Padma Bhushan Dr. Padma Subramaniam. She received her Doctorate Degree in dancing from Annamalai University, Tamilnadu, India. She started dancing at the age of 14 and has given numerous performances in India and abroad.She created and choreographed the dance and music for the dance drama Ekalaivan which has been an outstanding success with a strong message to the audience to broaden their outlook towards society. She has participated in many conferences and given lectures both in India and abroad.She is a Visiting Professor of Fine Arts at the Alagappa University Karaikudi and a member of the Management Board of CECRI Kendra Vidhayalaya', 1, 1, 'Super Admin', 'Super Admin', '2016-03-14 06:35:22', '2016-03-14 06:35:22'),
(19, 'If am not able to complete the practical dances for the Certificate Course in 1 year, what do I do?', 'For students who are not able to complete the dances within the 1 year time period, they can work with the dance center at a slower pace and complete the requirements.', 2, 1, 'Super Admin', 'Super Admin', '2016-03-14 06:36:44', '2016-03-14 06:36:44'),
(20, 'What is the exam format?', 'Both multiple choice format as well as essay type.', 2, 1, 'Super Admin', 'Super Admin', '2016-03-14 06:37:02', '2016-03-14 06:37:02'),
(21, 'What if I do not understand some of the words in the textbook?', 'A lot of the words in Bharathanatyam are in Sanskrit. A glossary is provided in the back of every single textbook for your comprehension.', 2, 1, 'Super Admin', 'Super Admin', '2016-03-14 06:37:20', '2016-03-14 06:37:20'),
(22, 'If we relocate to another city are the credits transferable?', 'As long as the students decide to stay within the APAA system, all credits are transferable to APAA authorized dance centers all over the country. It is our fervent goal to establish authorized dance centers in all major cities.', 2, 1, 'Super Admin', 'Super Admin', '2016-03-14 06:37:39', '2016-03-14 06:37:39'),
(23, 'Can I get the model question papers?', 'Yes, sample questions have been set on the APAA website to provide students a flavor of questions that will be asked in the exams.    Use your User ID, to login and get access to the sample questions.', 2, 1, 'Super Admin', 'Super Admin', '2016-03-14 06:37:57', '2016-03-14 06:37:57'),
(24, 'How are the examinations corrected?', 'All theory exams and practical exams are sent to APAA upon completion. APAA will send the exam papers and DVDs to other APAC centers that teach the same style to get corrected.    The final project will be corrected by our professional teachers affiliated to APAA and Alagappa University.', 2, 1, 'Super Admin', 'Super Admin', '2016-03-14 06:38:24', '2016-03-14 06:38:24'),
(25, 'If I am not available to take the final exam at the prescribed date, can I take it on another date?', 'If a student is unable to take the exam it is their responsibility to notify the dance center that will notify APAA the reason why the student is unable to attend the exam.    The student will then be authorized to take the exam on the next available date offered by APAA.', 2, 1, 'Super Admin', 'Super Admin', '2016-03-14 06:38:44', '2016-03-14 06:38:44'),
(26, 'What is the process of evaluating the student during a course?', 'Written examinations will be conducted on regular basis during a semester.    The student will be evaluated both on internal and external assessments that will cover the exams, projects and assignments.    Every certification process will end with a project, which will demonstrate the students practical knowledge in the course syllabus and performance.    A student will provide a video / DVD of the required project recorded by the authorized dance center and will be graded on that performance.    On successful completion of the program the appropriate certificate will be awarded by Alagappa University.', 2, 1, 'Super Admin', 'Super Admin', '2016-03-14 06:39:03', '2016-03-14 06:39:03'),
(27, 'When will the student receive the study materials and how does the process progress further?', 'On enrollment of a course, the textbooks and the DVDs will be mailed to the student. The acknowledgement of the materials dispatch with label id # number will be communicated.', 2, 1, 'Super Admin', 'Super Admin', '2016-03-14 06:39:21', '2016-03-14 06:39:21'),
(28, 'After registration, how does a student maintain constant communication with the coordinators?', 'Students will interact with their assigned APAC or contact APAA or its authorized representative.', 2, 1, 'Super Admin', 'Super Admin', '2016-03-14 06:39:52', '2016-03-14 06:39:52'),
(29, 'What is the procedure for a student to get enrolled in the program?', 'Contact your bharathanatyam dance teacher and find out whether they are an Authorized Dance Center. If they are not, tell them to visit the site www.bharathanatyamonline.com and apply for enrollment as a dance center through our online application form.    If they are not interested, please contact APAA directly and we will assign you a nearby dance center.    Fill out the Students Application Form through the downloadable form and submit the form with the dues to APAA at the specified address.    On receipt of your application and dues APAA will send you textbooks and DVDs for your course.    Check with the Dance center for the date of commencement and fulfill the requirements.', 2, 1, 'Super Admin', 'Super Admin', '2016-03-14 06:40:09', '2016-03-14 06:40:09'),
(30, 'What is the FAST TRACK Program?', 'FAST TRACK Program has been set up to enable students who have had prior experience learning this divine art.    If a student has staged an Arangetram within the last 10 years, or has learnt Bharathanatyam for a couple of years they should send a copy of a videocassette or DVD of the performance to APAA to be considered to be exempted from fulfilling practical requirements for the Certificate and Associate Degree programs.    However if the Performance DVD does not adequately demonstrate the students knowledge in the prescribed dances they will not be exempted and will have to fulfill normal course requirements.    Once the submission has been reviewed, APAA will authorize the student to enroll in the Fast Track Program with a dance Center accredited to offer the APAA program.    At this stage a student must enroll and complete successfully all theory courses for the Certificate and Associate Degrees.    This is permitted within a 6 month period.    A mandatory 2-year residency is required to obtain the Bachelors Degree.', 2, 1, 'Super Admin', 'Super Admin', '2016-03-14 06:40:27', '2016-03-14 06:40:27'),
(31, 'Can teachers get enrolled in this program?', 'Yes, it is advisable for all teachers and teachers assistants to enroll in this program and demonstrate through a degree that they are qualified instructors of this divine art.', 2, 1, 'Super Admin', 'Super Admin', '2016-03-14 06:40:46', '2016-03-14 06:40:46'),
(32, 'Who can actually complete their Bachelors Degree in 4 years?', 'A student who has completed 2-3 years of dancing and enrolled into the certificate program can complete the Bachelors Degree in 4 years.', 2, 1, 'Super Admin', 'Super Admin', '2016-03-14 06:41:04', '2016-03-14 06:41:04'),
(33, 'How old do you have to be to attain a Bachelors Degree?', 'At least 16 years of age. This is in conformance with University regulations.', 2, 1, 'Super Admin', 'Super Admin', '2016-03-14 06:41:22', '2016-03-14 06:41:22'),
(34, 'What is the earliest age for enrollment into the program?', 'A student must be 10 years of age to enroll in the program.    As APAA has specific coursework that requires reading of textbooks, a student must be able to comprehend the textbook and write the exam.    In special cases where a student is less than 10 years of age and has demonstrated the ability to comprehend the prescribed textbooks, the Alagappa Authorized Dance Center (APAC) can recommend a student for admission to the program.    APAA will review and reserve the right to admit the student.', 2, 1, 'Super Admin', 'Super Admin', '2016-03-14 06:41:41', '2016-03-14 06:41:41'),
(35, 'Who will teach the textbook material?', 'Dance Centers (APACs) will set up a study outline. It is up to the students to interact with the dance center and complete the study materials before the exams. Any questions can be asked to the teachers in the dance center or the students can ask questions online and our professional staff will respond to queries.', 2, 1, 'Super Admin', 'Super Admin', '2016-03-14 06:41:58', '2016-03-14 06:41:58'),
(36, 'What programs are offered?', 'Certificate in Bharathanatyam                   (1 to 3 Year duration)    Associate Degree in Bharathanatyam     (1 year after Certificate)    Diploma in Bharathanatyam                      (1 year after Associate Degree )    Bachelors Degree in Bharathanatyam    (1 year after Diploma)', 2, 1, 'Super Admin', 'Super Admin', '2016-03-14 06:42:17', '2016-03-14 06:42:17'),
(37, 'Where are the programs offered?', 'The APAA programs are offered through APAA Authorized centers (APAC), which have been previously evaluated by APAA based on their stringent guidelines and certified to offer the program. All such centers are stated and updated on the APAA website on a regular basis.', 2, 1, 'Super Admin', 'Super Admin', '2016-03-14 06:42:34', '2016-03-14 06:42:34'),
(38, 'Can a student register for the Degree program directly if he /she has completed Arangetram?', 'No, in accordance with University guidelines a student is required to complete and pass all the required courses in the Certificate Program and then complete the same in the Associate Degree Program.    To acknowledge time spent learning the art and staging an Arangetram, students are permitted to take the courses on a FAST TRACK basis so that they can complete the Certificate and the Associate Degree in a shorter time period (for example in 6 months).    On successful completion of the coursework, which includes all theory exams, a student will be accepted to start in the Diploma program and will be exempt from practical work provided they are able to demonstrate knowledge of the required practical work for the Certificate and Associate Degree programs.    Once admitted to the Diploma program, students must complete all requirements as per the school calendar and fulfill all requirements of the Degree program to graduate. All students who have completed their Arangetram within the last 10 years are exempt from the practical requirements in the coursework.', 2, 1, 'Super Admin', 'Super Admin', '2016-03-14 06:43:13', '2016-03-14 06:43:13'),
(39, 'What are the requirements to enroll in the Certificate program?', 'Enrollment in the Certificate Program is open to all students, but to obtain a Certificate within one year a student would be required to have 2 to 3 years prior experience in Bharathanatyam, as the practical requirement for the Certificate program requires knowledge in specific dance routines such as Alarippu, Kavuthuvam and Sabdham.', 2, 1, 'Super Admin', 'Super Admin', '2016-03-14 06:43:31', '2016-03-14 06:43:31'),
(40, 'Can a student withdraw from a course after enrollment?', '<ul type=\\\"disc\\\"><li>If a student withdraws from a course no refund will be provided.</li><li>If a student does not re-join a course within a one-year period, registration has to be completed again.</li></ul>', 2, 1, 'Super Admin', 'Super Admin', '2016-03-14 06:43:56', '2016-03-14 06:43:56'),
(41, 'What are the roles of APAA Authorized Certification Centers (APAC)?', '<ul type=\\\"disc\\\"><li>To provide training and guidance to enroll students to fulfill requirements of the respective program.</li><li>The APAC will also help students prepare for the examinations.</li><li>To conduct proctored examinations and send test papers to APAA.</li><li>To record on videotape or DVD the practical exams and send to APAA for evaluation.</li></ul>', 2, 1, 'Super Admin', 'Super Admin', '2016-03-14 06:44:36', '2016-03-14 06:44:36'),
(42, 'Is a particular dance style forced onto students who join the course?', 'The curriculum has been designed in cooperation with a group of eminent dance teachers with varied dance styles. Therefore no particular style is forced on the student.', 2, 1, 'Super Admin', 'Super Admin', '2016-03-14 06:44:56', '2016-03-14 06:44:56'),
(43, 'What types of learning aids are supplied?', 'On enrollment in a specific program, specific textbooks will be provided that elaborate on the various concepts and techniques of Bharathanatyam. Additionally interactive DVDs are provided to enhance the practical aspects studied through the books. The DVDs vividly describe the precise execution of this art and provide a valuable aid to help students practice what they have leamt at the dance centers.', 2, 1, 'Super Admin', 'Super Admin', '2016-03-14 06:45:13', '2016-03-14 06:45:13'),
(44, 'What is the value of accreditation to US universities?', 'It shows recognition of the students hard work over the past years learning the art and obtaining credits towards a degree program at the University. It will also make the students resume more impressive.', 2, 1, 'Super Admin', 'Super Admin', '2016-03-14 06:45:30', '2016-03-14 06:45:30'),
(45, 'Is this certification given only by Alagappa University from India or is it affiliated with universities in the USA as well?', 'Currently the degrees are given through Alagappa University. However we are working with the US department of Education to get the program accredited as actively seeking affiliation with established US universities. We hope to receive the affiliation by next year.', 2, 1, 'Super Admin', 'Super Admin', '2016-03-14 06:45:47', '2016-03-14 06:45:47'),
(46, 'What is the value of getting certification from this program?', 'Students of Bharathanatyam spend years learning the art and perfecting the practice and most perform the Arangetram which is a graduation performance. This process might typically take about 6 to 7 years for a student. If a student were to pursue studies during this time, they should be able to complete post-graduate studies. However in the pursuit of learning Bharathanatyam, dancers are not awarded degrees or receive certifications for their accomplishments.To reward students for their efforts, APAA has designed a comprehensive curriculum in Bharathanatyam along with Alagappa University in India, to offer step-wise certification programs to meet the student needs. The Alagappa University Certification will certainly enhance the students achievements while applying to Universities for collegiate education.', 2, 1, 'Super Admin', 'Super Admin', '2016-03-14 06:46:06', '2016-03-14 06:46:06');
