INSERT INTO `pages` (`page_id`, `title`, `content`, `status`, `created_by`, `updated_by`, `created_at`, `updated_at`) VALUES
(4, 'about apaa', '<div class=\\\"apaaContent\\\"> 		 <p>Alagappa Performing Arts Academy (APAA) an integral part of the Alagappa group of institutions was founded in 2005 by Mr. Ramanath Vairavan, grandson of Dr. RM. Alagappa Chettiar. The primary objective of APAA is to propagate the exquisite practice of Indian art and culture in their pristine purity and in conformance to tradition.</p><p>APAA in its maiden venture has focused on Bharathanatyam, an art that combines artistic expression, vigorous dancing with a sense of spirituality. Students of Bharathanatyam spend years learning the art and perfecting the practice to perform the Arangetram which is a graduation performance. A student might typically take about 5 to 7 years to perform an Arangetram. If a student were to pursue graduate studies during this time a student should be able to complete post-graduate education. However in pursuit of learning Bharathanatyam, dancers are not awarded degrees or certification for their accomplishment.</p><p>APAA in an effort to fulfill this need has developed a structured learning program, using eminent artistes in the field and designed a comprehensive curriculum in performing arts to demonstrate the repertoire of culture that is embedded in these classical arts. The programs have been designed with specific course work and practicals that a student has to successfully complete to get the respective certification. Effective detailed aids have been developed to enhance the learning process with the comprehensive review of the various aspects of the art. From an overview of the various dances in India , to the rudiments of dancing, to clearly depicting the exquisite language of gestures, postures and rhythmical delivery, a student is guided through the various phases of this intricate art with textbooks that concisely explain its relevance and interactive DVDs that vividly describe the precise execution of the art. These valuable learning aids enhance the comprehension and make this a valuable exercise for students to understand the depth and versatility of this art with theory and practicals integrated in a format similar to academic programs.</p><p>The teaching aids will initially focus on Bharathanatyam and supplemental aids will be added to other classical dance forms of India such as Mohini Attam, Odissi, Kuchipudi, Kathak and Manipuri. These programs are offered through APAA Authorized Certification Centers (APACs) worldwide to enable students to obtain an undergraduate and post graduate degrees in performing arts. The vision of APAA is to obtain accreditation for this program from renowned Universities in the world, propagate and bring prominence not only to Indian performing arts but also to all other dance and music art forms by offering structured learning programs to students worldwide.</p>	</div>', 1, 'Super Admin', 'Super Admin', '2015-12-31 13:41:28', '2016-01-07 10:27:56'),
(5, 'University', '<div class=\\\"apaaContent\\\"> 		 <div class=\\\"universityBgImg\\\"><img width=\\\"210\\\" height=\\\"163\\\" class=\\\"alignnone size-full wp-image-2267\\\" alt=\\\"university-img\\\" src=\\\"http://alagappaarts.com/upload/university-img-11.jpg\\\"></div><p>The Alagappa University is located on about 420 acres in the business town of Karaikudi in Sivaganga District in Tamil Nadu, India about 400 km south of Chennai and about 100 km from Tiruchirappalli and Madurai. The University founded in 1985 owes its existence to its founder the great philanthropist and educationist Dr. RM.Alagappa Chettiar. It was brought into existence by a Special Act of the Government of Tamil Nadu in May 1985 with the objective of fostering research, development and dissemination of knowledge in various branches of learning.</p><p>Alagappa University is recognized by the University Grants Commission (U.G.C.), Government of India. It has 14 full-fledged departments offering regular Postgraduate, M.Phil. and Ph.D programs- (Education, Physical Education, Institute of Management, Bank Management, Corporate Secretaryship, International Business and Commerce, Tamil, Womens Studies, Biotechnology, Computer Science and Engineering, Industrial Chemistry, Mathematics, Oceanography and Costal Area studies). The Directorate of Distance Education was established in the University in 1992. The Directorate offers Under Graduate, Post Graduate & M.Phil. Programs in the disciplines of Management, Computer Applications, Science, Education, Languages and Performing Arts.</p><p>Listed below are the various Alagappa educational institutions:</p><ul><li>The Alagappa College of Technology (1942) in Madras</li><li>Alagappa College of Arts & Science (1947) in Karaikudi</li><li>Dr. Alagappa Chettiar Training College (1950) in Karaikudi</li><li>Dr. Alagappa Chettiar Training College Model High School (1951) in Karaikudi</li><li>Alagappa Chettiar College of Engineering & Technology (1952) in Karaikudi</li><li>Alagappa Montessori School (1953) in Karaikudi</li><li>M. CT. M. Chidambaram Chettiar Memorial. Prep. School (1954)</li><li>Alagappa Primary School (1954) in Karaikudi</li><li>Alagappa Polytechnic (1955) in Karaikudi</li><li>Alagappa Preparatory School (1955) in Karaikudi</li><li>Alagappa School of Music (1956) in Karaikudi</li><li>Alagappa College of Physical Education (1956) in Karaikudi</li></ul>	</div>', 1, 'Super Admin', 'Super Admin', '2016-01-07 10:03:49', '2016-07-14 05:36:59'),
(6, 'Management', '<div class=\\\"apaaContent\\\"><div class=\\\"apaaContentInnerr\\\"><h3>Mr. Ramanath Vairavan, <span>Founder/Chairman</span></h3><div class=\\\"apaaContentInnerrImg\\\"><img width=\\\"140\\\" height=\\\"115\\\" alt=\\\"management-img-1\\\" class=\\\"attachment-homepage wp-post-image\\\" src=\\\"http://alagappaarts.com/upload/management-img-12.gif\\\"></div><p>Mr. Vairavan, the grandson of Dr. RM. Alagappa Chettiar has been an avid student of instrumental music and is passionate about Indian arts. He recognized the need to enable students of the art to get rewarded for their years of rigorous practice and dedication. At the same time he wanted to propagate the practice of these arts in its pristine purity to the western world. Hence he pioneered this novel academic program in performing arts inconformity with tradition. With prior experience in developing structured learning programs for distant education learning coursesin the medical industry, in collaboration withAlagappa University, and able guidance from leading veterans of the art, he has designed this comprehensive program. This program provides an opportunity for avid students to obtain certification for their years of study of this art.Having pioneered the academic program in performing arts with focus on Bharathanatyam with more than 350 students registered in the program worldwide, he has introduced the Vocal and Instrumental Music program recently. Other novel programs about to be introduced includes Vastu Shastra and Vedic Astrology.He is actively pursuing to get accreditation for these academic programs by International Universities.</p><p>Mr. Ramanath Vairavan obtained his undergraduate degree in Chemical Engineering at the Alagappa College of Technology in Madras in 1970 and went on to pursue his post graduate education at Washington University, St. Louis, Missouri, USA, with a Master of Science degree in Biomedical Engineering and a Masters Degree in of Business Administration. He held various executive positions with the multinational company Hoechst AG of Germany in the US, Germany and Singapore. He founded a company in California, named Caldon Biotech Inc., engaged in the development, manufacturing and distribution of clinical diagnostic reagents and instrumentation. He is also a co-founder of AutoGenomics Inc., a company based in California that has developed molecular genetic testing platform that has the versatility to revolutionize the way patients are diagnosed, monitored and managed leading to the era of personalized medicine.</p><p>Being a member of the Dr. Alagappa Chettiar Educational Trust, he is actively involved in the management of the Alagappa Group of institutions in Chennai and Karaikudi.</p> </div><div class=\\\"apaaContentInnerr\\\"><h3>Dr. Umayal Ramanathan, <span>Patron</span></h3><div class=\\\"apaaContentInnerrImg\\\"><img width=\\\"140\\\" height=\\\"115\\\" alt=\\\"management-img-2\\\" class=\\\"attachment-homepage wp-post-image\\\" src=\\\"http://alagappaarts.com/upload/management-img-21.gif\\\"></div><p>The daughter of the great visionary Dr. R.M Alagappa Chettiar, Dr. Mrs. Umayal Ramanathan imbibed all the attributes of her illustrious father, embellished the value of social service and has passionately pursued it ever since. Her mission has clearly been to continue and pave the path to enhance education from primary schooling for children all the way up to professional technical education. She founded two higher secondary schools in her fathers name  one in Karaikudi and another in Chennai. Her crowning achievement was the establishment of the Dr. Umayal Ramanathan College for Women in Karaikudi in 2005 to empower women in this rural conservative community by offering academic programs that will enable them to advance their careers and enhance the quality of life for themselves and their families.</p><p>Apart from being the Secretary and Correspondent of The Alagappa Schools in Chennai and Karaikudi, she has held various important positions such as a member of the Syndicate of The Agricultural University at Coimbatore for two terms and a Member of the Senate of the Madurai Kamaraj University. As an active Social Worker, she was the member of the Social Welfare Board for Ramnad District for 2 terms. She was the Chairman in the Gangadeeshwarar Temple Committee for 3 years following which she became the Thakkar of the same temple.</p><ul>Her service to the cause of education and society was duly recognized when she was awarded:<p></p><li>The Doctor of letters Degree by the Honourable Governor of Tamil Nadu in 1987.</li><li>The prestigious Indira Gandhi Priyadarshini award for her outstanding services to society in 1994.</li><li>The Doctor of letters Degree from Madras University on its 150th Anniversary in 2007.</li></ul> </div><div class=\\\"apaaContentInnerr\\\"><h3>Mrs. Alagu Vairavan, <span>Managing Director</span></h3><div class=\\\"apaaContentInnerrImg\\\"><img width=\\\"140\\\" height=\\\"115\\\" alt=\\\"management-img-3\\\" class=\\\"attachment-homepage wp-post-image\\\" src=\\\"http://alagappaarts.com/upload/management-img-32.gif\\\"></div><p>As an avid enthusiast of Bharathanatyam, Mrs. Vairavan has groomed her children through Arangetrams in Bharathanatyam and Carnatic music. She is passionate about propagating this art and has worked actively in social organizations. She has a Bachelors Degree in Business Administration and has worked in a wide spectrum of market segments, from manufacturing of cosmetics in London, England to network marketing as in Shaklee Corporation in Boston, MA and social service organizations in the US.</p> </div><div class=\\\"apaaContentInnerr\\\"><h3>Mr. G. Naresh Kumar, <span>General Manager</span></h3><div class=\\\"apaaContentInnerrImg\\\"><img width=\\\"140\\\" height=\\\"115\\\" alt=\\\"management-img-4\\\" class=\\\"attachment-homepage wp-post-image\\\" src=\\\"http://alagappaarts.com/upload/management-img-42.gif\\\"></div><p>Has been actively involved with the Alagappa group of institutions since 1997 serving as the Vice President, Operations of the Alagappa Institute of Technology, a service-oriented institution with a primary focus on providing education in emerging academic disciplines such as Information Technology. He is actively involved in setting up distant education centers for universities such as Alagappa University, Manipal University, Pondicherry University in India and Malaysia.</p> </div><div class=\\\"apaaContentInnerr\\\"><h3>A G Rajagopal, <span>Academic Counsellor</span></h3><div class=\\\"apaaContentInnerrImg\\\"><img width=\\\"140\\\" height=\\\"115\\\" alt=\\\"iyappan\\\" class=\\\"attachment-homepage wp-post-image\\\" src=\\\"http://alagappaarts.com/upload/iyappan1.jpg\\\"></div><p>Appadurai Govindasamy Rajagopal alias Iyappan is an accomplished Astrologer. Schooled by Vedic teachers from an early age he became proficient in astrology under the personal tutelage of a revered saint in Kollimalai located in Namakkal district using the traditional method of reading palm leafs written by Agathiyar. He is passionate about the subject and has written several articles and columns in journals on Astrology. As Astrology integrates various belief systems correlating a relationship between astronomical phenomena and events that take place, Mr. Rajagopal has done a lot of research in this field and is in the process of developing a structured learning program so that students will be able to obtain a degree in Astrology.</p> </div></div>', 1, 'Super Admin', 'Super Admin', '2016-01-07 10:29:42', '2016-07-14 05:38:09'),
(7, 'Objective', '<div class=\\\"apaaContent\\\"> 		 <div class=\\\"apaaObjectiveContent\\\"><ul><li>To propagate the exquisite practice of Indian Art and Culture in their pristine purity and in conformity with traditions.</li><li>To develop structured learning programs to teach Classical Performing Arts and enhance comprehension through use of interactive educational aids.</li><li>To start with Bharathanatyam as the first such program and follow it up with other dances and instruments that are generally used.</li></ul></div>	</div>', 1, 'Super Admin', 'Super Admin', '2016-01-07 10:31:47', '2016-01-07 10:32:40'),
(8, 'Advisory board', '<div class=\\\"apaaContent\\\"><div class=\\\"apaaContentInnerr\\\"><h3>Mentor: Late Mrs. Padmini Ramachandran</h3><div class=\\\"apaaContentInnerrImg\\\"><img width=\\\"140\\\" height=\\\"115\\\" alt=\\\"padmini-img\\\" class=\\\"attachment-homepage wp-post-image\\\" src=\\\"http://alagappaarts.com/upload/padmini-img1.jpg\\\"></div><p>Special respects and homage is paid to Mrs. Padmini Ramachandran the person who inspired to set up such an academic program in arts. Star of more than 250 Indian movies she popularized Bharathanatyam and set the standard for the pseudo-classical style of dance that is now widely used in the Indian cinema. In 1977 she started a dance academy, the Padmini Institute of Fine Arts and soon the school had five branches in New Jersey and New York. Along with her elder sister, Lalitha, and younger sister, Ragini, who were also talented actresses and dancers, the three were known as the Travancore Sisters. She learned Bharathanatyam under tutelage of Veteran Sri Vazhuvoor Ramaiah Pillai of Tanjore. She was the recipient of Padma Sri from the government of India and Shantala awards. She was known around South India as Ulaga Natya Peroli. (See her video message recorded two weeks prior to her passing</p> </div><div class=\\\"apaaContentInnerr\\\"><h3>Sri. Madurai R. Muralidharan</h3><div class=\\\"apaaContentInnerrImg\\\"><img width=\\\"140\\\" height=\\\"115\\\" alt=\\\"muralidharan-img\\\" class=\\\"attachment-homepage wp-post-image\\\" src=\\\"http://alagappaarts.com/upload/muralidharan-img1.jpg\\\"></div><p>Madurai R. Muralidharan is an accomplished Bharathanatyam dancer, singer, choreographer, nattuvanar, composer and Guru who was a student of Guru Kalaimamani Chamundeeswari (a senior disciple of Padmashree K.N.Dandayudapani Pillai). He was initiated in the art of Bharathanatyam at the age of 7. He assumed the Directorship of a Dance Institution, namely Nrithyakshethra, in 1978 from his Guru and has trained more than 1000 students from all over the world in this art, with over 150 Arangetrams so far.He manages the academy with his wife Smt. Chitra Muralidharan who is also a well- known dancer and teacher.</p><p>He has choreographed and performed several dance ballets along with his wife and students all over the world. He has given several dance programs both in India and abroad including the US</p> </div><div class=\\\"apaaContentInnerr\\\"><h3>Kalaimamani Dr.M.S. Sarala</h3><div class=\\\"apaaContentInnerrImg\\\"><img width=\\\"140\\\" height=\\\"115\\\" alt=\\\"sarala-img\\\" class=\\\"attachment-homepage wp-post-image\\\" src=\\\"http://alagappaarts.com/upload/sarala-img2.jpg\\\"></div><p>Kalaimamani Dr.M.S.Sarala is an accomplished dancer who is a disciple of Smt.K.J.Sarasa and Padma Bhushan Dr. Padma Subramaniam. She received her Doctorate Degree in dancing from Annamalai University, Tamilnadu, India. She started dancing at the age of 14 and has given numerous performances in India and abroad.<br>She created and choreographed the dance and music for the dance drama Ekalaivan which has been an outstanding success with a strong message to the audience to broaden their outlook towards society. She has participated in many conferences and given lectures both in India and abroad.</p><p>She is a Visiting Professor of Fine Arts at the Alagappa University Karaikudi and a member of the Management Board of CECRI Kendra Vidhayalaya, Karaikudi, Tamilnadu, India. Complementing these activities she manages a dance institution named Kalaikoil at Karaikudi.</p> </div><div class=\\\"apaaContentInnerr\\\"><h3>Ms.Vishal Ramani</h3><div class=\\\"apaaContentInnerrImg\\\"><img width=\\\"140\\\" height=\\\"115\\\" alt=\\\"ramani-img\\\" class=\\\"attachment-homepage wp-post-image\\\" src=\\\"http://alagappaarts.com/upload/ramani-img1.jpg\\\"></div><p>Ms.Vishal Ramani is the Founder- Director of the Shri Krupa Dance Foundation in San Jose, one of the leading schools of Bharathanatyam in the Bay Area. She has been teaching the Bharathanatyam art form since 1977. Vishal received rigorous training in the Thanjavur style of Bharathanatyam from Guru Mahalingam Pillai and Guru Govinda Raj Pillai of Shri Raja Rajeshwari Bharata Natya Kala Mandir of Bombay. Her dance debut (Arangetram) was at the age of 6 at the Poddar College in Bombay. Having finished her Arangetram</p> </div><div class=\\\"apaaContentInnerr\\\"><h3>K.R REKHA  APAA Academic Affairs Manager</h3><div class=\\\"apaaContentInnerrImg\\\"><img width=\\\"140\\\" height=\\\"115\\\" alt=\\\"rekha1-img\\\" class=\\\"attachment-homepage wp-post-image\\\" src=\\\"http://alagappaarts.com/upload/rekha1.jpg\\\"></div><p>Smt K.R Rekha is an ardent disciple of Dr. Padma Subrahmanyam for more than three decades, a versatile BharataNatyam dancer with many notable performances in her repertoire. She is a Masters Degree holder in BharataNatyam from Madras University and also she is a Graduate in Law. She started her BharataNatyam training at the age of 5 with her Guru Smt. Saroja in Vazhuvoor and later she joined in Nrithyodaya dance class, Chennai for advanced training. </p><p>She has completed 4 years  Course of Nrithya Pravesika, 5 years of Nrithya Visaradha and 2 years of post diploma in Nrithya Sali. She also got special training in 108 Karanas and Nattuvangam and received the title Bharata Nritya Priya. And also she has registered in University of Madras to do her Ph.D</p> </div><div class=\\\"apaaContentInnerr\\\"><h3>Smt. Sujatha Mohan</h3><div class=\\\"apaaContentInnerrImg\\\"><img width=\\\"140\\\" height=\\\"115\\\" alt=\\\"sujatha-img\\\" class=\\\"attachment-homepage wp-post-image\\\" src=\\\"http://alagappaarts.com/upload/sujatha-img1.jpg\\\"></div><p>Smt. Sujatha Mohan, M.A. M.Phil (Sanskrit Litt.) (M.F.A. Bharathanatyam) is one of the senior-most disciples of the world renowned danseuse Padmabhushan Dr. Padma Subrahmanyam. Smt. Sujatha has completed formal training in her Gurus Institution Nrithyodaya and has been in this field for more than three decades. She has given innumerable performances in India and abroad accompanying her Guru. She started her dance Institution Padmashree Nrithyalaya in the year 1997. Sujatha has conducted work-shops (theory and practical classes) in Karanas and Natyasastra in Singapore, the U.S.A. and Switzerland. She is currently pursuing Ph.D. in Natyasastra. Some of her awards are Bharatha Nritya Priya and Padma Bharathi.</p> </div><div class=\\\"apaaContentInnerr\\\"><h3>Smt. Lakshmi Ramaswamy</h3><div class=\\\"apaaContentInnerrImg\\\"><img width=\\\"140\\\" height=\\\"115\\\" alt=\\\"lakshmi-img\\\" class=\\\"attachment-homepage wp-post-image\\\" src=\\\"http://alagappaarts.com/upload/lakshmi-img1.jpg\\\"></div><p>Smt. Lakshmi Ramaswamy has carved a niche for herself in the genre of Bharathanatyam as a performer, teacher, choreographer and researcher and is the Artistic director of Sri Mudhraalaya, where she gives holistic training to young aspirants of this rich art form. She is a holder of twin Masters Degrees in Commerce and Bharathanatyam and has now enrolled for her Ph.D. in the Department of Indian Music, Madras University, where she also works as a Guest Faculty. Lakshmi has trained in Natyam from stalwarts like Chitra Visweswaran, Padma Subrahmanyam, Kalanidhi Narayan and Tamil literature from Dr. S. Raghuraman. She was the only dancer selected from India for Fulbright fellowship to do Arts and Culture Management Studies in the year 2000 and spent six months at Golden Gate University, San Francisco, USA. She has translated the book, History of Tamils Dance and co-authored Natana Kalaichol Kalanjiam apart from contributing articles to dance and music journals.</p> </div></div>', 1, 'Super Admin', 'Super Admin', '2016-01-07 10:34:00', '2016-07-14 05:39:13'),
(9, 'Future Plans', '<div class=\\\"apaaContent\\\"> 		 <p class=\\\"fs17\\\">The Alagappa Performing Arts Academy has a vision to propagate and bring prominence to performing art forms throughout the world by providing high quality education to all art lovers by way of structured learning programs.</p><p class=\\\"fs17\\\">Following the implementation and optimization of the structured learning program in Bharathanatyam, APAA intends to pursue and develop structured learning programs in other dance forms like Kathakali, Kuchipudi, Kathak etc,.</p><p class=\\\"fs17\\\">Plans are also underway to develop and implement programs in Instrumental music to educate and enhance students around the world.</p>	</div>', 1, 'Super Admin', 'Super Admin', '2016-01-07 10:36:15', '2016-01-07 10:39:56'),
(10, 'Accreditation', '<div class=\\\"apaaContent\\\"> 		 <p><a data-rel=\\\"lightbox-0\\\" href=\\\"http://alagappaarts.com/upload/center-accreditation-l1.png\\\" title=\\\"Certificate of Accreditation\\\"><img width=\\\"265\\\" height=\\\"211\\\" alt=\\\"student-accreditation-certificate\\\" src=\\\"http://alagappaarts.com/upload/student-accreditation-certificate1.jpg\\\" class=\\\"accreditationimg size-medium wp-image-2294\\\"></a> <a data-rel=\\\"lightbox-1\\\" href=\\\"http://alagappaarts.com/upload/accreditation1.jpg\\\" title=\\\"Certificate of Accreditation\\\"><img width=\\\"265\\\" height=\\\"211\\\" alt=\\\"center-accreditation-certificate\\\" src=\\\"http://alagappaarts.com/upload/center-accreditation-certificate1.jpg\\\" class=\\\"accreditationimg size-full wp-image-2293\\\"></a> <a data-rel=\\\"lightbox-2\\\" href=\\\"http://alagappaarts.com/upload/statement-of-marks-I1.jpg\\\" title=\\\"Statement of Marks\\\"><img width=\\\"265\\\" height=\\\"211\\\" alt=\\\"statement-of-marks\\\" src=\\\"http://alagappaarts.com/upload/statement-of-marks1.jpg\\\" class=\\\"accreditationimg size-medium wp-image-2296\\\"></a> <a data-rel=\\\"lightbox-3\\\" href=\\\"http://alagappaarts.com/upload/certificate1.jpg\\\" title=\\\"Certificate\\\"><img width=\\\"265\\\" height=\\\"211\\\" alt=\\\"certificate\\\" src=\\\"http://alagappaarts.com/upload/certificate.jpg\\\" class=\\\"accreditationimg size-medium wp-image-2295\\\"></a></p>	</div>', 1, 'Super Admin', 'Super Admin', '2016-01-07 10:41:27', '2016-07-14 05:40:31'),
(11, 'Heritage', '<div class=\\\"apaaContent\\\"> 		 <p>Three millennia ago, Bharata wrote an exhaustive treatise on the three prominent arts of dance in inordinate detail.</p><p>Bharathanatyam is a classical dance style of Southern India that combines artistic expression with a sense of spirituality. The name Bharathanatyam is derived from three basic concepts of Bhava, Raga and Thaala. The dance is performed on the stage as Nritham, Nrithyam and Natyam. Bharathanatyam is based on the theories of the books Natyasaasthram* and Abhinaya Darpanam. The dance form is based on Adavus (steps) and Hasthamudra (hand gestures). There are 64 basic Adavus and they are divided into 9 parts, of which Thattadavu, Naatadavu, Kuthithumettadavu, Mandiadavu, Sarikkal and Thattumettu are very important. Communication is done through Bhavabhinaya (facial expression) and Hasthamudra (hand gestures).</p><p>The sequence of a dance performance is Alarippu, Jathiswaram, Sabdam, Varnam, Padam and Thillana. After Thillana, with a Mangala Slokam the dance program ends. Normally the performance lasts for two to two and half hours. Dancers wear traditional costumes consisting of specially made saris, jewelry and hair ornaments and specifically applied facial and body make-up. The dancers wear a lot of ornaments of shining stones on neck, ears, hands and head, jasmine garland in the hair and foot trinket with small bells.</p><p>The music of Bharathanatyam is based on Carnatic classical music. The instruments used are Veena, Flute, Mridangam and Violin. The dance direction is done by Nattuvanar giving the Talam using hand symbols and singing Vaaythari. Generally there will be two singers. Because of its intricacy and specificity, Bharathanatyam can be used to enact any story in any language.</p>	</div>', 1, 'Super Admin', 'Super Admin', '2016-01-07 11:12:02', '2016-01-07 11:12:11'),
(12, 'Festivals', '<div class=\\\"apaaContent\\\"><p>Listed below are some of the dance festivals of India which are famous for the various renowned artists who perform in the beautiful backdrops of the age old temples, where they are held every year. These festivals attract a large audience from both India and abroad. They create a divine ambience around both the artistes and the spectators.</p><div class=\\\"apaaContentInnerr\\\"><h3>Natyanjali Festival in Chidambaram</h3><div class=\\\"apaafestivalImg\\\"><img width=\\\"350\\\" height=\\\"200\\\" alt=\\\"chidambaram-img\\\" class=\\\"attachment-homepage wp-post-image\\\" src=\\\"http://alagappaarts.com/upload/chidambaram-img1.jpg\\\"></div><p>Natyanjali festival opens on the auspicious occasion of the Maha Shivaratri day in the Chidambaram temple. The magnificent temple dedicated to Lord Shiva, built a thousand years ago, provides a beautiful backdrop for the event. The setting is truly divine-Chidambarams gold-roofed temple, with pillars depicting Lord Nataraja in 108 poses or Karanas. This is an opportunity for all dancers, from all over India, to perform and pay their tribute to Lord Nataraja. The festival lasts for 5 days.</p> </div><div class=\\\"apaaContentInnerr\\\"><h3>Mamallapuram Dance Festival</h3><div class=\\\"apaafestivalImg\\\"><img width=\\\"350\\\" height=\\\"200\\\" alt=\\\"mamallapuram-img\\\" class=\\\"attachment-homepage wp-post-image\\\" src=\\\"http://alagappaarts.com/upload/mamallapuram-img1.jpg\\\"></div><p>In Mamallapuram, the ancient port of Pallavas and locatiion of the world famous shore temples, a vibrant dance festival is held. Thousands congregate at the venue of Arjunas penance, a bas-relief sculpted on the face of two enormous adjacent rocks. This festival is held from early January for four weeks. Exponents of classical dances like Bharathanatyam, Kuchipudi, Kathak, Kathakali etc. perform in an open air stage against the magnificent backdrop of the Pallava rock sculptures. Besides classical, folk dances are also performed. Dancers from different parts of India perform during this festival.</p> </div><div class=\\\"apaaContentInnerr\\\"><h3>Konark Dance Festival</h3><div class=\\\"apaafestivalImg\\\"><img width=\\\"350\\\" height=\\\"200\\\" alt=\\\"konark-img\\\" class=\\\"attachment-homepage wp-post-image\\\" src=\\\"http://alagappaarts.com/upload/konark-img2.jpg\\\"></div><p>The sun temple in Konark is famed as a world heritage site. The exquisite Natyamandir or the dancing hall of this 700- year old shrine is an architectural wonder with well-adorned sculptures in Odissi dance poses. This is the venue of a joyous festival of classical dance and music which is held annually on December. A host of celebrated dancers from all over the country perform in the open air auditorium. The festival is a celebration of the much appreciated Odissi, Bharathanatyam, Manipuri, Kathak and Chau Dance  a lavish feast for the eyes and ears.</p> </div><div class=\\\"apaaContentInnerr\\\"><h3>Chennai Dance & Music Festival</h3><div class=\\\"apaafestivalImg\\\"><img width=\\\"350\\\" height=\\\"200\\\" alt=\\\"chennaifestival-img\\\" class=\\\"attachment-homepage wp-post-image\\\" src=\\\"http://alagappaarts.com/upload/chennaifestival-img1.jpg\\\"></div><p>Chennai music and dance festival is a celebration of classical music and dance of South India held during mid December to mid January in the city of Chennai. The festival is held at a number of venues around the city by various sabhas or organizations. The month long dance and music extravaganza has performances of famous artistes from various parts of India. The city comes alive with the festival which has now developed into a cultural extravaganza with more than 2000 participants in over 300 concerts. Performances include Vocal and Instrumental music. Dance solo and group, both by junior and senior artistes. Even upcoming artists get a chance to perform along with well-established artists. The season goes on till mid January when the scene shifts to Tiruvaiyaru to celebrate the birth of one of the greatest Carnatic composers and one of the trinity of music  Thyagaraja.</p> </div></div>', 1, 'Super Admin', 'Super Admin', '2016-01-07 11:20:54', '2016-07-14 05:41:23'),
(13, 'Academics', '<div class=\\\"apaaContent\\\"> 		 <div class=\\\"apaaContentInnerr\\\"><h4>Certificate in Performing Arts:</h4><p>This program provides an overview of the fundamental concepts of Bharathanatyam with a historical perspective. The rudimentary concepts of Nritha, Nrithya and Natya are explained. To portray an aesthetic profiles the student will learn about the types of instruments used in Bharathanatyam and understand basic dancing Parlance. In addition they will be exposed to adavu (The basic footsteps). A student will be required to perform a dance recital such as Alarippu, (an invocation) and Shabdam (traditional basic dance item with introduction of Bhava). Students enrolled in this course will take 1 to 3 years to complete this program.<br><a href=\\\"http://alagappaarts.com/dance/academics/apaa-programs?0\\\" title=\\\"Certificate program\\\">More</a></p><h4>Associate Degree in Performing Arts:</h4><p>This program covers the basic and essential expressions in Bharathanatyam. Abhinaya, its usage and importance are explained. On completion of this one year program after the Certificate, the students will realize the enduring and enthralling beauty of Bharathanatyam. Manifest in various types of Chari (walking pattern), different varieties of Kavuthuvam,Jathiswaram, (combination of notes with Bharathanatyam steps).Keerthanai and Kavadichindu<br><a href=\\\"http://alagappaarts.com/dance/academics/apaa-programs?1\\\" title=\\\"Associate Degree\\\">More</a></p><h4>Diploma in Performing Arts:</h4><p>This program reviews the eternal passion of Abhinaya (Facial expressions) and Angas (expressive communications through the body). On completion of this one-year program after the Associate Degree the student should know how to perform the Varnam, the piece de resistance of Bharathanatyam that is immensely traditional and known for its grace, vigor and expressive brilliance and the Thodayamangalam, Pushpanjali, Thillana and Padam which explores the various Rasas, Bhavas and Nayikas.<br><a href=\\\"http://alagappaarts.com/dance/academics/apaa-programs?2\\\" title=\\\"Diploma Program\\\">More</a></p><h4>Bachelors Degree in Performing Arts:</h4><p>This program introduces the student to Nattuvangam. On completion of this one year program after Diploma the students will be learning one full margam , Pushpanjali, Varnam , Thillana, Javali, Mallari, Jathiswaram, Ashtapathi, Thevaram, TIrupughaz, Thallattu, prepared to execute choreographical combinations of footwork, hand gestures and expression. A thorough knowledge of Bharathanatyam acquired in other courses combined with this training in choreography and Nattuvangam enhances the students abilitiy to perform both traditional pieces and newer ones.<br><a href=\\\"http://alagappaarts.com/dance/academics/apaa-programs?3\\\" title=\\\"Bachelors Degree\\\">More</a></p></div>	</div>', 1, 'Super Admin', 'Super Admin', '2016-01-07 11:25:02', '2016-01-07 11:25:32'),
(14, 'Eligibility', '<div class=\\\"apaaContent\\\"> 		 <div class=\\\"apaaContentInnerr\\\"><h4>Certificate in Performing Arts</h4><p>A student must be 10 years of age to enroll in the program. Students should be able to read and comprehend the prescribed textbooks and write their exams independently. In special cases on recommendation of APAC where a student is less than 10 years of age and has demonstrated the ability to comprehend the prescribed textbook a student may be admitted to the program. APAA will review and reserve the right to admit any student.</p><h4>Associate Degree in Performing Arts</h4><p>Completion of Certificate Course from APAA.</p><h4>Diploma in Performing Arts</h4><p>Completion of Associate Degree from APAA and knowledge of Alarippu, Jathiswaram and Padam in addition to the various Bedhas in Bharathanatyam.</p><h4>Bachelors Degree in Performing Arts</h4><p>Completion of Diploma Program from APAA. Minimum age of 16 years is must.</p></div>	</div>', 1, 'Super Admin', 'Super Admin', '2016-01-07 11:26:33', '2016-01-07 11:26:39'),
(15, 'Fast track', '<div class=\\\"apaaContent\\\"> 		 <div class=\\\"fasttrackContent\\\"><ul><li>The FAST Track Program has been set up to enable students who have prior knowledge in Bharathanatyam to obtain rapid certification (Certification and Associate Degree).</li><li>A student must enroll and complete successfully the theory courses for the Certificate and Associate Degrees.</li><li>Student needs to submit on DVD the required dances for each of the programs.</li><li>The Certificate program may be completed within 3 months.</li><li>The Associate Degree program may be completed within 3 months after completion of Certificate program.</li><li>A mandatory 2- year residency thereafter is required to obtain the Bachelors Degree.</li><li>APAA reserves the right to make final decision on acceptance of the student to the FAST TRACK program.</li></ul></div>	</div>', 1, 'Super Admin', 'Super Admin', '2016-01-07 11:27:22', '2016-01-07 11:27:28'),
(16, 'Events', '<div class=\\\"apaaContent\\\"> 		 <div class=\\\"apaaContentInnerr\\\"><h4>San Jose, California</h4><p>For the first time in US, a structured degree program for a degree in Bharathanatyam has been created by the renowned Alagappa University, Karaikudi, India and the Alagappa Performing Arts Academy (APAA), Escondido, California. The program in Milpitas, California was launched at 4.00pm on November 26th 2005 at ICC Milpitas. Chairman Mr.Vairavan releasing the degree program learning aids to Professor George Hart, University of California, Berkeley, CA accompanied by Managing Director, Mrs. Alagu Vairavan, Mrs. Vishal Ramani, Founder/Director Shri Krupa Dance Academy, San Jose, CA and well known Cini Star Mrs. Padmini Ramachandran.<br><a target=\\\"_blank\\\" href=\\\"http://nripulse.com/CityNews_CA_Srikrupa.html\\\">http://nripulse.com/CityNews_CA_Srikrupa.html</a></p><h4>Houston, Texas</h4><p>The program in Houston was launched at 3.30pm on February 11, 2006 at Rathna Kumars Anjali Center, 2615 Cordes Plaza, Sugarland, Texas. With over hundred guests attending the event was graced by Mr &amp; Mrs. S.M. Gavai, Consulate General of India, Houston, Texas.</p><h4>Jarkata, Indonesia</h4><p>For the first time in Indonesia, the novel program for Bharathanatyam students was launched on September 9th, 2007 by Kalavrsti &ndash; A shower of fine arts. More than hundred guests accompanied and 20 students have registered on the same day.<br><a target=\\\"_blank\\\" href=\\\"http://www.freewebs.com/kalavrsti/launchofapcc.htm\\\">http://www.freewebs.com/kalavrsti/launchofapcc.htm</a></p></div>	</div>', 1, 'Super Admin', 'Super Admin', '2016-01-07 11:28:57', '2016-01-07 11:29:06'),
(17, 'Announcement', '<div class=\\\"apaaContent\\\"> 		 <ul><li>APAA registration takes place through out the year</li><li>Dance Centers and Production/ Shows</li></ul>	</div>', 1, 'Super Admin', 'Super Admin', '2016-01-07 11:29:43', '2016-01-07 11:29:52'),
(18, 'Online Exam', '<div class=\\\"apaaContent\\\"> 		 <div class=\\\"apaaContentInnerr\\\"><h4>Instructions for Students to take Online Exams</h4><p>1. Log in to your account by going to the <em>REGISTRATION </em>tab<br>2. Once you access your account, you will get details of past payment/ payment due/previous examination results/ schedule for the next exams.<br>3. Go now to the EXAM tab and highlight <em>SAMPLE EXAM</em>.<br>4. The date of the examination will be notified by APAA to the students.<br>5. The student must appear for the examination during the prescribed date and time.( please note this is a timed examination).<br>6. On completion of the exams, results will be notified and communicated separately by APAA<br>7. Practical examination DVDs should be completed and sent to APAA for evaluation<br>8. Assigned written project should be submitted along with the practical DVD submission.</p><h4>Technical Instruction</h4><p><strong>Browser compatibility: </strong><br>The online exam application is compatible with the following browsers,<br>Internet Explorer(IE) &ndash; Version 7 and higher<br>Mozilla Firefox &ndash; version 2.0 and higher<br>Chrome<br>Apple Safari<br>Opera</p><p><strong>JavaScript Enabled</strong><br>The browser should be JavaScript enabled. You can check whether the JavaScript in web pages is permitted to execute or not.You can enable JavaScript by following the instructions from the mentioned links,</p><p>1. Mozilla Firefox<br><a target=\\\"_blank\\\" href=\\\"http://enable-javascript.com/#firefox\\\">http://enable-javascript.com/#firefox</a><br>2. Internet Explorer<br><a target=\\\"_blank\\\" href=\\\"http://enable-javascript.com/#ie\\\">http://enable-javascript.com/#ie</a><br>3. Chrome<br><a target=\\\"_blank\\\" href=\\\"http://enable-javascript.com/#chrome\\\">http://enable-javascript.com/#chrome</a><br>4. Apple Safari<br><a target=\\\"_blank\\\" href=\\\"http://enable-javascript.com/#safari\\\">http://enable-javascript.com/#safari</a><br>5. Opera<br><a target=\\\"_blank\\\" href=\\\"http://enable-javascript.com/#opera\\\">http://enable-javascript.com/#opera</a></p></div>	</div>', 1, 'Super Admin', 'Super Admin', '2016-01-07 15:02:26', '2016-01-07 15:02:35'),
(19, 'news', '<div class=\\\"apaaContent\\\">        <div class=\\\"newsOuter\\\">          <div class=\\\"newsLeft\\\">              <span>Aug</span>            <span class=\\\"year\\\">2017</span>              <p>26</p>  </div>        <div class=\\\"newsRight\\\">            <span>Ms.Anika Karody          </span><p>Disciple of Smt.Vishal Ramani - Shri Krupa Dance Company, completed her Arangetram successfully on 26th August at Cubberly Community Center Theatre, Palo Alto, California, USA.</p>  </div>            </div>        <div class=\\\"newsOuter\\\">          <div class=\\\"newsLeft\\\">              <span>July</span>            <span class=\\\"year\\\">2017</span>              <p>23</p>  </div>        <div class=\\\"newsRight\\\">            <span>Ms.Bhoomika Kumar          </span><p>Ms.Bhoomika Kumar, from Dallas, TX disciple of Smt. Jeyanthi Ghatraju, Boston, MA, has successfully completed her Arangetram in Bengaluru on July 23, 2017! It was quite an achievement for both the student and the guru - proving the fact \\\"so long as there is a will, there is a way!\\\"</p>  </div>            </div>       <div class=\\\"newsOuter\\\">          <div class=\\\"newsLeft\\\">             <span>Sep</span><span class=\\\"year\\\">2016</span>  <p>20</p>  </div>              <div class=\\\"newsRight\\\"><span>Isha Gondi</span><p>Disciple of Smt.Deepali Vora  Nitya Shetra Dance School, completed her Arangetram successfully in Log Angeles, USA.</p>  </div>  </div>  	               <div class=\\\"newsOuter\\\">                  <div class=\\\"newsLeft\\\">                     <span>Oct</span><span class=\\\"year\\\">2015</span>  <p>14</p>  </div>  <div class=\\\"newsRight\\\"><span>Sangeetha Ramachandran</span><p>Disciple of Smt.Deepali Vora  Nitya Shetra Dance School, completed her Arangetram successfully in Log Angeles, USA.</p>  </div>  </div>                      <div class=\\\"newsOuter\\\">  <div class=\\\"newsLeft\\\">  <span>Aug</span><span class=\\\"year\\\">2015</span>  <p>07</p>  </div>  <div class=\\\"newsRight\\\"><span>Bharata Utsav 2011</span><p>Bharata School of Dance & Music (APAC) Celebrated Bharata Utsav 2011 to commemorate the 10th Anniversary. 60 dancers and singers enthralled the audience with their performance.</p>  </div>  </div>   </div>', 1, 'Super Admin', 'Super Admin', '2016-01-12 09:39:37', '2017-12-15 07:19:29'),
(20, 'featured dancer', '<div class=\\\"apaaContent featuredancerContent\\\">           <h4>Vishal Ramani</h4><p><img width=\\\"627\\\" height=\\\"359\\\" alt=\\\"vishal-ramani\\\" src=\\\"http://alagappaarts.com/dance/wp-content/uploads/sites/2/2016/01/vishal-ramani.png\\\" class=\\\"aligncenter size-full wp-image-2752\\\"></p><p>Ms. Vishal Ramani, theacclaimed classical danceris an accomplished choreographer living inthe San Francisco Bay areafor about 38 years. She is the Founder- Director of the Shri Krupa Dance Foundation in San Jose, the very first classical dance school founded to impart Bharathanatyam to both the second generation Indians as well as Non-Indian enthusiasts in the US.</p><p>She is a recipient of many awards and distinctions, including</p><ul><li><strong>The Cleveland Aradhana Committee award</strong></li><li><strong>The Barcelona First Place for Choreography and for development of our Ethnicity in the US,</strong></li><li><strong>The Mayors Award in Barcelona, Spain</strong></li><li><strong>The Best Teacher Award from Papanasam Sivan Committee</strong></li><li><strong>Award of Excellence from the FIA for Community and Artistic Services</strong></li><li><strong>Lifetime Achievement Award from Whos Who World Wide Branding</strong></li><li><strong>Lifetime Achievement Award from TACH foundation, US Chapter and many more.</strong></li></ul><p>APAA is proud to feature Ms. Vishal Ramani on its website and pay tribute to her pioneering accomplishments including conducting more than 100 Arangetrams in the Bay area. She is active member on the advisory board of APAA and has the distinction of being the first school to launch the APAA programs worldwide in 2006.</p><p>Through this feature it is the intention of APAA to profilesome of our accomplished program directors and the more than 500 talented students who have enrolled in the APAA structured learning programs.</p>  <div class=\\\"datebg\\\">Jan <span>2016</span></div></div>', 1, 'Super Admin', 'Super Admin', '2016-01-12 09:41:36', '2016-01-12 09:49:00'),
(23, 'sssss', '<div class=\\\"apaaContent\\\"> 		 <p>Three millennia ago, Bharata wrote an exhaustive treatise on the three prominent arts of dance in inordinate detail.</p><p>Bharathanatyam is a classical dance style of Southern India that combines artistic expression with a sense of spirituality. The name Bharathanatyam is derived from three basic concepts of Bhava, Raga and Thaala. The dance is performed on the stage as Nritham, Nrithyam and Natyam. Bharathanatyam is based on the theories of the books Natyasaasthram* and Abhinaya Darpanam. The dance form is based on Adavus (steps) and Hasthamudra (hand gestures). There are 64 basic Adavus and they are divided into 9 parts, of which Thattadavu, Naatadavu, Kuthithumettadavu, Mandiadavu, Sarikkal and Thattumettu are very important. Communication is done through Bhavabhinaya (facial expression) and Hasthamudra (hand gestures).</p><p>The sequence of a dance performance is Alarippu, Jathiswaram, Sabdam, Varnam, Padam and Thillana. After Thillana, with a Mangala Slokam the dance program ends. Normally the performance lasts for two to two and half hours. Dancers wear traditional costumes consisting of specially made saris, jewelry and hair ornaments and specifically applied facial and body make-up. The dancers wear a lot of ornaments of shining stones on neck, ears, hands and head, jasmine garland in the hair and foot trinket with small bells.</p><p>The music of Bharathanatyam is based on Carnatic classical music. The instruments used are Veena, Flute, Mridangam and Violin. The dance direction is done by Nattuvanar giving the Talam using hand symbols and singing Vaaythari. Generally there will be two singers. Because of its intricacy and specificity, Bharathanatyam can be used to enact any story in any language.</p>	</div>', 1, 'Super Admin', 'Super Admin', '2016-03-04 11:18:25', '2016-03-04 11:19:29'),
